(74, 284, 'Nữ Vương Trọng Sinh Ngược Tra Nam', '', ',35', 'nu-vuong-trong-sinh-nguoc-tra-nam', '', '', 'https://i.imgur.com/kPzogdqm.jpg', 'Hành động tiêu chuẩn sau khi trọng sinh là gì ? Tay trái để lộ cả gia đình tra nam cặn bã, tay phải ôm đùi bá đạo tổng tài. Phu Nhân :  “Chồng à, nếu bị ông chủ mắng là chó thì phải làm sao ?” Tổng Tài : “Sắp xếp, phu nhân thăng chức để cho ông chủ cũ quỳ làm chó !” Phu Nhân : “Chồng ơi, lương thấp quá không thể nuôi nổi con phải làm sao bây giờ? \" Tổng Tài : \" Thu xếp, cho Hoàng hậu tăng lương, nâng lương lên 10 triệu tệ mỗi năm !\" Tổng Tài không có điểm mấu chốt đối với vợ yêu của mình, ta cho ngươi hết tài sản, ta cũng là của ngươi đó là quy tắc của Tổng Tài đối với vợ !&nbsp;', 0, '3282', 0, 0, 0, 0, 'Nữ Vương Trọng Sinh Ngược Tra Nam - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nữ Vương Trọng Sinh Ngược Tra Nam miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '7', 0, '', 0, 0, '', '', '', 0, 1630331440, 1630331852, 0, 0, 30),
(75, 292, 'Cái Kết Có Hậu Cho Ác Nữ Có Thời Gian Giới Hạn', '', '5,9,11,14,18,21,23,35', 'cai-ket-co-hau-cho-ac-nu-co-thoi-gian-gioi-han', '', '', 'https://i.imgur.com/wisKkSJm.jpg', '<div>Tên khác: Happy Ending For The Time-Limited Villainess<br></div><div>Alternative:시한부 악녀의 해피엔딩</div><div>--------------</div><div>Theo dõi Fanpage: http://www.facebook.com/linhlauho</div><div>--------------</div><div>Tác giả:Harasyo,류호</div><div>Artist(s):하라쇼</div><div>Thể loại:Drama, Fantasy, Isekai, Magic, Romance, Shoujo, Web Comic</div><div>Release:2020</div><div>Tình trạng: OnGoing</div><div>-------------</div><div>Nội dung</div><div>\"Xin hãy cưới tôi chỉ cần trong 6 tháng\"</div><div>\"Điều naỳ thì có lợi gì cho tôi?\"</div><div>\"Tất nhiên tôi sẽ trao anh toàn bộ tài sản của gia đình Clea sở hữu”</div><div>“... Cô sẽ trao toàn bộ cho tôi và sẽ li dị tôi sau khoảng thời gian nửa năm? Vậy sau đó cô sẽ làm gì”</div><div>“...Tôi đã suy nghĩ một vài thứ liên quan đến vấn đề nào. Dù sao thì tôi cũng không có khả năng sử dụng đống tài sản đó\"</div><div><br></div><div>Clea luôn nói dối, cơ thể nãy của cô ấy sớm sẽ ngủm, và trễ nhất cũng là trong thời gian nửa năm</div><div><br></div><div>Sau khi có một cuộc hôn nhân viên mãn, cô ấy muốn bản thân có thể nhắm mắt một cách thanh thản</div><div><br></div><div>Sau khi bị đâm đến chết, tôi được triệu hồi bởi Ma Vương, và sống lại với tư cách là nhân vật phản diện trong vòng 6 tháng</div><div><br></div><div>“Keuk-“</div><div><br></div><div>Cơ thể này sử dụng năng lượng mỗi khi bước một bước, 3 khi nói chuyện, 300 HP khi chạy trong 10 giây, và thổ huyết (ho ra máu) khi bị giảm đi 1/3 lượng HP tối đa</div><div><br></div><div>“Trời ạ, cô ta lại làm vậy chỉ để thu hút sự chú ý\"</div><div>“Thật là bất ngờ khi cô ta che dấu nổi đau khi cứ đi xung quanh như vậy.”</div><div>\"Dù sao thì, công tước Detroit đã từ chối cô ta một cách lạnh lùng\"</div><div><br></div><div>Danh tiếng của tôi lại càng tệ hơn</div><div><br></div><div>Ma Vương nói rằng sẽ giúp tôi sống lại nếu có một cuộc hôn nhân hạnh phúc, nhưng tình trạng cơ thể này ngày càng tệ hơn</div><div><br></div><div>Tôi phải cưới người mà chủ cũ của cơ thể này say mê, Duke Detroit.</div><div><br></div><div>Tôi sẽ làm mọi thứ để cưới đữo anh ta, nhưng tôi vân xkhoong thể hiểu chính xác từ \"cuộc hôn nhân viên mãn\"...</div><div><br></div><div>Liệu tôi có thể sống sót?</div>', 0, '8550', 0, 0, 0, 0, 'Cái Kết Có Hậu Cho Ác Nữ Có Thời Gian Giới Hạn - TruyenHayTV', '❶❶✅ Đọc truyện tranh Cái Kết Có Hậu Cho Ác Nữ Có Thời Gian Giới Hạn miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331440, 1630331505, 0, 0, 30),
(76, 292, 'The Younger Male Lead Fell For Me Before The Destruction', '', '5,9,11,14,18,21,35', 'the-younger-male-lead-fell-for-me-before-the-destruction', '', '', 'https://i.imgur.com/4JXx3sc.jpg', '<div>Tác giả : Yoondal<br></div><div>Artist: Haring</div><div>Thể loại: Romance, Comedy, Smut, Fantsy</div><div>Trình trạng : Ongoing&nbsp;</div><div>----------------</div><div>Nội dung:</div><div>Tôi dành một ngày để thư giãn sau khi trả hết mớ nợ sinh viên, nhưng cuối cùng tỉnh lại với thân phận Amel, con gái duy nhất của một bá tước bá đạo nghèo cùng một khoảng nợ vô cùng khổng lồ. Ngay cả khi làm việc suốt quảng đời còn lại cũng không thể trả nổi. Cái tức hơn, vì say khướt, tôi trải qua tình một đêm với Kyle, nam chính của cuốn tiểu thuyết. Tôi càng cố gắng tránh chạy thì Kyle lại càng bám chặt tôi hơn, mối quan hệ cũng ngày trở nên rối hơn. Liệu tôi có thể thay đổi số phận của bản thân và gia đình để có một cái két Happy Ending?</div>', 0, '53453', 0, 0, 0, 0, 'The Younger Male Lead Fell For Me Before The Destruction - TruyenHayTV', '❶❶✅ Đọc truyện tranh The Younger Male Lead Fell For Me Before The Destruction miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '18', 0, '', 0, 0, '', '', '', 0, 1630331440, 1630331697, 0, 0, 30),
(79, 292, 'I Picked Up the Second Male Lead After the Ending', '', '5,9,11,14,18,21,35', 'i-picked-up-the-second-male-lead-after-the-ending', '', '', 'https://i.imgur.com/VyFLHNn.jpg', '<div>Tác giả: Hwang Do Tol, 정서</div><div>Artist: 정서</div><div>Thể loại: Fantasy, Historical, Isekai, Romance</div><div>Tình trạng: Ongoing</div><div>-----------</div><div>Nội dung:&nbsp;</div><div>Tôi xuyên vào cuốn sách sách của nhân vật nam chính 2 mà mình yêu thích</div><div>Một TSUNDERE thật sự vừa nghe lời vừa cằn nhằn nữ chính, tính cách thẳng thắng, vẻ ngoài điển trai</div><div>Đáp ứng mọi điều kiện, là hình tượng gu lý tưởng của tôi, hơn nữa cho đến khi câu chuyện kết thúc vẫn còn độc thân</div><div>Vângggg!!! Tôi đương nhiên sẽ chọn nam chính 2</div><div>Tuy nhiên, tôi đã bỏ lỡ một chi tiết....</div><div>Một TSUNDERE đáng thương sau khi bị nữ chính bỏ rơi, đã trở thành một người đàn ông đáng sợ</div><div>\"Lạc lõng\"</div><div>Nam chính 2.... có phải là một lựa chọn an toàn không...</div>', 0, '1269', 0, 0, 0, 0, 'I Picked Up the Second Male Lead After the Ending - TruyenHayTV', '❶❶✅ Đọc truyện tranh I Picked Up the Second Male Lead After the Ending miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '3', 0, '', 0, 0, '', '', '', 0, 1630331440, 1630331577, 0, 0, 30),
(80, 287, 'Cách Thuần Hóa Sư Tử Hoang Dã', '', '35', 'cach-thuan-hoa-su-tu-hoang-da', '', '', 'https://1.bp.blogspot.com/-pNjK-S7jbC8/X_kPMi_VSzI/AAAAAAAABlw/asMlQEIvEActsKgntTI2cs85nmY-ksZkgCLcBGAsYHQ/s0/1%2B%25282%2529.jpg', '<p>Nhóm dịch: Tuyệt Thế Dưa Leo</p><p>Nếu các bạn muốn đọc thêm nhiều truyện hay nữa hay truy cập fanpage của nhóm qua đường link sau: facebook.con/tuyetthedualeo2020</p><p><br></p>', 0, '24789', 0, 0, 0, 0, 'Cách Thuần Hóa Sư Tử Hoang Dã - TruyenHayTV', '❶❶✅ Đọc truyện tranh Cách Thuần Hóa Sư Tử Hoang Dã miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '8', 0, '', 0, 0, '', '', '', 0, 1630331440, 1630331544, 0, 0, 30),
(81, 293, 'Tình yêu của riêng em', '', ',35', 'tinh-yeu-cua-rieng-em', '', '', 'https://1.bp.blogspot.com/-rr8iATkM5sE/X_kPO_Rx5ZI/AAAAAAAABmI/CI98QXVJGIYr2KbvLLT6Pl2qEXut-FsnQCLcBGAsYHQ/s0/T%25C3%25ACnh%2By%25C3%25AAu%2Bc%25E1%25BB%25A7a%2Bri%25C3%25AAng%2Bem.png', 'Câu chuyện về một tình yêu diệu kì diễn ra tại một câu lạc bộ pháp sư khiến cho trái tim bạn rung động. <b><font color=\"#ff0000\">Liệu ai sẽ thuộc về ai?</font></b>', 0, '1145', 0, 0, 0, 0, 'Tình yêu của riêng em - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tình yêu của riêng em miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '10', 0, '', 0, 0, '', '', '', 0, 1630331440, 1630331549, 0, 0, 30),
(83, 295, 'Đâu Mong Chung Tình', '', '5,8', 'dau-mong-chung-tinh', '', '', 'https://i.imgur.com/WCMJWeBm.jpg', '<span style=\"color: rgb(51, 51, 51); font-family: Montserrat, sans-serif; font-size: 13px;\">Ai quen Thịnh Du đều biết, hắn là người rất cà lơ phất phơ, chẳng thấy hắn đứng đắn được lần nào bao giờ, bình thường quay phim cà lơ phất phơ, lúc phỏng vấn cũng cà lơ phất phơ, lúc chụp ảnh cũng cà lơ phất phơ. Tất cả bọn họ đều cảm thấy khả năng tên này có vấn đề. Nhưng về sau đột nhiên phát hiện chỉ có lúc làm một chuyện, lại má nó chứ đứng đắn vô đối. Chính là buổi tối hôm nọ lúc ép hôn Quý Thanh Vãn.</span>', 0, '152', 0, 0, 0, 0, 'Đâu Mong Chung Tình - TruyenHayTV', '❶❶✅ Đọc truyện tranh Đâu Mong Chung Tình miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331440, 1630331506, 0, 0, 30),
(84, 302, 'Chiến lược sinh tồn của tiểu thư', '', '5,9,10,14,18', 'chien-luoc-sinh-ton-cua-tieu-thu', '', '', 'https://i.imgur.com/OsMjw4wm.jpg', '<p> Tôi có tất cả bốn lần tái sinh, nhưng tất cả đều té suối trước sinh nhật thứ 25 của mình. Tuy nhiên, tuổi thọ của họ đáng lẽ phải dài hơn thế và Yeoram, thằng cha chịu trách nhiệm cai quản những ai du lịch dưới suối vàng, nói rằng nó tại seo lại chuyện này cả Có phải cuộc đời của tôi chỉ như một bộ phim dài 1 tập? Dù sao, cuối cùng tôi cũng bất chợt nảy ra một ý tưởng toẹt zời cho kiếp thứ năm của mềnh Tôi sẽ là một người phụ nữ giàu có, quyền lực, nhắm xiền và sống khỏe mạnh và lâu dài với tềnh êu của cuộc đời tôi Nhưng ... vừa mới mở mắt ra, Tôi thấy mình bị lừa bởi thằng vua khỉ cờ hó ở cái thế giới ngầm bla bla đó .</p>', 0, '66995', 0, 0, 0, 0, 'Chiến lược sinh tồn của tiểu thư - TruyenHayTV', '❶❶✅ Đọc truyện tranh Chiến lược sinh tồn của tiểu thư miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '12', 0, '', 0, 0, '', '', '', 0, 1630331440, 1630331554, 0, 0, 30),
(86, 303, 'Công chúa thời gian có hạn', '', '5,9,11,14,21,34', 'cong-chua-thoi-gian-co-han', '', '', 'https://1.bp.blogspot.com/-lAQgAQYKm9Q/X_kPQWswAiI/AAAAAAAABmU/mE4X9Uda3EMXm67yG17nJqk7ILxns8iRQCLcBGAsYHQ/s0/biatruyen.jpg', '<div style=\"text-align: justify;\">Yun Jae-eun, một nhân viên văn phòng bình thường bỗng nhiên trở thành công chúa trong một cuốn tiểu thuyết!</div><div style=\"text-align: justify;\">N.H.Ư.N.G</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">\"Sao ngay cả khi xuyên không, tôi sẽ sớm nhận án tử hình, vì Sheylia chính là nhân vật phản diện...!\"</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">Jae-eun, người có linh cảm về số phận bất hạnh của chính mình đã quyết thay đổi số phận của mình.&nbsp;</div><div style=\"text-align: justify;\">Cô công chúa sắp chết đã mở mắt, cung điện Delfinium, nơi không ai chào đón, đang dần dần thay đổi ....</div>', 0, '108248', 0, 0, 0, 0, 'Công chúa thời gian có hạn - TruyenHayTV', '❶❶✅ Đọc truyện tranh Công chúa thời gian có hạn miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '40', 0, '', 0, 0, '', '', '', 0, 1630331440, 1630331790, 0, 0, 30),
(88, 284, 'Tôi Đã Gặp Nam Chính Trong Nhà Tù', '', '5,9,10,11,14', 'toi-da-gap-nam-chinh-trong-nha-tu', '', '', 'https://i.imgur.com/mBeFBmC.jpg', 'Một ngày nọ, tôi mở mắt ra và thấy mình ở trong nhà tù ?! <div>Trong số tất cả các nhân vật tôi có thể tái sinh, tôi thức dậy trong một cuốn tiểu thuyết lãng mạn, bi kịch, um...19+ hơn nữa tôi lại tái sinh vào cơ thể em gái của nhân vật phản diện. Để làm cho mọi thứ trở nên tồi tệ hơn, tôi đã bị nhốt trong nhà tù Kambrakam khét tiếng, chỉ vì tội ác của anh trai tôi. Tôi trong cùng một nhà tù với nam chính là Henrich Doran Von Hel, người được đồn đại là phải chịu đựng một lời nguyền biến anh ta thành một con thú. Trong cuốn tiểu thuyết gốc, anh ta phải gặp nữ chính và... nhưng tất nhiên, cốt truyện đã thay đổi nhờ sự tồn tại của tôi...</div>', 0, '579', 0, 0, 0, 0, 'Tôi Đã Gặp Nam Chính Trong Nhà Tù - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tôi Đã Gặp Nam Chính Trong Nhà Tù miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '0', 0, '', 0, 0, '', '', '', 0, 1630331440, 1630331508, 0, 0, 30),
(89, 293, 'Nàng sói Sica', '', '5,9,17,21,23', 'nang-soi-sica', '', '', 'https://i.imgur.com/RcwvWosm.jpg', '<span style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\">\"Tôi đã giành cả cuộc đời mình để tìm kiếm hai người đó.\"</span><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><span style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\">Một nữ pháp sư đã giành cả đời mình ở Tháp Ma thuật cùng với một bí mật từ khi được sinh ra: <font color=\"#ff0000\"><b><u>Cô là nàng sói Sica.</u></b></font></span><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><span style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\">\"Nếu cô giúp tôi hoàn thành việc này, tôi sẽ giúp lại cô\"</span><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><span style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\">Carthus Lian, người trông giống mối tình đầu của cô, đột nhiên lại xuất hiện trước mắt.</span><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><span style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\">Và thế là, cảm xúc của họ giành cho nhau ngày càng sâu đậm trong cuộc viễn chinh truy tìm dấu vết của những con quái thú - mối đe dọa của đế quốc.</span><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><span style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\">Giữa mối tình đầu và Carthus Lian,</span><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><br style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><span style=\"font-family: &quot;noto sans&quot;, sans-serif, Helvetica, Arial; font-size: 15px; text-align: justify;\"><font color=\"#ff0000\" style=\"\"><b style=\"\"><u style=\"\">Cô ấy sẽ chọn ai?</u></b></font></span>', 0, '246', 0, 0, 0, 0, 'Nàng sói Sica - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nàng sói Sica miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331441, 1630331506, 0, 0, 30),
