(95, 307, 'Shadow House', '', '7,11,21,35', 'shadow-house', '', '', 'https://i.imgur.com/oiFpB0q.jpg', '<span style=\"color: rgb(53, 64, 82); font-family: Arial, Helvetica, sans-serif;\">Những chiếc bóng vô danh sống cuộc đời quý tộc ở một tòa biệt thự rộng lớn, nơi mà họ được phục vụ bởi những búp bê sống. Những búp bê này dành phần lớn thời gian để lau dọn đóng bồ hóng vô tận được thải ra từ những vị chủ nhân bí ẩn của họ. Hãy cùng theo dõi câu chuyện của Emilyko, một cô búp bê sống rất trẻ trung và vui tươi, khi mà cô ấy đang học việc để trở thành người hầu cho Kate-sama.</span>', 0, '920', 0, 0, 0, 0, 'Shadow House - TruyenHayTV', '❶❶✅ Đọc truyện tranh Shadow House miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '4', 0, '', 0, 0, '', '', '', 0, 1630331441, 1630331512, 0, 0, 30),
(97, 307, 'Sắc đỏ, Lồng đèn và Yêu ma', '', '7,16,17,21,35', 'sac-do-long-den-va-yeu-ma', '', '', 'https://i.imgur.com/XvhYhT1.jpg', '<div class=\"content-articles\" style=\"display: inline-block; width: 638px; height: auto; word-break: break-word; padding: 0px 15px 15px; color: rgb(51, 51, 51); font-family: &quot;Source Sans Pro&quot;;\"><p style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\"></p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Trong mộng cảnh rải đầy sắc đỏ hoa trà, chiếc mặt nạ kì quái vụt qua... Chàng trai trẻ sở hữu chiếc mặt nạ ấy mang tên Yue, kẻ sống trong căn đền cùng những yêu quái. Mùa đông ghé qua thị trấn gần kề, Kurogitsune, linh hồn cáo thân cận của Yue quyết định đây chính là thời điểm hoàn hảo để cho cậu chàng được bao bọc ấy đi khám phá tất thảy mọi thứ ở thế giới bên ngoài, lẻn tới lễ hội mùa, dù cho Yue bị cấm rời khỏi căn đền. Bánh răng số phận cũng đã dịch chuyển theo..</p></div>', 0, '236', 0, 0, 0, 0, 'Sắc đỏ, Lồng đèn và Yêu ma - TruyenHayTV', '❶❶✅ Đọc truyện tranh Sắc đỏ, Lồng đèn và Yêu ma miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331441, 1630331512, 0, 0, 30),
