(106, 284, 'Nữ Thần Alice Trở Lại', '', '5,9', 'nu-than-alice-tro-lai', '', '', 'https://1.bp.blogspot.com/-xNhaUldipME/X_kPNiuoF2I/AAAAAAAABl8/hZNUe5L7VF0wUtB7HvmUwCiQegqInyivACLcBGAsYHQ/s0/59312.jpg', '\"Số phận của người đó là trở thành vật hy sinh\", họ nói. Lý do tại sao họ phải hy sinh là để rửa sạch tội lỗi của Hoàng đế. \"Alice Bạn được chọn làm người hy sinh thứ 56\"  lại bắt đầu một chương mới&nbsp;', 0, '593', 0, 0, 0, 0, 'Nữ Thần Alice Trở Lại - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nữ Thần Alice Trở Lại miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331441, 1630331511, 0, 0, 30),
(109, 303, 'Như gió trên cành khô', '', '5,9,11,16,21,23,32,33,34', 'nhu-gio-tren-canh-kho', '', '', 'https://i.imgur.com/qDAWyXW.jpg', '<div dir=\"auto\" style=\"color: rgb(5, 5, 5); font-size: 18.75px; white-space: pre-wrap; animation-name: none !important; transition-property: none !important;\"><font face=\"Times New Roman\">Tóm tắt: Bá tước Casarius trở thành nạn nhân của một bệnh dịch và đột ngột qua đời, để lại di chúc ghi rằng Rietta, góa phụ trẻ xinh đẹp của trang viên, người mà ông đã cố gắng lấy làm vợ lẽ, được chôn sống cùng với ông. Ngay trước khi Rietta được chôn cất, Đại công tước Axias, được đồn đại là một bạo chúa tàn ác, đã đến đám tang để thu khoản nợ khổng lồ mà bá tước Casarius vẫn còn nợ anh ta. </font></div><div dir=\"auto\" style=\"color: rgb(5, 5, 5); font-size: 18.75px; white-space: pre-wrap; animation-name: none !important; transition-property: none !important;\"><font face=\"Times New Roman\">\"Mọi người ở đây dường như cảm thấy có lỗi với cô ấy, và ta vẫn còn một khoản nợ phải thu từ Casarius ... Nếu ta nhận cô ấy thay thế tiền, ta nghĩ tất cả các ngươi ở đây đều sẽ hạnh phúc,\" anh cười.</font></div><div dir=\"auto\" style=\"color: rgb(5, 5, 5); font-size: 18.75px; white-space: pre-wrap; animation-name: none !important; transition-property: none !important;\"><font face=\"Times New Roman\"> \"Xin chào, người phụ nữ quyến rũ.\"</font></div>', 0, '157537', 0, 0, 0, 0, 'Như gió trên cành khô - TruyenHayTV', '❶❶✅ Đọc truyện tranh Như gió trên cành khô miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '41', 0, '', 0, 0, '', '', '', 0, 1630331441, 1630331842, 0, 0, 30),
(111, 321, 'Say Yes!', '', '12,15,31,35', 'say-yes-', '', '', 'https://1.bp.blogspot.com/-PIHTQ0QW5pA/X_kPOJie6ZI/AAAAAAAABmE/Mf-KT-i8VvM7a9h2afCuackofBex0sYsACLcBGAsYHQ/s0/Kh%25C3%25B4ng%2BC%25C3%25B3%2BTi%25C3%25AAu%2B%25C4%2590%25E1%25BB%2581339_20210108202637.png', '<div>Gilhein đã quyết định tặng sô cô la cho người mình yêu vào ngày Valentine nhưng anh ấy đã bỏ trốn vào ngày hôm sau. Làm thế nào để gần gũi với người bạn yêu? Bắt đầu với tư cách bạn bè và cho phép tình bạn của bạn dẫn đến sự lãng mạn hay không?<br></div><div><br></div><div>Theo dõi để nhận thông báo về chap mới nha.</div><div></div>', 0, '1450', 0, 0, 0, 0, 'Say Yes! - TruyenHayTV', '❶❶✅ Đọc truyện tranh Say Yes! miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '4', 0, '', 0, 0, '', '', '', 0, 1630331441, 1630331523, 0, 0, 30),
(114, 303, 'Hoàng Tử, xin hãy hồi âm', '', '5,9,11,14,18,21,32,33,35', 'hoang-tu-xin-hay-hoi-am', '', '', 'https://i.imgur.com/UOJcVFy.jpg', '<span style=\"color: rgb(5, 5, 5); font-size: 18.75px; white-space: pre-wrap;\"><font face=\"Times New Roman\">Tóm tắt: Cordelia Grey. Một biên tập viên mới 22 tuổi đầy mơ mộng. Cô đến một cửa hàng đồ cổ để nhận bản thảo cho phần tiếp theo của cuốn truyện &lt;Công chúa và Hiệp sĩ&gt;, và trao đổi thư từ với hoàng tử trong truyện cổ tích do tình cờ lấy được từ một hiệu sách. Cordelia giống như một giấc mơ được trò chuyện với nhân vật chính trong tiểu thuyết. Hoàng tử Achie rất cần lời khuyên từ Cordelia, người biết trước tương lai của thế giới mà anh đang sống. Những bức thư hai người trao đổi qua hộp sách vẫn tiếp tục mà không biết rằng những đêm hè đang trôi dần...</font></span>', 0, '7818', 0, 0, 0, 0, 'Hoàng Tử, xin hãy hồi âm - TruyenHayTV', '❶❶✅ Đọc truyện tranh Hoàng Tử, xin hãy hồi âm miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '9', 0, '', 0, 0, '', '', '', 0, 1630331441, 1630331564, 0, 0, 30),
(115, 307, 'Chúa tể Undead của Cung điện Bóng tối', '', '5,7,16,23,35', 'chua-te-undead-cua-cung-dien-bong-toi', '', '', 'https://i.imgur.com/fGolhrfm.jpg', '<p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">... Tôi không muốn chết. Tôi muốn được tự do.</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Nếu một con quái vật là thứ tôi phải trở thành để được tự do, thì đó là điều tôi sẽ cam chịu.</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Đánh vào người bị nhiễm những cơn đau không ngừng chạy khắp cơ thể, một căn bệnh kỳ lạ, suy nhược và chết người. Cuộc sống của cậu bé đã phải chịu đựng nhiều năm đau khổ này đã kết thúc và không còn nhiều thời gian để cậu tuyệt vọng khi cậu chết mà không có người phục vụ bên cạnh. Khi tỉnh dậy lần nữa, anh ta đã bị biến thành xác sống được xếp hạng thấp nhất bởi một tên gọi hồn ác. Mặc dù cậu bé vui mừng vì đã có được một cơ thể không thể cảm thấy đau đớn, nhưng cậu ngay lập tức nhận ra rằng mình vẫn còn là lòng thương xót của những người khác. Không có sự khác biệt lớn giữa tình trạng hiện tại của anh ấy và bị giam cầm trên giường. Tuy nhiên, thế giới không thể để cậu bé yên khi cậu mong muốn được hòa bình.</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Với tự do là mục tiêu của mình, điều anh cần là sự thận trọng và quyền lực. Đôi khi chạy, chiến đấu, sợ hãi và do dự, đây là câu chuyện về vị Vua hèn nhát của Undead khi anh ta tìm cách được tự do.</p>', 0, '450', 0, 0, 0, 0, 'Chúa tể Undead của Cung điện Bóng tối - TruyenHayTV', '❶❶✅ Đọc truyện tranh Chúa tể Undead của Cung điện Bóng tối miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331441, 1630331511, 0, 0, 30),
