(137, 370, 'Người Bảo Hộ Của Bạo Quân Là Ma Nữ Tàn Độc', '', '5,9,11,14,16,18,34', 'nguoi-bao-ho-cua-bao-quan-la-ma-nu-tan-doc', '', '', 'https://i.imgur.com/aFcKRRqm.jpg', '<p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Tôi đã trọng sinh vào vai ma nữ tàn độc, một nhân vật trong tác phẩm tiểu thuyết lãng mạn kỳ bí 19+.</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Theo cốt truyện, kết cục của việc nuôi dưỡng nam nhân vật chính của ma nữ sẽ là cái chết đối với cô ấy.</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">May mắn thay, khoảng cách nam chính được sinh ra còn tận 200 năm.</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">“Nếu vậy thì mình cứ thong thả mà nghĩ đối sách thôi nhỉ?”.</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Thoáng chốc 200 năm trôi qua.</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Bỗng một ngày nam chính 7 tuổi bé nhỏ đã xuất hiện trước mắt tôi, cậu bé với dáng vẻ đáng thương vừa đứng vừa run rẩy lẩy bẩy và nói rằng:</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">“Ta biết sự xuất hiện đột ngột của ta khiến người khó xử. Ta xin lỗi, nếu có trả ta về lại hoàng cung cũng không sao đâu…”</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Cái gì đây trời, đáng yêu thế…? Làm sao bây giờ, hiện tại có hy vọng vào tương lai được không đây?</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Xem coi… mình phải nói thật nhẹ nhàng nhất có thể để an ủi bé con đang tràn ngập hoảng sợ này.</p>', 0, '641816', 0, 0, 0, 0, 'Người Bảo Hộ Của Bạo Quân Là Ma Nữ Tàn Độc - TruyenHayTV', '❶❶✅ Đọc truyện tranh Người Bảo Hộ Của Bạo Quân Là Ma Nữ Tàn Độc miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '50', 0, '', 0, 0, '', '', '', 0, 1630331442, 1630331853, 0, 0, 30),
