(150, 307, 'Cuộc thi toàn cầu', '', '9,12,16,17,21,31', 'cuoc-thi-toan-cau', '', '', 'https://i.imgur.com/1SWXBbgm.jpg', '<span style=\"color: rgb(53, 64, 82); font-family: Arial, Helvetica, sans-serif;\">Đây là một sân chơi sống còn, vượt qua được kỳ thi, mới có thể sống sót. Người gác thi phúc hắc «Tần Cứu» gặp phải thí sinh lạnh lùng «Du Hoặc», tuy cả hai người đều bị mất trí nhớ, buộc phải phối hợp tìm ra kẽ hở của hệ thống không có tính người này rồi cùng nhau hủy diệt nó, nhưng cả hai lại có vẻ rất ăn ý với nhau. Mỗi một lần hệ thống cảnh báo là mỗi một lần khiến cho hệ thống ngày càng suy yếu, ký ức bị mất đi cũng dần trở nên khôi phục lại, thì ra khi trên thế giới này chỉ còn là chiến trường đẫm máu, anh và tôi vẫn là người quen cũ của nhau. Hệ thống là cái thứ gì, hủy diệt đi càng tốt. Thế giới ngoài kia to lớn rực rỡ, chào mừng trở về nhà.</span>', 0, '286', 0, 0, 0, 0, 'Cuộc thi toàn cầu - TruyenHayTV', '❶❶✅ Đọc truyện tranh Cuộc thi toàn cầu miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '0', 0, '', 0, 0, '', '', '', 0, 1630331442, 1630331517, 0, 0, 30),
(151, 307, 'Trần Cách 2', '', '8,11,12,16,17,21,23,31', 'tran-cach-2', '', '', 'https://i.imgur.com/qJERmaXm.jpg', '<p> <span style=\"color: rgb(33, 37, 41); font-family: quicksand, sans-serif;\">Một là kẻ trường sinh muốn chết không được, một là quỷ đoản mệnh muốn sống không được. Khi hai người mang vận mệnh trái ngược như vậy gặp nhau, đối với bọn họ rốt cục là phúc hay họa? Rốt cục là cứu vớt đối phương hay là đem đến tai hoạ, hãy cùng theo dõi “ Trần Cách&nbsp;”&nbsp;để xem cuộc so tài đấu trí tương ái tương sát của mỹ thiếu niên trường sinh và quỷ đoàn mệnh phúc hắc.</span></p><p><font color=\"#212529\" face=\"quicksand, sans-serif\">Phần 1 các bạn xem tại :&nbsp;https://trangommuoi10.wordpress.com/manhua-bl-tran-cach/</font></p>', 0, '200', 0, 0, 0, 0, 'Trần Cách 2 - TruyenHayTV', '❶❶✅ Đọc truyện tranh Trần Cách 2 miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '0', 0, '', 0, 0, '', '', '', 0, 1630331443, 1630331518, 0, 0, 30),
