(155, 307, 'Trường Dã Tuyên Ca', '', '8,11,12,16,17,21,23', 'truong-da-tuyen-ca', '', '', 'https://i.imgur.com/GqvMz8jm.jpg', '<div class=\"content-articles\" style=\"display: inline-block; width: 483px; height: auto; word-break: break-word; padding: 0px 15px 15px; color: rgb(51, 51, 51); font-family: &quot;Source Sans Pro&quot;;\"><p style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\"></p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Tác phẩm này chủ yếu kể về bí ẩn thân phận một con người, Á Tuyên bất lão bất tử chạm trán với những con yêu quái hàng ngàn năm, đi khắp Tứ hải bát hoang gặp gỡ đủ loại người, yêu quái, thần , những câu chuyện kỳ bí. Những con người tham lam trường sinh, Tu La giết chóc tàn sát, Thần vô cảm, và những giai thoại Doanh Châu tráng lệ đều được lồng đưa vào bức họa của Á Tuyên. Thời gian dài dần tiết lộ thêm nhiều bí mật, Á Tuyên là ai ? Rốt cục mục đích của Á Tuyên \"Trường Dã Tuyên Ca\" là gì ?</p><p></p><p style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\"><span class=\"content-articles-tag\" style=\"color: rgb(51, 122, 183);\">#dam_my&nbsp;</span><span class=\"content-articles-tag\" style=\"color: rgb(51, 122, 183);\">#hanh_dong&nbsp;</span><span class=\"content-articles-tag\" style=\"color: rgb(51, 122, 183);\">#vien_tuong&nbsp;</span><span class=\"content-articles-tag\" style=\"color: rgb(51, 122, 183);\">#co_dai</span></p></div>', 0, '181', 0, 0, 0, 0, 'Trường Dã Tuyên Ca - TruyenHayTV', '❶❶✅ Đọc truyện tranh Trường Dã Tuyên Ca miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331443, 1630331518, 0, 0, 30),
(156, 321, 'Tổng Tài Là Trai Thẳng?', '', '5,20,35', 'tong-tai-la-trai-thang-', '', '', 'https://i.imgur.com/USNia4zm.jpg', '<div>Cứ tưởng cô là khán giả chỉ đứng xem chuyện tình yêu của người khác, không ngờ bản thân cô lại là tâm điểm của một mối tình tay ba?!&nbsp;<br></div><div>\"Im, im nào! Mình không muốn là người con gái đó!\"</div><div>Bạn có hiểu cảm xúc của 1 hủ nữ không? Được yêu hay được chiêm ngưỡng chuyện tình của người khác, cái nào vui hơn?</div><div>Thanh xuân của một hủ nữ! Gần đây,&nbsp; cô sinh viên thực tập... đang bị ám ảnh bởi một cặp đôi nam x nam - Tổng giám đốc và Phó tổng giám đốc của công ty! Hai con người kỳ lạ này đã thu hút sự chú ý của cô!&nbsp;</div><div>Ơ? Chuyện gì đang xảy ra vậy? Tại sao 2 người được cô cho là yêu nhau lại tỏ tình với cô?</div>', 0, '620', 0, 0, 0, 0, 'Tổng Tài Là Trai Thẳng? - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tổng Tài Là Trai Thẳng? miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '5', 0, '', 0, 0, '', '', '', 0, 1630331443, 1630331524, 0, 0, 30),
