(161, 390, 'Hồi ức mùa hè', '', '6,12,31', 'hoi-uc-mua-he', '', '', '/storage/app/public/photos/390/truyen-tranh-dam-my-hoi-uc-mua-he-bia.jpg', '<span style=\"color: rgb(5, 5, 5); font-size: 14.56px; white-space: pre-wrap;\"><font face=\"Arial\">Cái gọi là lần đầu... Lời nói dối đầu tiên, nụ hôn đầu tiên và tình yêu đầu tiên. Khi Henry và Sam lần đầu gặp gỡ vào mùa hè năm ấy, Henry đã biết được sức mạnh của mối tình đầu. Nhưng, thời gian trôi đi, mỗi người một phương, mùa hè kết thúc cũng như cách mà mối quan hệ giữa họ khép lại. Tất cả chỉ là kí ức xa vời của hiện tại, khi mà mối quan hệ giữa Henry và Sam trở nên thân thiết một lần nữa, những rung cảm cháy bỏng của mùa hè năm đó lại rạo rực trong tim Henry...</font></span>', 0, '763', 0, 0, 0, 0, 'Hồi ức mùa hè - TruyenHayTV', '❶❶✅ Đọc truyện tranh Hồi ức mùa hè miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '3', 0, '', 0, 0, '', '', '', 0, 1630331443, 1630331555, 0, 0, 30),
(165, 369, 'Tuyệt Sắc Tiểu Đản Phi', '', '5,8,10,11,14,35', 'tuyet-sac-tieu-dan-phi', '', '', 'https://i.imgur.com/KQvB7Fy.jpg', 'Nội dung: Bắc Nhĩ là một cô gái đang ôn thi để chuẩn bị cho kì thi đại học, hóa ra cô ấy là nữ thần Phượng Hoàng trong truyền thuyết. Do sặc nước nên cô ấy quay lại Thiên giới và được Thiên Quân đích thân chăm sóc. Bắc Nhĩ có thể nhìn thấy thế giới bên ngoài thông qua quả trứng. Cô ấy rất sốc khi thấy Thiên Quân thật sự theo học quá trình dành cho sản phụ, gọi tên cô mỗi ngày, đưa cô đi xem phong cảnh... Tại sao lại có nhiều người muốn đánh cắp trứng? Tại sao nữ thần trẻ và xinh đẹp kia lại ghen tị và ngăn cản cô nở ra? Bắc Nhĩ chỉ là một quả trứng, sao lại bắt cô ấy chịu đựng nhiều như vậy? Hóa ra trên Thiên giới từ xưa đã có một truyền thuyết', 0, '3210', 0, 0, 0, 0, 'Tuyệt Sắc Tiểu Đản Phi - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tuyệt Sắc Tiểu Đản Phi miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '7', 0, '', 0, 0, '', '', '', 0, 1630331443, 1630331705, 0, 0, 30),
(166, 369, 'Ta Nhất Định Phải Đến Làm Hoàng Hậu', '', '5,8,10,11,14,35', 'ta-nhat-dinh-phai-den-lam-hoang-hau', '', '', 'https://i.imgur.com/JwbU8uB.jpg', '<div>Nội dung: Sát thần nữ ma đầu của mạt thế người người nghe tiếng đã sợ vỡ mật Hạ Chỉ bị ràng buộc bởi hệ thống toàn chức hoàng hậu xuyên việt ba nghìn tiểu thế giới, tại tuyến ngược biểu ngược tra, ghẹo nam nhân, đoạt hậu vị! Thay đổi loại gọi là \"hồng nhan họa thuỷ\" của dị thế giới, lên làm hoàng hậu liền dẫn đến kết cục vong quốc, để tiêu trừ giá trị tội ác do giết hại hàng loạt tạo thành ở kiếp trước, sống lại lần nữa……</div><div>#đại nữ chủ, #xuyên việt</div>', 0, '56117', 0, 0, 0, 0, 'Ta Nhất Định Phải Đến Làm Hoàng Hậu - TruyenHayTV', '❶❶✅ Đọc truyện tranh Ta Nhất Định Phải Đến Làm Hoàng Hậu miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '42', 0, '', 0, 0, '', '', '', 0, 1630331443, 1630331784, 0, 0, 30),
(169, 321, 'Love Me Knot', '', '5,21,35', 'love-me-knot', '', '', 'https://i.imgur.com/DOJ7Rxnm.png', 'Ta nghĩ rằng việc nhìn thấy sợi chỉ đỏ của định mệnh sẽ giúp ta tìm thấy nửa kia dễ dàng hơn. Nhưng với Avery, sự lãng mạn xung quanh chỉ làm cho sợi chỉ đỏ của cô thêm nổi bật... mà ở đầu kia lại không có ai. Liệu Avery sẽ quyết định sống 1 cuộc đời cô độc, hay cô ấy có thể dệt nên câu chuyện tình yêu cho chính mình?', 0, '173', 0, 0, 0, 0, 'Love Me Knot - TruyenHayTV', '❶❶✅ Đọc truyện tranh Love Me Knot miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331443, 1630331526, 0, 0, 30),
