(177, 351, 'Ngôi vị hoàng hậu phải để ta làm', '', '5,8,11,14,34', 'ngoi-vi-hoang-hau-phai-de-ta-lam', '', '', '/storage/app/public/photos/351/633cf0a5994969173058.jpg', '<p><span style=\"color: rgb(34, 34, 34); font-size: 15px; white-space: pre-wrap; background-color: rgb(255, 255, 255);\"><font face=\"Times New Roman\" style=\"\">Ở kiếp trước, người người đều khiếp sợ những nữ ma đầu sát nhân, Hạ Chỉ bị buộc phải vào thân phận hoàng hậu để du hành qua ba thế giới, trừng trị những kẻ cặn bã, trêu ghẹo nam nhân, tranh đoạt ngôi vị! Thay đổi kết cục diệt vong của đất nước do sự tranh đoạt ngôi vị hoàng hậu của các nữ nhân “hồng nhan họa thủy” gây ra trở thành một thế giới khác, để rửa sạch tội ác của những vụ sát hại ở kiếp trước, lần nữa hồi sinh.</font></span></p><p><font face=\"Times New Roman\" style=\"background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(34, 34, 34); font-size: 15px; white-space: pre-wrap;\">Link chap 1: </span><a href=\"https://www.facebook.com/saonguyetteam/posts/405227887573494?__cft__[0]=AZUriI3FiKQSN75cadJIBW8E_3k8mKIfmPaIO5TFUyPZC2xoIiV5gI2b5xeY-OsaQdM_smCO1LRQRQTtzJXUag7LyK69IXT2aHa5jNByFGswgPHZh9BXADg4Z7LQF6pIrjzzFKcwEVEIocUmE2R-HniK7AdaMDoVtw9atxmH2itzRA&amp;__tn__=%2CO%2CP-R\">https://www.facebook.com/saonguyetteam/posts/405227887573494?__cft__[0]=AZUriI3FiKQSN75cadJIBW8E_3k8mKIfmPaIO5TFUyPZC2xoIiV5gI2b5xeY-OsaQdM_smCO1LRQRQTtzJXUag7LyK69IXT2aHa5jNByFGswgPHZh9BXADg4Z7LQF6pIrjzzFKcwEVEIocUmE2R-HniK7AdaMDoVtw9atxmH2itzRA&amp;__tn__=%2CO%2CP-R</a><font color=\"#222222\"><span style=\"font-size: 15px; white-space: pre-wrap;\"></span></font></font></p><p><font face=\"Times New Roman\" style=\"background-color: rgb(255, 255, 255);\"><font color=\"#222222\"><span style=\"font-size: 15px; white-space: pre-wrap;\">Chap 2: </span></font><a href=\"https://www.facebook.com/saonguyetteam/posts/405830907513192?__cft__[0]=AZUZk6wywaWzUJh1NejOH0qD68HQiXMShKd5JB32NE_K459ThjWujhR-y_rSKqwYZ3YRsqrzn2-KGwUqHqcSF57lT09pcAqPrtFRsXtLNL3CYxT3GSjEhpH