(179, 321, 'Tantei Wa Mou, Shinderu', '', '5,13,16', 'tantei-wa-mou-shinderu', '', '', 'https://i.imgur.com/PZj3bC0m.jpg', '<div>Tên truyện: Tantei wa Mou, Shinderu</div><div><br></div><div>Thể loại: Comedy, Hành động, Thần bí (Bí ẩn)...</div><div><br></div><div>Văn án:&nbsp;</div><div>Kimizuka Kimihiko, một học sinh trung học bình thường, người dễ bị cuốn vào mọi thứ, được giao nhiệm vụ bảo quản chiếc cặp da bởi những người đàn ông mặc vest đen. Sau khi gặp một nữ thám tử xinh đẹp như thiên thần tên là Siesta trên một chiếc máy bay không tặc, anh đã trở thành trợ lý của cô ấy.</div><div><br></div><div>Dịch bởi Victory Group</div>', 0, '98', 0, 0, 0, 0, 'Tantei Wa Mou, Shinderu - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tantei Wa Mou, Shinderu miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '0', 0, '', 0, 0, '', '', '', 0, 1630331444, 1630331524, 0, 0, 30),
