(203, 520, 'Câu chuyện thường ngày của cô gái trọng sinh', '', '5,8,10,11,14,18,21,32,34', 'cau-chuyen-thuong-ngay-cua-co-gai-trong-sinh', '', '', 'https://i.imgur.com/pjyb6jxm.jpg', 'Ngoã Lai Lý là người được trọng sinh tới thế giới này, được cho là thiên tài vì có được kí ức và học thức của kiếp trước. Mơ ước được sống một cuộc sống khác, cô chọn học phép thuật, nhưng bị thầy giáo cho rằng cô không có tài năng và sẽ có một cái kết bi thảm. cô cẩn thận sống qua ngày lại phát hiện có người xuyên không giống cô, mà cô Ngoã Lai Lý không đơn giản là xuyên vào trong tiểu thuyết....', 0, '606', 0, 0, 0, 0, 'Câu chuyện thường ngày của cô gái trọng sinh - TruyenHayTV', '❶❶✅ Đọc truyện tranh Câu chuyện thường ngày của cô gái trọng sinh miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331444, 1630331536, 0, 0, 30),
(204, 516, 'Giả Mạo Theo Phong Cách', '', '5,9,20', 'gia-mao-theo-phong-cach', '', '', 'https://i.imgur.com/7cK20Zim.png', 'Bae Suah là một nhà thiết kế nhỏ nhắn, tóc đỏ, cô đang làm việc tại Trung tâm thiết kế Taeha C&amp;T. Một buổi sáng nọ, cô thức dậy và thấy bản thân đang bị trói trên ghế. Người đàn ông đang nhăn nhó không ai khác chính là người anh trai đáng sợ của bạn cùng phòng, Seung - hyun , chủ nhân của căn hộ mà cô ấy đã sống miễn phí trong tám năm qua. Anh ta cho cô một tuần để dọn đồ chuyển đi. Suah hoảng sợ cố gắng van xin, nhưng Seung hyun lạnh lùng đã chiếm ưu thế. Cho đến khi anh ta tình cờ gặp Suah tại chỗ làm. Hóa ra cô ấy không chỉ là một thành viên thiết yếu của đội mới mà anh ấy tập hợp, mà còn là một trong những thành viên giỏi nhất mà anh ấy từng làm cùng . Dù muốn hay không, hai người vẫn dính vào nhau trong tương lai... Liệu cô có thể thuyết phục Seung - hyun để cô được ở lại không ? Và Seung - hyun sẽ gì để giữ mọi thứ chuyên nghiệp với người phụ nữ mà anh ấy muốn đá ra khỏi nhà?', 0, '156', 0, 0, 0, 0, 'Giả Mạo Theo Phong Cách - TruyenHayTV', '❶❶✅ Đọc truyện tranh Giả Mạo Theo Phong Cách miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331444, 1630331526, 0, 0, 30),
