(211, 516, 'Trọng Sinh Chi Ngược Tra Nữ Vương', '', '5,8,10,20', 'trong-sinh-chi-nguoc-tra-nu-vuong', '', '', 'https://i.imgur.com/0hsL8NQm.png', 'Chuẩn mực sau khi sống lại là gì? Tay trái đảo ngược gia đình tra nam, tay phải ôm đùi ông chủ. Tiểu kiều thê: “Chồng à, nếu em bị cấp trên đang thời kỳ mãn kinh mắng là chó thì phải làm sao?” Bá tổng: “Sắp xếp, cho phu nhân thăng chức để cấp trên cũ quỳ xuống đất làm chó!” Tiểu kiều thê: “ Chồng à, lương quá thấp không thể hỗ trợ Bảo bối phải làm sao đây?” Bá tổng: “Thu xếp tăng lương cho phu nhân, tăng lên 10 triệu tệ mỗi năm!” Bá tổng sủng thê tận trời, anh yêu em, mọi thứ của anh đều là của em, cả cuộc đời này của anh là của em.', 0, '57837', 0, 0, 0, 0, 'Trọng Sinh Chi Ngược Tra Nữ Vương - TruyenHayTV', '❶❶✅ Đọc truyện tranh Trọng Sinh Chi Ngược Tra Nữ Vương miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '35', 0, '', 0, 0, '', '', '', 0, 1630331445, 1630331827, 0, 0, 30),
