(216, 351, 'Cách bảo vệ anh trai của nữ chính', '', '5,8,14', 'cach-bao-ve-anh-trai-cua-nu-chinh', '', '', 'https://i.imgur.com/yZOG7XDm.jpg', '<span style=\"color: rgb(34, 34, 34); font-size: 15px; white-space: pre-wrap;\"><font face=\"Times New Roman\">Tôi vô tình chiếm hữu thân xác một nhân vật trong tiểu thuyết thể loại harem ngược 19+.\r\nVấn đề là tôi trở thành Roxana Agriche, chị gái của nhân vật phản diện phụ. Ông cha chết tiệt của tôi đã bắt cóc anh trai của nữ chính. Giờ, điều duy nhất còn lại để dẫn đến một kết thúc khủng khiếp từ sự báo thù của nữ chính?\r\nNhưng nếu tôi muốn tránh diễn biến đáng sợ đó thì sao?\r\n\"Tôi cũng thích món đồ chơi này.\"\r\n\"Tôi sẽ bảo vệ anh cho đến khi anh có thể rời khỏi đây an toàn.\"\r\nAnh trai của nữ chính, Cassis fedelians, chắc chắn sau này sẽ trả ơn cho tôi.</font></span>', 0, '763', 0, 0, 0, 0, 'Cách bảo vệ anh trai của nữ chính - TruyenHayTV', '❶❶✅ Đọc truyện tranh Cách bảo vệ anh trai của nữ chính miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '6', 0, '', 0, 0, '', '', '', 0, 1630331445, 1630331576, 0, 0, 30),
(217, 351, 'Vạn tra triều hoàng gian phi rất bận', '', '8,11', 'van-tra-trieu-hoang-gian-phi-rat-ban', '', '', 'https://i.imgur.com/6D7Ia7dm.jpg', '<div class=\"chat-item flx \" style=\"display: flex; flex-flow: row nowrap; margin: 0px 16px 7px; overflow-wrap: break-word; contain: style; word-break: break-word;\"><div class=\"chat-content flx flx-col flx-cell \" style=\"display: flex; flex-flow: column nowrap; flex: 1 1 auto; margin: 0px 0px 0px 10px; max-width: calc(100% - 30px);\"><div class=\"chat-message wrap-message rotate-container \" style=\"display: flex; user-select: none; justify-content: flex-start; align-items: flex-start; position: relative; color: rgb(34, 34, 34);\"><div class=\"\" style=\"display: flex; width: 890px;\"><div class=\"card  last-msg card--text\" style=\"flex-flow: row nowrap; position: relative; padding: 12px; border-radius: 8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-bottom: 4px; box-shadow: rgba(0, 0, 0, 0.1) 0px 1px 0px 0px; user-select: text; min-width: 32px; max-width: calc(100% - 38px);\"><div><span id=\"mtc-2315382307529\"><span class=\"text\" style=\"user-select: text; white-space: pre-wrap;\">Tô Lục Hạ nhận nhiệm vụ, âm thầm đến tiểu thế giới ngược tra, mục tiêu là tra nam hoàng đế cùng ba phi tần độc ác, nhưng lại gặp phải Tưởng Mạch- người thừa hành của “Nam tần tổ”, Tưởng Mạch đến tiểu thế giới để đảm bảo hoàn thành nhiệm vụ của Nam tần thời không, đồng thời âm thầm đuổi theo Tô Lục Hạ, cả hai người thừa hành ở tiểu thế giới đấu đá lẫn nhau, hệ thống Nữ tần VS hệ thống Nam tần, ai mới là người thắng lợi cuối cùng đây?</span></span></div></div></div></div></div></div>', 0, '11040', 0, 0, 0, 0, 'Vạn tra triều hoàng gian phi rất bận - TruyenHayTV', '❶❶✅ Đọc truyện tranh Vạn tra triều hoàng gian phi rất bận miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nh