(218, 547, 'Gặp xà [Ngộ Xà]', '', '8,11,12,34', 'gap-xa-ngo-xa-', '', '', 'https://i.imgur.com/oBu2RQLm.jpg', '<b>\" Ta sẽ cùng ngươi đi đến bạc đầu \". Hắn nói là làm, nắm tay hắn, mỉm cười trong ánh ban mai, ôm nhau dưới hoàng hôn, trải qua năm mươi mùa xuân hạ thu đông,vượt qua ngàn sông núi,trôi qua dòng chảy thời gian, đến cùng trời cuối đất, đến tận cùng hoang vắng----thật may biết bao, ta không phụ thời gian, ta cũng không phụ ngươi.</b>', 0, '931', 0, 0, 0, 0, 'Gặp xà [Ngộ Xà] - TruyenHayTV', '❶❶✅ Đọc truyện tranh Gặp xà [Ngộ Xà] miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '4', 0, '', 0, 0, '', '', '', 0, 1630331445, 1630331527, 0, 0, 30),
(219, 533, 'Nhật Ký Theo Dõi Bạn Trai Chim Sẻ', '', '8,12,34', 'nhat-ky-theo-doi-ban-trai-chim-se', '', '', 'https://i.imgur.com/pji8eCOm.jpg', '<p style=\"text-align: justify;\">Một tên trợ lí nhỏ nhoi vô hại và toàn năng như Phật tử, một tên tiểu thịt tươi lỗi thời đẹp trai nhưng lại nóng nảy. Hai người vô tình va chạm và hiểu lầm trở thành cấp trên và cấp dưới cân đối bề ngoài. Lâm Thừa Phong tưởng bản thân chỉ là trợ lý của Trác Bất Phàm, lại không biết rằng Trác Bất Phàm đã ngấm ngầm coi mình như sủng vật vô cùng yêu mến, yêu sâu đậm và vây bắt trong im lặng. Nhật ký theo dõi chim sẻ nhỏ yêu quý của một con báo đực, từ khi sống thử cho đến khi hạ màn bằng cái ôm của người yêu.</p>', 0, '2712', 0, 0, 0, 0, 'Nhật Ký Theo Dõi Bạn Trai Chim Sẻ - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nhật Ký Theo Dõi Bạn Trai Chim Sẻ miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '10', 0, '', 0, 0, '', '', '', 0, 1630331445, 1630331635, 0, 0, 30),
(220, 533, 'Vương Bài Hạnh Phúc', '', '5,8,18,21,34', 'vuong-bai-hanh-phuc', '', '', 'https://i.imgur.com/wUpyHb1.jpg', 'Vệ Minh Tuyết ăn nhờ ở đậu một ngày lại biến thành thiên nga đen, không chỉ con đường sự nghiệp lên cao, mà còn tóm được người yêu hoàn hảo từ trong lòng người khác! Vệ Minh Tuyết đảm đương việc đấu đá nhau giữa các nghệ sĩ, giậu đổ bìm leo giây phút quan trọng, bạn trai ảnh đế đột nhiên chen chân vào. Nhưng những biến cố đột ngột này nếu như tới, bạn tưởng như vậy thì có thể là con vịt nhỏ xấu xí của thiên nga đen ư? Nên biết điểm lợi hại nhất của thiên nga đen, ở chỗ cô ấy luôn tin ____ chỉ cần bổn cung không nhận thua thì các người đều là thiếp!', 0, '2696', 0, 0, 0, 0, 'Vương Bài Hạnh Phúc - TruyenHayTV', '❶❶✅ Đọc truyện tranh Vương Bài Hạnh Phúc miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '9', 0, '', 0, 0, '', '', '', 0, 1630331445, 1630331636, 0, 0, 30),
(222, 516, 'Tổng Tài Tại Thượng (Phần 3)', '', '5,8,20,34', 'tong-tai-tai-thuong-phan-3-', '', '', 'https://i.imgur.com/ZelDWsYm.jpg', '<div>\"Có thai với tôi rồi mà còn muốn bỏ đi?\"Hắn cương quyết bắt cô phải giao ra đứa con cô đã sinh cho hắn vào ba năm trước. Không chịu một lần, hắn lại ép thêm một bận.</div><div><br></div><div>Tổng tài bất chấp thủ đoạn cố đoạt được tình yêu, cô tìm đủ mọi cách để kháng cự, bấu víu để thoát ra. Được rồi, con của hắn cô sẽ trả cho hắn, nhưng cô sẽ đi! Thế mà hắn vẫn chưa hài lòng, dùng sức ném cô lên giường cùng tiếng hét:</div><div><br></div><div>\"Cô gái, ta muốn sinh thêm một đứa!</div>', 0, '340847', 0, 0, 0, 0, 'Tổng Tài Tại Thượng (Phần 3) - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tổng Tài Tại Thượng (Phần 3) miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '415', 0, '', 0, 0, '', '', '', 0, 1630331445, 1630331857, 0, 0, 30),
(223, 627, 'Nhân Viên Mới Quanh Co', '', '5,9,34', 'nhan-vien-moi-quanh-co', '', '', 'https://i.imgur.com/Y3jI7Dbm.jpg', '<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">Nam Jieun là nhân viên điều hành  tại công ty mỹ phẩm nhỏ Rendezvous. Trong bữa tiệc chia tay người quản lý mà cô phải lòng, cô say đến độ để lấy hết can đảm tỏ tình.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">\"Cô Nam, im lặng nào. Cô nói thích tôi?\"</div><div dir=\"auto\" style=\"font-family: inherit;\">\"V-vì ... đôi môi của anh ... thật hấp dẫn!\"</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">Người mà cô ấy tỏ tình ...</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">\"cô có đang nhầm lẫn gì ở đây không\"</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">... hóa ra không phải người cô ấy yêu, Kang Minjae, mà là CEO của công ty, Tarantula Masung ( <b>con nhện đen Masung</b> ) - hay còn gọi là Ma Sungjoon, người mà cô ấy tránh mặt vì tính cách hoàn toàn trái ngược với vẻ ngoài nổi bật của anh ấy ?!</div></div>', 0, '251', 0, 0, 0, 0, 'Nhân Viên Mới Quanh Co - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nhân Viên Mới Quanh Co miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331445, 1630331532, 0, 0, 30),
(224, 523, 'Tôi tái sinh thành tiểu thư lợn trắng của giới quý tộc trong 1 bộ truyện tranh thiếu nữ (Bản Remake)', '', '5,7,10,18,32', 'toi-tai-sinh-thanh-tieu-thu-lon-trang-cua-gioi-quy-toc-trong-1-bo-truyen-tranh-thieu-nu-ban-remake-', '', '', 'https://i.imgur.com/vR04Ic1m.jpg', '<p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Tôi nhớ lại kí ức về kiếp trước khi ông bảo rằng hôn ước của tôi đã bị hủy bỏ. Cũng trong lúc đó, tôi nhận ra thế giới này giống như trong bộ truyện tranh shoujo yêu thích của tôi. Nhân vật phản diện dùng mọi cách có thể để bắt nạt nữ chính… Tôi đã tái sinh thành một kẻ theo dõi mũm mĩm của nhân vật phản diện đó. Tôi xúc động khi nhớ về tương lai sắp tới cô ấy. Ngay lúc hành động xấu xa của kẻ ác được đưa ra ánh sáng, cô ta đã ghim mọi tội ác của mình lên Britney. Hay quá nhể!?!</p><br style=\"color: rgb(53, 64, 82); font-family: Arial, Helvetica, sans-serif;\"><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Để chắc chắn tránh được kết cục này, tôi không được trở thành kẻ bám đuôi của ả ác nhân đó.Ả chỉ giữ những người đặc biệt xấu xí hơn cô ả ở bên cạnh, nên nếu tôi gầy đi thì điều đó hoàn toàn có thể. Còn bây giờ, ăn kiêng thôi!</p>', 0, '794', 0, 0, 0, 0, 'Tôi tái sinh thành tiểu thư lợn trắng của giới quý tộc trong 1 bộ truyện tranh thiếu nữ (Bản Remake) - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tôi tái sinh thành tiểu thư lợn trắng của giới quý tộc trong 1 bộ truyện tranh thiếu nữ (Bản Remake) miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại Truye', '1', 0, '', 0, 0, '', '', '', 0, 1630331445, 1630331532, 0, 0, 30),
(225, 285, 'Xin Chào, Bạn Học Thụ Động', '', '5,8,15', 'xin-chao-ban-hoc-thu-dong', '', '', 'https://i.imgur.com/BoPLb4Wm.jpg', 'Hướng Tước Tước là một cô gái vẽ tranh biếm họa, luôn luôn tự ti về bản thân khi lên đại học đã biến thành một cô nàng xinh đẹp. Thực chất là để ngụy trang cho sự lầm lì của mình. Sau khi gặp một nam thần lạnh lùng khiến cô có chút ngượng ngùng, thì cậu ấy vô tình lại trở thành cố vấn biên kịch cho cô. Không ngờ anh ấy lại là người bạn bí mật thân thiết trên mạng của cô nhiều năm nay… <div><br></div>', 0, '3088', 0, 0, 0, 0, 'Xin Chào, Bạn Học Thụ Động - TruyenHayTV', '❶❶✅ Đọc truyện tranh Xin Chào, Bạn Học Thụ Động miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '19', 0, '', 0, 0, '', '', '', 0, 1630331445, 1630331662, 0, 0, 30),
(227, 523, 'Nàng công chúa tái sinh hôm nay lại bẻ gãy flag', '', '5,7,18,23,34', 'nang-cong-chua-tai-sinh-hom-nay-lai-be-gay-flag', '', '', 'https://i.imgur.com/WHpRhbjm.jpg', '<p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Tôi được tái sinh thành một công chúa trong thế giới một trò chơi otome với những ký ức về kiếp trước.</p><br style=\"color: rgb(53, 64, 82); font-family: Arial, Helvetica, sans-serif;\"><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Đợi đã, cái gì? Tôi là tình địch của nữ anh hùng sao? Đùa à! Tôi không có ý định yêu mấy kẻ thảm hại đó đây, bởi vì người tôi thích là NPC, Chỉ huy Hiệp sĩ Hoàng gia.</p><br style=\"color: rgb(53, 64, 82); font-family: Arial, Helvetica, sans-serif;\"><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Arial, Helvetica, sans-serif; line-height: 1.63; font-stretch: normal; color: rgb(53, 64, 82);\">Ngoại trừ Nữ anh hùng, sau khi được tái sinh trong trò chơi tồi tệ này, cái nơi mà các NPC còn tốt hơn là mấy thứ tình yêu nhảm nhí, đang đe cuộc sống của tôi bằng mấy trò cờ vặt, vì thế nên tôi quyết tâm hạ gục họ.</p>', 0, '7458', 0, 0, 0, 0, 'Nàng công chúa tái sinh hôm nay lại bẻ gãy flag - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nàng công chúa tái sinh hôm nay lại bẻ gãy flag miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '13', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331548, 0, 0, 30);
