(228, 613, 'Vũ Điệu Của Hoa Và Bài Ca Của Gió', '', '5,9,34', 'vu-dieu-cua-hoa-va-bai-ca-cua-gio', '', '', 'https://i.imgur.com/mksqpOgm.png', '<span id=\"docs-internal-guid-c196c2d4-7fff-330c-7bc3-601136632cbb\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; font-family: Arial; font-size: 13pt; font-weight: 700; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; font-family: Arial; font-size: 13pt; font-weight: 700; white-space: pre-wrap;\">Việt hóa bởi: Ổ Truyện Nhà Bụt&nbsp;</span><br></p><br><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14pt; font-family: Arial; background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">   Vui Lòng Không Re-Up </span></p><br><p dir=\"ltr\" style=\"line-height: 1.956; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Author: Lanella, Sanghaeng</span></p><p dir=\"ltr\" style=\"line-height: 1.956; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Artist: Sanghaeng</span></p><br><p dir=\"ltr\" style=\"line-height: 1.956; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Tóm tắt:</span></p><p dir=\"ltr\" style=\"line-height: 1.956; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Ercella đã sống một cuộc đời vinh quang mà mọi người đều ghen tị, nhưng lại chết vì bệnh khi còn trẻ</span></p><p dir=\"ltr\" style=\"line-height: 1.956; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Trước khi chết, bà hối hận vì đã không trở thành một người mẹ đúng nghĩa với con trai mình.</span></p><p dir=\"ltr\" style=\"line-height: 1.956; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Nhưng bằng cách nào đó, cô ấy đã quay trở lại ba năm trước.</span></p><p dir=\"ltr\" style=\"line-height: 1.956; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Ercella đang sống cuộc sống thứ hai của mình.</span></p><p dir=\"ltr\" style=\"line-height: 1.956; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Tôi hứa sẽ là một người mẹ yêu thương lần này.</span></p><p dir=\"ltr\" style=\"line-height: 1.956; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Tuy nhiên, liệu có quá muộn?</span></p><p dir=\"ltr\" style=\"line-height: 1.956; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">\"Bây giờ bạn đang làm điều này, bạn chỉ đang làm cho tôi cảm thấy không thoải mái.\"</span></p><p dir=\"ltr\" style=\"line-height: 1.956; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Người con trai chỉ đẩy cô ra và cô nhận ra rằng mối quan hệ của cô với người chồng, người mà cô nghĩ là tốt đẹp trước khi thoái lui, không thực sự ...</span></p><div><span style=\"font-size: 10.5pt; font-family: Arial; color: rgb(53, 64, 82); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></div></span>', 0, '22129', 0, 0, 0, 0, 'Vũ Điệu Của Hoa Và Bài Ca Của Gió - TruyenHayTV', '❶❶✅ Đọc truyện tranh Vũ Điệu Của Hoa Và Bài Ca Của Gió miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '13', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331583, 0, 0, 30),
(230, 369, 'Tâm Cơ Vạn Loại Lại Thế Nào', '', '5,8,10,20', 'tam-co-van-loai-lai-the-nao', '', '', 'https://i.imgur.com/fWgt0LR.jpg', 'Nội dung: Hạ Nghiên phó tổng tài của công ty giải trí, sự nghiệp có thành, hậu cung vô số, bị hệ thống nữ đức phán định là phụ nữ xấu xa, xoá bỏ sau khi chết linh hồn bị ném vào thân thể Mạc Thu Thu nghệ nhân tiểu bạch hoa đơn thuần thiện lương. Mạc Thu Thu? Chính là nghệ nhân ký hợp đồng công ty một năm sắp chết oan chết uổng đó? \"Hệ thống ngươi hố ta, để ta làm người thiện lương cẩn trọng lần nữa sau đó đợi chết sao?\" Hét lớn bị phong, hét nhỏ luyện lại, hệ thống để ta ôn lương thanh đạm đi chết, ta liền muốn dựa vào thực lực đi lên đỉnh cao nhân sinh!', 0, '5165', 0, 0, 0, 0, 'Tâm Cơ Vạn Loại Lại Thế Nào - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tâm Cơ Vạn Loại Lại Thế Nào miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '5', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331585, 0, 0, 30),
(231, 370, 'Phương Pháp Bảo Vệ Anh Trai Của Nữ Chính', '', '5,9,11,14,16,21,34', 'phuong-phap-bao-ve-anh-trai-cua-nu-chinh', '', '', 'https://i.imgur.com/HfkYUG8m.jpg', 'Cập nhật sau...', 0, '857291', 0, 0, 0, 0, 'Phương Pháp Bảo Vệ Anh Trai Của Nữ Chính - TruyenHayTV', '❶❶✅ Đọc truyện tranh Phương Pháp Bảo Vệ Anh Trai Của Nữ Chính miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '35', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331672, 0, 0, 30),
(233, 50, 'Đột nhiên tôi trở thành nữ chính', '', '6,9,14,18', 'dot-nhien-toi-tro-thanh-nu-chinh', '', '', 'https://i.imgur.com/NSDJkW4m.jpg', '<div><br></div><div>Sau khi hoàn thành kỳ thi SAT, tôi đang đọc một cuốn tiểu thuyết về cô gái Ludia đáng thương không có bạn đời. Bạn của kẻ chuyên rình rập, kẻ đã khiến cô bị hành quyết. Người thúc đẩy đã theo dõi bạn của cô ấy khiến cô ấy bị diệt vong, còn được gọi là phụ 1. ... Tại sao tôi lại nhớ thêm một người không quan trọng?</div><div><br></div><div>Chết tiệt, tôi đã trở thành Ludia đó! Tôi quyết định rằng tôi sẽ không chết thảm hại và sống tiếp nhưng…</div><div><br></div><div>Xin chào, thái tử.</div><div>Sao em lại đi lạc nữ chính, cứ dây dưa với em vậy?</div><div>Và tại sao anh ấy lại bị ảo tưởng như vậy !!</div><div><br></div><div>\"Tôi nên làm gì? Điều gì sẽ xảy ra nếu thái tử thực sự yêu tôi… ”</div><div>\"Hm, điều đó sẽ không bao giờ xảy ra.\"</div><div>\"Tại sao?\"</div><div>\"Anh ấy đã ở với tôi đêm qua.\"</div><div><br></div><div>Vì nó xảy ra theo cách này, tôi cũng có thể sẽ tóm lấy người đàn ông này ?!</div><div><br></div><div>&nbsp;</div>', 0, '1060', 0, 0, 0, 0, 'Đột nhiên tôi trở thành nữ chính - TruyenHayTV', '❶❶✅ Đọc truyện tranh Đột nhiên tôi trở thành nữ chính miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '0', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331543, 0, 0, 30),
(234, 50, 'The Obsessive Second Male Lead Has Gone Wild', '', '9,14', 'the-obsessive-second-male-lead-has-gone-wild', '', '', 'https://i.imgur.com/72x6vSQm.jpg', '<div>Tôi nhớ câu chuyện của một cuốn tiểu thuyết mà tôi đã đọc ở kiếp trước ngay trước khi kết hôn. &nbsp;Nếu bạn không làm đám cưới lộn xộn, bạn sẽ bị chồng đầu độc! &nbsp;Vì vậy, tôi chỉ hôn mục sư phụ trách buổi lễ.</div><div><br></div><div>&nbsp;\"Tư lệnh, anh không sao chứ?\"</div><div>&nbsp;Một trong những hiệp sĩ thánh chiến hét lên khi anh ta đến gần mục sư đã được hôn.</div><div>&nbsp;Gì?</div><div>&nbsp;Chờ đã ... bạn có phải là chỉ huy của các Hiệp sĩ Thánh?</div><div><br></div><div>&nbsp;****</div><div><br></div><div>&nbsp;Rurutia, người sắp chết, muốn dành giây phút cuối cùng của mình trong một ngôi đền nơi cô cảm thấy thoải mái nhất. &nbsp;Cô bắt đầu kinh doanh với bạn bè của mình cho ngôi đền, và nó đã đạt được thành công lớn.</div><div>&nbsp;\"Cô ơi, cô có cả thế giới trong lòng bàn tay!\"</div><div>&nbsp;\"Ngài có phải là Chúa giáng thế không?\"</div><div>&nbsp;Trong lúc bối rối trước chiếc vương miện lớn, bản thân người chỉ huy các thánh hiệp sĩ cũng có những hành động kỳ lạ.</div><div><br></div><div>&nbsp;\"Tất cả những gì tôi ước là trở thành chồng của bạn.\"</div><div>&nbsp;Anh ta nói vậy với đôi mắt sáng lên đầy ám ảnh.</div><div>&nbsp;\"Nhận trách nhiệm vì đã đánh cắp nụ hôn đầu của tôi.\"</div><div><br></div><div>&nbsp;Đây là tất cả rất sai lầm.</div><div>&nbsp;Dường như tôi đã thay đổi tương lai của mình.</div>', 0, '1041', 0, 0, 0, 0, 'The Obsessive Second Male Lead Has Gone Wild - TruyenHayTV', '❶❶✅ Đọc truyện tranh The Obsessive Second Male Lead Has Gone Wild miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '0', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331544, 0, 0, 30),
(235, 369, 'Giáo chủ mời dùng đao', '', '5,8,10,11,23', 'giao-chu-moi-dung-dao', '', '', 'https://i.imgur.com/g8gSFh9.jpg', 'Nội dung: Võ công tuyệt duyên thể chất của danh môn đích nữ Thẩm Khuynh An, vì bị phản bội mà chết, nhưng ngoài ý muốn tỉnh dậy thành võ học nghịch thiên giáo chủ hoàng thiên giáo. Tưởng là mở mày mở mặt bắt đầu cuộc sống mới, không ngờ đến đủ loại bãi thối rữa đặt ở trước mặt! Nghe nói có vô số đao linh mĩ nam, thế nhưng từng cái đều dùng phỏng tay? Đường đường giáo chủ nhưng lại muốn sát lại viên thuốc nhỏ phát tài không thể miêu tả, này, Công Thương cục sao?! Không việc gì, xem ta thua keo này bày keo khác! Thú danh đao! Xé phản phái! Kiếm nhiều tiền! Dưỡng mĩ nam! Dựng truyền kì!', 0, '19572', 0, 0, 0, 0, 'Giáo chủ mời dùng đao - TruyenHayTV', '❶❶✅ Đọc truyện tranh Giáo chủ mời dùng đao miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '55', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331859, 0, 0, 30),
(236, 520, 'hôm nay cũng phải cố gắng làm một chú mèo', '', '5,8,12,18,31', 'hom-nay-cung-phai-co-gang-lam-mot-chu-meo', '', '', 'https://i.imgur.com/3fkBN9Sm.jpg', '<div><br></div><div>nội dung: thân là ảnh đế dự bị vì chuyện ngoài ý muốn mà biến thành mèo, rất không may còn rơi vào tay giặc?!</div><div><br></div><div>hắn không biết gì còn ôm tui, thơm tui, tui còn miễn cưỡng nhịn, nhưng, nhưng hắn dám gấp ghé tấm thân tui nè!&nbsp;</div><div><br></div><div>Đáng ghét quá, ai đó cứu tui!!!</div>', 0, '1950', 0, 0, 0, 0, 'hôm nay cũng phải cố gắng làm một chú mèo - TruyenHayTV', '❶❶✅ Đọc truyện tranh hôm nay cũng phải cố gắng làm một chú mèo miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331552, 0, 0, 30),
(240, 679, 'Sách hướng dẫn chiến lược hoa sen đen', '', '5,8,11,14,21', 'sach-huong-dan-chien-luoc-hoa-sen-den', '', '', 'https://i.imgur.com/RxxLK5rm.jpg', 'Lăng Diệu Diệu&nbsp; mặc sách thành pháo hôi nữ ba, còn phải hoàn thành máu chó nhiệm vụ? Châm ngòi nguyên văn nam nữ chủ quan hệ cũng liền mà thôi, còn muốn tiến công chiếm đóng tâm ngoan thủ lạt bệnh kiều hắc liên hoa Mộ Thanh ? ! Cái này có cái gì khó ? Thiên tài Lăng Diệu Diệu&nbsp; cái này đem ngươi nắm bắt〜...,, giống như nội dung cốt truyện đi về hướng không hợp lắm, cái này hắc liên hoa như thế nào nhiều lần chú ý tới Lăng Diệu Diệu ? Chẳng lẽ, là Diệu Diệu&nbsp; mùa xuân đã đến?', 0, '9398', 0, 0, 0, 0, 'Sách hướng dẫn chiến lược hoa sen đen - TruyenHayTV', '❶❶✅ Đọc truyện tranh Sách hướng dẫn chiến lược hoa sen đen miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '10', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331669, 0, 0, 30),
(241, 291, 'Cẩn Thận Bị Mộng Ma Ăn Mất Đó', '', '8,12,15,21,31', 'can-than-bi-mong-ma-an-mat-do', '', '', 'https://i.imgur.com/0tAEL3Am.png', '<p><b style=\"font-weight:normal;\" id=\"docs-internal-guid-95e9e201-7fff-9fd8-7c61-ea9f9454a0c5\"><span style=\"font-size:11.5pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bởi vì bị bệnh mà tiểu trong sáng nhập học muộn một tháng, đã trở thành bạn của một người nổi tiếng nhất! Nhưng phát hiện ra rằng người vạn người mê có duyên này không phải là con người? Tiểu trong sáng thường mơ ác mộng nên bị mộng ma để ý, \"Giấc mơ của ngươi, giống như món ăn cao lương mỹ vị&nbsp; ~\" Trường học trước kết bạn không hề dễ dàng, nếu không cẩn thận có thể sẽ bị mộng ma ăn thịt.</span></b> </p>', 0, '1344097', 0, 0, 0, 0, 'Cẩn Thận Bị Mộng Ma Ăn Mất Đó - TruyenHayTV', '❶❶✅ Đọc truyện tranh Cẩn Thận Bị Mộng Ma Ăn Mất Đó miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '44', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331837, 0, 0, 30),
(242, 390, 'Mãi Mãi Là Bạn Thân', '', '12,15,18,31', 'mai-mai-la-ban-than', '', '', 'https://i.imgur.com/K9xZxg4m.jpg', '<div style=\"text-align: justify;\"><span style=\"color: rgb(102, 102, 102); font-family: Quicksand; font-size: 16px; font-weight: 700;\">Hai người bạn thân thầm thích đối phương. Làm thế nào họ trở thành một đôi. Làm thế nào để bạn vượt qua cảm giác này khi bạn thầm thương trộm nhớ người bạn thân nhất của mình? Liệu bạn có sợ vì đây có thể là dấu chấm hết cho tình bạn của bạn? Nếu người kia cũng vậy thì sao? Xem cách mà hai người chấp nhận rủi ro để mạo hiểm như thế nào.</span></div>', 0, '1051', 0, 0, 0, 0, 'Mãi Mãi Là Bạn Thân - TruyenHayTV', '❶❶✅ Đọc truyện tranh Mãi Mãi Là Bạn Thân miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '4', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331555, 0, 0, 30),
