(265, 734, 'Positively yours', '', '5,9,34', 'positively-yours', '', '', 'https://i.imgur.com/vTIM7N9m.jpg', '<span style=\"color: rgb(228, 230, 235); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38);\">Trước sự thất vọng của Hee-won, BFF mà cô ấy thích và BFF khác của cô ấy hiện đang hẹn hò! Ngại ngùng nghiêm túc, Hee-won quyết định đi hoang ( đi hoang là đi ra ngoài đú trai đó mấy má) chỉ một lần, và tìm niềm an ủi với một người lạ đẹp trai. Tình một đêm rất thỏa mãn giờ đã biến thành nhiều hơn - cô ấy đang mang thai! Định mệnh đưa họ đến với nhau một lần nữa, và bây giờ Doo-joon quyết tâm làm điều đúng đắn và kết hôn với cô ấy. Nhưng về cơ bản họ là những người xa lạ! Ngoại trừ ... cơ thể của họ đã rất quen thuộc với nhau. Người mẹ sắp sinh này phải làm gì đây?</span>', 0, '8698', 0, 0, 0, 0, 'Positively yours - TruyenHayTV', '❶❶✅ Đọc truyện tranh Positively yours miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '17', 0, '', 0, 0, '', '', '', 0, 1630331446, 1630331787, 0, 0, 30),
