(270, 776, 'Người Hầu Của Đứa Trẻ Bị Nguyền Rủa', '', '5,7,23', 'nguoi-hau-cua-dua-tre-bi-nguyen-rua', '', '', 'https://i.imgur.com/oOXZuVGm.jpg', '<p>\"chỉ ngươi mới có thể làm người hầu của ta\"</p><p>Renee, cô gái bị nguyền rủa với \"lời nguyền bất tử\" đang tìm việc làm và hoàng từ bị giam cầm bởi \"lời nguyền độc dược\". 2 con người cô đơn mang 2 lời nguyền khác nhau được định mệnh sắp xếp gặp nhau trong thân phận chủ-tớ</p>', 0, '1481', 0, 0, 0, 0, 'Người Hầu Của Đứa Trẻ Bị Nguyền Rủa - TruyenHayTV', '❶❶✅ Đọc truyện tranh Người Hầu Của Đứa Trẻ Bị Nguyền Rủa miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331447, 1630331543, 0, 0, 30),
(271, 523, 'Bị anh em nhà Saiouji làm phiền cũng không quá tệ', '', '5,7,15,18', 'bi-anh-em-nha-saiouji-lam-phien-cung-khong-qua-te', '', '', 'https://i.imgur.com/UQMMMq3m.jpg', '<span style=\"color: rgb(53, 64, 82); font-family: Arial, Helvetica, sans-serif;\">Satou Fuuka là một đứa trẻ mồ côi. Bà cũng là người giám hộ của cô, đã bỏ trốn trong đêm, để lại cho cô một khoản nợ. Cha mẹ cô muốn cô đi học, vì vậy cô đã tìm kiếm một công việc để trang trải chi phí học tập và tiền thuê nhà. Cô ấy phỏng vấn công việc giúp việc nhà bán thời gian nhưng bị từ chối trước khi cô ấy kịp giới thiệu, vì anh chàng đề nghị công việc là anh cả trong gia đình có 4 anh em và đó là một gia đình toàn nam giới. Cô kể ra câu chuyện của mình, vậy nên anh ta thương hại cô và đề nghị công việc trực tiếp. Tuy nhiên, có một điều kiện: cô phải cải trang để anh em của anh ấy không quan tâm đến cô. Cách ngụy trang của cô ấy là: lấy rất nhiều khăn quấn quanh người để trông mập mạp; trang điểm thành bà cô già (39); cộng với việc xõa hết tóc và đeo kính.</span>', 0, '1786', 0, 0, 0, 0, 'Bị anh em nhà Saiouji làm phiền cũng không quá tệ - TruyenHayTV', '❶❶✅ Đọc truyện tranh Bị anh em nhà Saiouji làm phiền cũng không quá tệ miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '3', 0, '', 0, 0, '', '', '', 0, 1630331447, 1630331549, 0, 0, 30),
(273, 734, 'Nhật kí nuôi dưỡng quái thú', '', '5,9,32', 'nhat-ki-nuoi-duong-quai-thu', '', '', 'https://i.imgur.com/uDvc0om.jpg', '<span style=\"color: rgb(228, 230, 235); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38);\">вlondιna, мộт công cнúa мang dòng мáυ тнường dân, ѕống lặng lẽ тrong мộт cυng đιện rιêng вιệт. do мang тrong мìnн dòng мáυ laι, cô вị đốι хử тệ вạc và вị мọι ngườι ĸнιnн вỉ. мộт ngày nọ, cô тìnн cờ gặp мộт con мèo đen вị тнương và qυyếт địnн cнữa тrị cнo nó.</span>', 0, '23501', 0, 0, 0, 0, 'Nhật kí nuôi dưỡng quái thú - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nhật kí nuôi dưỡng quái thú miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '17', 0, '', 0, 0, '', '', '', 0, 1630331447, 1630331787, 0, 0, 30),
(275, 734, 'Mọi thứ đều là sai lầm', '', '5,9,14,32', 'moi-thu-deu-la-sai-lam', '', '', 'https://i.imgur.com/cyzaePPm.jpg', '<div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;\">Roa Valrose được tái sinh thành nhân vật phản diện trong một cuốn sách mà cô đã đọc ngay trước khi chết. Để có thể tránh khỏi số phận bị thiêu chết trên cọc, cô đã tiếp cận nam chính, Nocton Edgar. Nhưng dường như Nocton kiên quyết muốn làm khó cô, khiến cô làm tất cả những gì hắn muốn.</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;\">“ Đến nữa đi, Valrose.” </div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;\">Nhân vật Nocton huyền bí này đột nhiên lại tìm đến cô mỗi ngày. Rồi một ngày, người bạn 10 năm của cô nói điều không thể tin được với cô. </div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;\">“ Thật ra, mình được báo mộng. Công tước Nocton là một gã vô cùng khốn nạn”</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;\">Hắn không phải người hùng mà là tên khốn? Ngay khi cô ấy nhận ra cô đã hiểu sai nhân vật này, cô quyết định rời xa Nocton.</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;\">“ Đừng bao giờ gặp lại nữa.”</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;\">Nhưng phản ứng của hắn vô cùng kỳ lạ.</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;\">“ Đừng đi. Cậu luôn là người đặc biệt với mình.” </div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;\">Cô ấy nghi ngờ sự thay đổi đột ngột về thái độ của hắn. Liệu cô ấy có thoát khỏi hắn một cách an toàn.</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; white-space: pre-wrap; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;\">Tất cả đều là hiểu nhầm.</div>', 0, '86685', 0, 0, 0, 0, 'Mọi thứ đều là sai lầm - TruyenHayTV', '❶❶✅ Đọc truyện tranh Mọi thứ đều là sai lầm miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '18', 0, '', 0, 0, '', '', '', 0, 1630331447, 1630331788, 0, 0, 30),
