(283, 293, 'Một cuộc sống mới, một tôi mới', '', '9,18,21', 'mot-cuoc-song-moi-mot-toi-moi', '', '', 'https://i.imgur.com/8lzcEWVm.jpg', '<span style=\"font-family: Helvetica, Arial, sans-serif; white-space: pre-wrap;\">Cô gái 18 tuổi Sangah Park được chuyển sinh thành một cô nàng cơ bắp ở một thế giới song song. Mục đích của cô ấy là gì? Để tạo ra dàn harem của riêng mình.</span>', 0, '2023', 0, 0, 0, 0, 'Một cuộc sống mới, một tôi mới - TruyenHayTV', '❶❶✅ Đọc truyện tranh Một cuộc sống mới, một tôi mới miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '8', 0, '', 0, 0, '', '', '', 0, 1630331447, 1630331551, 0, 0, 30),
(289, 285, '[Prologue] Cha, Con Không Muốn Cuộc Hôn Nhân Này!', '', '9,10,14', '-prologue-cha-con-khong-muon-cuoc-hon-nhan-nay-', '', '', 'https://i.imgur.com/QEPOqykm.jpg', 'Tôi tái sinh thành nhân vật phản diện trong một cuốn tiểu thuyết tôi đã đọc, Jubellian Eloy Floyen. Tôi đã chết, nhung không! Với những kí ức của kiếp trước, tôi sẽ tránh được lá cờ tử thần của mình!\r\n <div>“Tôi sẽ không kết hôn với một người đàn ông không có danh dự, không gia thế, không tài sản và không quyền lực!”\r\n</div><div>Khi tôi tuyên bố rằng tôi sẽ quyết chí sống một cuộc sống vinh quang và hào nhoáng, cha tôi lại quyết định cho Thái tử làm vị hôn phu của tôi?! Người có điên không vậy?! Tôi sẽ chỉ coi hợp đồng đính hôn là biện pháp cuối cùng.\r\n</div><div>“Mà sao cô lại lảng tránh việc đính hôn với Thái tử vậy?”\r\n</div><div>“Vì tôi sợ chứ sao! Hắn ta là người sẽ giết những kẻ không nghe lời hắn ngay lập tức đó!”\r\n</div><div>Vài ngày sau đó, Thái tử đã gửi cho tôi một bức thư. Trong đó ghi là “Đừng lo lắng, ta sẽ không giết cô.”\r\n</div><div>Ôi không… Tôi đã làm một việc đáng chết rồi sao?\r\n</div><div><br></div>', 0, '1033', 0, 0, 0, 0, '[Prologue] Cha, Con Không Muốn Cuộc Hôn Nhân Này! - TruyenHayTV', '❶❶✅ Đọc truyện tranh [Prologue] Cha, Con Không Muốn Cuộc Hôn Nhân Này! miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '0', 0, '', 0, 0, '', '', '', 0, 1630331447, 1630331553, 0, 0, 30),
