(297, 369, 'Một đêm với hoàng đế', '', '5,9,34', 'mot-dem-voi-hoang-de', '', '', 'https://i.imgur.com/uCEHL8Pm.jpg', 'Penelope, 24 tuổi. <div>Bên ngoài là một tiểu thư xinh đẹp con gái của nam tước, bên trong lại là một bà già hay chửi thề!</div><div>Nhưng mà người đàn ông đã qua đêm cùng cô ấy dưới ảnh hưởng của rượu... chính là hoàng đế?</div><div>\"Chết tiệt, anh ta ở khắp mọi nơi.\"</div><div>\"Ta nhất định sẽ có được cô ấy.\"</div><div>Hãy cùng trải nghiệm những rung động trái tim lãng mạn, trẻ trung trong chuyện tình giả tưởng của hai người!</div>', 0, '67105', 0, 0, 0, 0, 'Một đêm với hoàng đế - TruyenHayTV', '❶❶✅ Đọc truyện tranh Một đêm với hoàng đế miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '23', 0, '', 0, 0, '', '', '', 0, 1630331447, 1630331858, 0, 0, 30),
(298, 369, 'Tai tiếng thị phi', '', '5,9', 'tai-tieng-thi-phi', '', '', 'https://i.imgur.com/FXbv1nZm.jpg', 'Đại diện cho vẻ đẹp “ thuần khiết” và là nữ diễn viên nổi tiếng nhất nước, Yeo Goeun, và kẻ chuyên tạo ra scandal, Seo Beomi. Thực ra, hai người họ có chung một bí mật. Họ phải “diễn” như đôi bạn thân thiết nhất vì kế hoạch kinh doanh của Công ty . Hai người họ trông cực kỳ thân thiết và quý mến nhau trên show thực tế \" BFF đặc biệt \", nhưng tất cả chỉ là diễn! <div>“Tôi không có ý định trở thành bạn với anh! Không bao giờ”</div><div>“Tôi cũng không có ý định trở thành bạn với cô”</div><div>Ban đầu, họ luôn đối xử nhau như kẻ thù bất cứ khi nào họ gặp nhau . Nhưng trong quá trình quay, hai người trở nên gần gũi hơn. Và Goeun, người lúc đầu không thích Beomi, lại có một chút tình cảm...</div>', 0, '8374', 0, 0, 0, 0, 'Tai tiếng thị phi - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tai tiếng thị phi miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '44', 0, '', 0, 0, '', '', '', 0, 1630331448, 1630331855, 0, 0, 30),
(301, 293, 'Bộ phận chăm sóc khách hàng hệ ngân hà', '', '8,18,23', 'bo-phan-cham-soc-khach-hang-he-ngan-ha', '', '', 'https://i.imgur.com/iPmugtvm.jpg', '<font style=\"margin: 0px; padding: 0px; color: rgba(0, 0, 0, 0.56); font-family: Arial, &quot;Microsoft YaHei&quot;, &quot;Microsoft Sans Serif&quot;, &quot;Microsoft SanSerf&quot;, 微软雅黑; vertical-align: inherit;\">Thân Trung Nhất, một học sinh trung học bình thường, tình cờ phát hiện ra cô gái mình thích là người ngoài hành tinh và cũng là nhân viên của Bộ phận chăm sóc khách hàng hệ Ngân hà. Đây là nơi xử lý</font><font style=\"margin: 0px; padding: 0px; color: rgba(0, 0, 0, 0.56); font-family: Arial, &quot;Microsoft YaHei&quot;, &quot;Microsoft Sans Serif&quot;, &quot;Microsoft SanSerf&quot;, 微软雅黑; vertical-align: inherit;\">&nbsp;các sự cố khác nhau do khách du lịch (người ngoài hành tinh sống trên trái đất) gây ra, đồng thời \"giải quyết\" những người dân bản địa chứng kiến hoặc có liên quan (xóa ký ức, xáo trộn ký ức, và thậm chí tiêu diệt họ một cách nhân đạo).&nbsp;</font><font style=\"margin: 0px; padding: 0px; color: rgba(0, 0, 0, 0.56); font-family: Arial, &quot;Microsoft YaHei&quot;, &quot;Microsoft Sans Serif&quot;, &quot;Microsoft SanSerf&quot;, 微软雅黑; vertical-align: inherit;\">Để tránh bị xóa sổ và mất đi ký ức về mối quan hệ với cô ấy, Thân Trung Nhất bắt đầu cuộc sống làm việc trong Bộ phận chăm sóc khách hàng hệ Ngân hà, nơi đầy rẫy nguy hiểm và khó khăn.</font>', 0, '122', 0, 0, 0, 0, 'Bộ phận chăm sóc khách hàng hệ ngân hà - TruyenHayTV', '❶❶✅ Đọc truyện tranh Bộ phận chăm sóc khách hàng hệ ngân hà miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331448, 1630331583, 0, 0, 30),
