(320, 293, 'Giấc mộng mùa hè của ảnh đế', '', '5,8,18,31', 'giac-mong-mua-he-cua-anh-de', '', '', 'https://i.imgur.com/FX0Y972m.jpg', '<p>Vào một ngày đẹp trời, <font color=\"#ff0000\">Cố Thanh Nhượng</font> vô tình ném bóng trúng thiếu gia cao ngạo lạnh lùng - <font color=\"#ff0000\">Giang Nhất Thần</font>. Mối quan hệ giữa hai người càng ngày càng thân thiết khiến <font color=\"#ff0000\">Thẩm Chi Ngữ</font> bất an.&nbsp;<span style=\"color: rgb(255, 0, 0);\">Liệu A Nhượng cuối cùng sẽ thuộc về ai?</span></p>', 0, '3227', 0, 0, 0, 0, 'Giấc mộng mùa hè của ảnh đế - TruyenHayTV', '❶❶✅ Đọc truyện tranh Giấc mộng mùa hè của ảnh đế miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '6', 0, '', 0, 0, '', '', '', 0, 1630331448, 1630331566, 0, 0, 30),
(321, 369, 'Gian phi của vạn tra triều hoàng rất bận', '', '5,8,10,11,14,17', 'gian-phi-cua-van-tra-trieu-hoang-rat-ban', '', '', 'https://i.imgur.com/fjT2YaK.jpg', 'Nội dung: \"Gian phi của vạn tra triều hoàng rất bận” là phiên ngoại của truyện \"Vạn tra triều hoàng” , cập nhật vào thứ 4, thứ 7 hàng tuần, Tô Lục Hạ nhận được nhiệm vụ đó là xâm nhập vào thế giới nhỏ với mục đích là ngược đãi tên hoàng đế cặn bã và 3 kẻ gian phi. Tuy nhiên lại gặp phải người thi hành \"nhóm phi tần nam” - Giang Mỗ. Giang Mỗ đến thế giới nhỏ với nhiệm vụ đảm bảo nam tần thời không hoàn thành nhiệm vụ, đồng thời trục xuất nữ tần thời không Tô Lục Hạ. Hai hệ thống cùng đánh nhau trong thế giới nhỏ, hệ thống nữ tần VS hệ thống nam tần, ai là người chiến thắng cuối cùng? <div><br></div>', 0, '24549', 0, 0, 0, 0, 'Gian phi của vạn tra triều hoàng rất bận - TruyenHayTV', '❶❶✅ Đọc truyện tranh Gian phi của vạn tra triều hoàng rất bận miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '25', 0, '', 0, 0, '', '', '', 0, 1630331448, 1630331797, 0, 0, 30),
(322, 292, '《Cheating Man Must Die》Vạn Tra Triều Hoàng: Gian Phi Rất Bận', '', '5,8,11,14,16,17,23,32,34', '-cheating-man-must-die-van-tra-trieu-hoang-gian-phi-rat-ban', '', '', 'https://i.imgur.com/tFzOPiIm.jpg', '<div>《Vạn Tra Triều Hoàng: Gian Phi Rất Bận》</div><div>-------------</div><div>Tác Giả: 时代漫王&nbsp;</div><div>Thể loại: Manhua, Xuyên Nhanh, Drama, Action, Adventure, Fantasy, Romance, Sci-fi, Historical</div><div>Tình trạng: OnGoing</div><div>-------------&nbsp;</div><div>《Vạn Tra Triều Hoàng: Gian Phi Rất Bận》là phiên ngoại của《Vạn Tra Triều Hoàng》, kể về việc Tô Lục Hạ nhận được nhiệm vụ, lén xuyên tới tiểu thế giới hành quyết cặn bã, mục tiêu là tên Hoàng đế tra nam và Gian Phi Tam Danh, nhưng vô tình gặp được \"Nam tần\", người chấp hành Tưởng Mạch, Tưởng mạch vì cam đoan hoàn thành nhiệm vụ Nam tần thời không, hàng lâm đến tiểu thế giới, trục xuất Tô Lục Hạ nhập cư trái phép, hai người chấp hành ở tiểu thế giới đấu đá lẫn nhau, Hệ Thống Nữ Tần V.S Hệ Thống Nam Tần, ai sẽ là người thắng sau cùng?</div>', 0, '6599', 0, 0, 0, 0, '《Cheating Man Must Die》Vạn Tra Triều Hoàng: Gian Phi Rất Bận - TruyenHayTV', '❶❶✅ Đọc truyện tranh 《Cheating Man Must Die》Vạn Tra Triều Hoàng: Gian Phi Rất Bận miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '12', 0, '', 0, 0, '', '', '', 0, 1630331448, 1630331734, 0, 0, 30),
