(349, 679, 'Vương phi không treo khoa', '', '5,8,11,14,18', 'vuong-phi-khong-treo-khoa', '', '', 'https://i.imgur.com/lVjxsZGm.jpg', 'Một cách tinh quái \"Đức vân nữ hài\" Đào Tiểu Thiên, một khi mặc vì bạo ngược nhiếp chính vương rơi chạy tân nương, đào hôn chưa toại cuối cùng bị phu quân một cước đầu nhập Hoàng gia thư viện chịu dạy dỗ! Dựa vào cái gì người khác làm Vương phi lần chịu nuông chiều, ta làm Vương phi lại phải về lô trùng tu? ! Học cặn bã đào tiểu thiên một bên làm bài tập, một bên khóc lóc kể lể vận mệnh chi nhấp nhô từng cái hồn mặc Vương phi đẹp như hoa, hành hạ cặn bã đấu biểu tự ý ăn dưa vì dỗ dành phu quân nhập ta trướng, việc học tình yêu ôm đồm.', 0, '185', 0, 0, 0, 0, 'Vương phi không treo khoa - TruyenHayTV', '❶❶✅ Đọc truyện tranh Vương phi không treo khoa miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331449, 1630331582, 0, 0, 30),
(350, 825, 'THIẾT LẬP HÌNH TƯỢNG DADDY CỦA TÔI BỊ SỤP ĐỔ', '', '5,8,18,20', 'thiet-lap-hinh-tuong-daddy-cua-toi-bi-sup-do', '', '', 'https://i.imgur.com/j1ZiKGsm.jpg', '<span style=\"color: rgb(53, 64, 82); font-family: Poppins;\">Một câu chuyện tình nhẹ nhàng, lãng mạn , hài hước giữa Thời Sơ Hạ - một cô nhân viên làm nghề báo và tổng tài bá đạo, lạnh lùng, kiêm siêu sao thiên vương Lục tiên sinh. Lần đầu tiên gặp mặt, câu đầu tiên hắn nói với cô chính là....\"Vứt ra ngoài, cho chó ăn\". Ai biết được sau này hắn lại trở thành gương mặt đại diện trong làng tổng tài sủng vợ, đâu đâu cũng rầm rộ tin đồn: Lục tiên sinh cưng chiều bà Lục tận trời xanh, nâng trong tay sợ vỡ, ngậm trong miệng sợ tan. \" Ngày tháng như vậy không thể sống được nữa, tôi muốn ly hôn!\" Thời Sơ Hạ hậm hực =]</span>', 0, '2910', 0, 0, 0, 0, 'THIẾT LẬP HÌNH TƯỢNG DADDY CỦA TÔI BỊ SỤP ĐỔ - TruyenHayTV', '❶❶✅ Đọc truyện tranh THIẾT LẬP HÌNH TƯỢNG DADDY CỦA TÔI BỊ SỤP ĐỔ miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '19', 0, '', 0, 0, '', '', '', 0, 1630331449, 1630331657, 0, 0, 30),
