(363, 523, 'Tôi sẽ ung dung trở thành y sĩ ở một thế giới khác', '', '5,7,17,18,21', 'toi-se-ung-dung-tro-thanh-y-si-o-mot-the-gioi-khac', '', '', 'https://i.imgur.com/rphl2Flm.jpg', '<p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">Vào khoảng ba mươi tuổi, Shouko bất ngờ gặp tai nạn trên đường về nhà và tái sinh ở một vũ trụ song song. Khi cô tái sinh, một nữ thần ban cho cô \"sức mạnh chữa lành\" và những người chăm sóc sẽ lo cho cô đến khi cô có thể tự lập.</p><br style=\"color: rgb(53, 64, 82); font-family: Poppins;\"><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">Tuy nhiên, cô lại bắt đầu cuộc sống dưới hình dạng của một đứa trẻ 10 tuổi ...</p><br style=\"color: rgb(53, 64, 82); font-family: Poppins;\"><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">Trước khi tái sinh, Sachiko, người vừa thức dậy từ cái chết, đã được một thợ săn đẹp trai tên Falco nhặt về. Shouko theo bản năng biết được rằng Falco là một trong những người chăm sóc đã hứa hẹn ... nhưng đó lại là rắc rối.</p><br style=\"color: rgb(53, 64, 82); font-family: Poppins;\"><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">Dấu chấm liên tục của Falco không thể dừng lại!</p><br style=\"color: rgb(53, 64, 82); font-family: Poppins;\"><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">Săn bắn slime(là một con quái trong game