(368, 292, 'LiLy Có Độc', '', '9,10,11,16,32,33,34', 'lily-co-doc', '', '', 'https://i.imgur.com/gGmyWEam.jpg', '<div>Tên khác: A poisonous Lily, 지독한릴리</div><div>------------</div><div>Tác giả: Eunrock</div><div>Artist: Hemo</div><div>Thể loại: Action, Drama, Manhwa, Shoujo, Webtoons</div><div>Tình trạng: OnGoing</div><div>-------------</div><div>Nội dung:&nbsp;</div><div>&nbsp; &nbsp; &nbsp;Thánh nữ của Đế quốc Serife, Lily Stella.</div><div><br></div><div>&nbsp;Cô ấy là một tồn tại linh thiên mà không một ai dám coi thường.&nbsp; Nhưng đến một ngày, cô không còn nghe thấy tiếng nói của Chúa nữa, và Thánh chế Serife sụp đổ.&nbsp; Lily Stella, người bị kẻ thù ném xuống giếng, đã nguyền rủa Thần Serife, người mà cô dành cả cuộc đời để phục vụ.</div><div>&nbsp; \" Serife, nếu người vẫn còn nghe giọng nói của con, hãy cho con một cơ hội khác.&nbsp; Nhưng nếu con chết như thế này và trở về trong vòng tay của người, con…\"</div><div>&nbsp; &nbsp; \"Ta sẽ xé xác bà thành từng mảnh và ăn tươi nuốt sống bà.\"</div><div>&nbsp; &nbsp; &nbsp;Khi mở mắt ra, Lily đã quay trở lại 17 năm về trước, khi cô còn là một đứa trẻ 6 tuổi</div><div>&nbsp; &nbsp; &nbsp;Cô ấy đã vứt bỏ sự lương thiện của kiếp trước và trở thành một người ác độc, chỉ sống vì bản thân mình</div><div>#manhwa #trongsinh #truyentranh #linhlauho</div>', 0, '1863', 0, 0, 0, 0, 'LiLy Có Độc - TruyenHayTV', '❶❶✅ Đọc truyện tranh LiLy Có Độc miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331450, 1630331590, 0, 0, 30),
