(374, 370, 'Cẩn Thận Các Anh Trai Đấy!', '', '9,10,11,15,18', 'can-than-cac-anh-trai-day-', '', '', 'https://i.imgur.com/ZCEWJE4m.jpg', '<span style=\"color: rgb(53, 64, 82); font-family: Poppins;\">Hari được gia đình công tước Erenst nhận nuôi vào lúc 7 tuổi khi cô mất mẹ của mình. Dù cho bị áp bức đủ kiểu bởi 3 người con trai của Erenst, cô cuối cùng đã thoát khỏi cuộc sống đầy máu me và nước mắt vì cô đã đến tuổi kết hôn. Nhưng chuyện quái gì đã xảy ra? Khi tôi vừa thức dậy, tôi lại trở về cái tuổi thơ địa ngục ấy! Là mơ sao?! Hmph. Nếu mình không tỉnh dậy khỏi giấc mơ này, thì ít nhất mình phải sống bớt lo nghĩ về người khác từ bây giờ! Như thế, Hari đã có một quyết định lạc lối. Cùng tác giả với “Who Made Me A Princess”!</span>', 0, '117535', 0, 0, 0, 0, 'Cẩn Thận Các Anh Trai Đấy! - TruyenHayTV', '❶❶✅ Đọc truyện tranh Cẩn Thận Các Anh Trai Đấy! miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '72', 0, '', 0, 0, '', '', '', 0, 1630331450, 1630331698, 0, 0, 30),
(375, 679, 'Tuyệt sắc nữ y: Thái tử người liền ngã vào ta', '', '5,7,11,14', 'tuyet-sac-nu-y-thai-tu-nguoi-lien-nga-vao-ta', '', '', 'https://i.imgur.com/KZP9Vakm.jpg', 'Nữ bác sĩ hiện đại bị tai nạn xe cộ, tuyệt thế mỹ nữ cũng liền mà thôi, vậy mà xuyên không đến cổ đại trở thành chính là tiểu ăn mày. Vừa tới đã bị đưa đến thanh lâu, lại ngoài ý muốn biết được chủ nhân cái thanh lâu này lại là Thái tử đương triều? Nhưng cứu tinh của ta vị này sư phụ cũng quá cấm dục. Phúc hắc ngạo kiều Băng Sơn công tử? Ôn nhuận như ngọc ấm lòng sư phụ, xem ta từng bước từng bước ăn lau khô sạch! Manga cải biên tự nguyên tiểu thuyết《 y phi thiên hạ》', 0, '434', 0, 0, 0, 0, 'Tuyệt sắc nữ y: Thái tử người liền ngã vào ta - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tuyệt sắc nữ y: Thái tử người liền ngã vào ta miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331450, 1630331599, 0, 0, 30),
(376, 523, 'Tiên nữ may vá', '', '5,7,10,21,34', 'tien-nu-may-va', '', '', 'https://i.imgur.com/ikoREkKm.jpg', '<span style=\"color: rgb(53, 64, 82); font-family: Poppins;\">Rời khỏi trần gian khi còn mang trong mình kí ức của kiếp trước, Ewey lại được tái sinh trong một gia đình quý tộc Artisan của Nylle. Tuy nhiên, sau khi xác định rằng cô không có khả năng để làm ra \"đường thêu vệ thánh\", cô đã bị lợi dụng và phải trải qua những ngày của mình trong một địa ngục trần gian. Tình cờ, cô được nhà quý tộc tốt bụng Roden Kalosthylla chọn làm thợ may. Biết ơn Roden, cô đã sử dụng \"đường thêu vệ thánh\" mà cô chưa bao giờ cho gia đình mình xem để làm cho anh ta coi như một món quà. Cộng thêm vào sức mạnh của những \"tinh linh\" mà cô luôn tương tác, giúp cô hoàn thành và trở thành một món đồ ở cấp độ bảo vật quốc gia. Từ đó cuộc đời của Ewey lại bước sang một trang mới.</span>', 0, '1121', 0, 0, 0, 0, 'Tiên nữ may vá - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tiên nữ may vá miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331450, 1630331583, 0, 0, 30),
(377, 292, 'Sống Sót Với Tư Cách Là Một Hầu Gái', '', '5,9,14,32,33,34', 'song-sot-voi-tu-cach-la-mot-hau-gai', '', '', 'https://i.imgur.com/l2woT1Em.jpg', '<div>《Sống Sót Với Tư Cách Là Một Hầu Gái 》</div><div>------------</div><div>Tên khác: Surviving As A Maid; 시녀로 살아남기</div><div>------------</div><div>Tác giả: Cloud Whale Soap</div><div>Artist(s): Heeseo</div><div>Thể loại: Drama, Fantasy, Historical, Manhwa, Romance, Shoujo</div><div>Tình trạng: OnGoing</div><div>--------------</div><div>Giới thiệu:&nbsp;</div><div>&nbsp; &nbsp; &nbsp;Tôi mở mắt ra khi đang nấu ramen, phát hiện bản thân đã trở thành hầu gái của Hoàng Hậu bị ruồng bỏ trong một cuốn tiểu thuyết. Chính xác hơn thì đây là một cuốn tiểu thuyết BL, Quốc Vương là Gay, Vợ lẽ là Gay, Hiệp sĩ là Gay, người hầu là Gay, và Thủ Thư cũng Gay nốt</div><div>&nbsp; &nbsp; &nbsp; Liệu cô ấy có thể an toàn sống sót trở trở thành một người hầu gái bình thường, Ash, không có hào quang buff của nhân vật chính?</div><div>&nbsp; &nbsp; &nbsp; Một hầu gái sẽ làm cách nào để sống sót?</div><div>#manhwa #truyentranh #romance #xuyenkhong #linhlauho</div>', 0, '781', 0, 0, 0, 0, 'Sống Sót Với Tư Cách Là Một Hầu Gái - TruyenHayTV', '❶❶✅ Đọc truyện tranh Sống Sót Với Tư Cách Là Một Hầu Gái miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331450, 1630331583, 0, 0, 30),
(378, 314, 'Chọn ra một người cha trong số các bạo chúa', '', '5,9,10,32,33,34', 'chon-ra-mot-nguoi-cha-trong-so-cac-bao-chua', '', '', 'https://i.imgur.com/X79nUb0m.jpg', '<p>Tên truyện: Chọn ra một người cha trong số các bạo chúa</p><p>Tác giả:&nbsp;밤마녀</p><p>Nhóm dịch: Snow Tea</p><p>Thể loại: Ngôn tình, manhwa, drama...</p><p>Văn án:</p><p>Tiến sĩ Jaehee Cheon, một người mất cha mẹ từ khi còn nhỏ và không thể nhớ được mặt họ, người đã sống mà không có nổi một người bạn, chứ đừng nói đến người yêu, lại tái sinh thành nàng công chúa xui xẻo trong một cuốn tiểu thuyết và chết ở tuổi mười hai! Nếu không thể tìm thấy cha ruột của công chúa, cô ấy sẽ chết. Nhưng hình như có tận bốn ứng cử viên ??? Và vấn đề lớn hơn chính là họ quá nguy hiểm…. Liệu Chun Jae-hee có thể tìm thấy người cha thực sự của mình một cách an toàn và có một kết thúc có hậu? Mời mọi người đón xem \"Chọn ra người cha thật trong số các bạo chúa\"<br></p>', 0, '996', 0, 0, 0, 0, 'Chọn ra một người cha trong số các bạo chúa - TruyenHayTV', '❶❶✅ Đọc truyện tranh Chọn ra một người cha trong số các bạo chúa miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331451, 1630331603, 0, 0, 30),
