(380, 293, 'Kế hoạch 100 ngày yêu', '', '5,8,15,34', 'ke-hoach-100-ngay-yeu', '', '', 'https://i.imgur.com/hZUk3axm.jpg', '<font face=\"Times New Roman\">Nếu bạn được yêu cầu phải yêu một người trong vòng 100 ngày, bạn có đồng ý không? Do lỗi hệ thống, <font color=\"#ff0000\">Thanh Lăng</font> bị ép buộc tham gia <font color=\"#ff0000\">LC - Văn phòng</font> <font color=\"#ff0000\">tư vấn tình yêu</font> cùng với <font color=\"#ff0000\">ba soái ca</font> và dạy họ cách để yêu. Tuy nhiên trong quá trình đó, những rắc rối đã xuất hiện... Cứ ngỡ đây là một câu chuyện tình yêu trong khuôn viên trường ngọt ngào và lãng mạn, cuối cùng đây lại là một <font color=\"#ff0000\">kế hoạch bí mật có quy mô lớn</font>, thậm chí còn <font color=\"#ff0000\">đe dọa đến tính mạng của họ</font>... </font>', 0, '1029', 0, 0, 0, 0, 'Kế hoạch 100 ngày yêu - TruyenHayTV', '❶❶✅ Đọc truyện tranh Kế hoạch 100 ngày yêu miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331451, 1630331589, 0, 0, 30),
(381, 292, 'Nữ Công Tước Của Ngôi Nhà Kính', '', '5,9,23,32,33,34', 'nu-cong-tuoc-cua-ngoi-nha-kinh', '', '', 'https://i.imgur.com/OSeHgKxm.jpg', '<div>Nữ Công Tước Của Ngôi Nhà Kính</div><div>-------------</div><div>Tên khác: Duchess of the Glass House, 유리온실의 공작 부인</div><div>--------------</div><div>Tác giả : 공기알</div><div>Tình trạng : Ongoing&nbsp;</div><div>Thể loại : Drama, Fantasy, Manhwa, Romance</div><div>-------------</div><div>Giới thiệu</div><div><br></div><div>\"Hãy sống cuộc đời của chính bạn. Đừng bỏ cuộc hay trao bất cứ ai điều khiển nó. \" Những lời của Edhart khá độc đoán nhưng để lại ấn tượng tôi một cách kỳ lạ. Tuy nhiên, cuộc hôn nhân này của tôi và anh ấy đã trên bờ vực của sự bất hạnh và đứa con quý giá cũng bị cướp đi.&nbsp; Tôi chết cô đơn trong một ngôi nhà xoàng biệt lập.&nbsp; Cuộc đời thứ hai đã may mắn đến với tôi khi tôi chấp nhận từ bỏ tất cả mọi thứ.&nbsp; Tôi thề sẽ tận dụng cơ hội mà tôi được trao.&nbsp; \"Khi nhắm mắt lại, quá khứ lại hiện ra trước mặt, nhưng bây giờ tôi sẽ đối mặt với chúng mà không chạy trốn. Để bảo vệ tôi và con tôi!\"</div><div>#manhwa #trongsinh #linhlauho #truyentranh</div>', 0, '4822', 0, 0, 0, 0, 'Nữ Công Tước Của Ngôi Nhà Kính - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nữ Công Tước Của Ngôi Nhà Kính miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331451, 1630331589, 0, 0, 30),
