(387, 533, 'Hoán Đổi Linh Hồn', '', '5,8,15,18,21,34', 'hoan-doi-linh-hon', '', '', 'https://i.imgur.com/bXTVz04.jpg', '<div>Giới thiệu truyện tranh</div><div>Hai anh em trong vô thức đã hoán đổi thân xác cho nhau, bắt buộc phải theo đuổi được người trong mộng của đối phương mới có thể trở lại hình dáng ban đầu! Sau một hồi choáng váng, đã ở trong thân thể của anh trai. Tôi sẽ được giải thoát nếu nắm bắt được tình yêu đích thực.! Nhưng mà thân thể của anh tôi cũng thật hữu ích a hehehe</div>', 0, '2473', 0, 0, 0, 0, 'Hoán Đổi Linh Hồn - TruyenHayTV', '❶❶✅ Đọc truyện tranh Hoán Đổi Linh Hồn miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '7', 0, '', 0, 0, '', '', '', 0, 1630331451, 1630331668, 0, 0, 30),
(388, 516, 'Em là chú mèo nhỏ của tôi', '', '5,9,20', 'em-la-chu-meo-nho-cua-toi', '', '', 'https://i.imgur.com/L0Nt86z.png', 'Mồ côi khi mới sinh và bị bắt nạt tại nơi làm việc, Myohee đã phải trải qua vô số thử thách trong cuộc sống. Nhưng khi cô ấy bị lừa bởi người bạn duy nhất của mình và kết thúc bằng việc phá sản, Myohee cảm thấy như thể cô ấy sẽ không bao giờ tìm thấy bạc trong đám mây của mình. Cô quyết định tự kết liễu cuộc đời mình bằng cách nhảy lầu, nhưng giữa không trung, thần chết đã ngăn cô nhảy xuống và nói rằng thời gian của cô vẫn chưa hết. Cô ấy được lệnh phải sống thêm 100 ngày nữa...như một con mèo! Trước khi cô ấy biết điều đó, cô ấy đã được đưa đến nhà của ông chủ đẹp trai, xa cách của cô ấy, giám đốc Cha. Có vẻ như đây là cơ hội hoàn hảo để nhận được tình yêu và sự chăm sóc mà cô ấy chưa từng có trong đời… giá như Myohee có thể vẫn là một con mèo!', 0, '489', 0, 0, 0, 0, 'Em là chú mèo nhỏ của tôi - TruyenHayTV', '❶❶✅ Đọc truyện tranh Em là chú mèo nhỏ của tôi miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331451, 1630331604, 0, 0, 30),
(390, 303, 'Idol thánh', '', '9,11,14,16,17,18,21,23,34', 'idol-thanh', '', '', 'https://i.imgur.com/iouh55C.jpg', 'Rembrary, vị phó của Chúa được mọi người yêu mến và là linh mục thượng phẩm thánh thiện. Sau khi chiến đấu chống lại Ma Vương xâm lược thế giới, anh ta tỉnh dậy với thân phận của một idol Kpop kém nổi tiếng ... Liệu anh ta có thể an toàn thích nghi với cuộc sống thần tượng của mình và trở về thế giới ban đầu của mình?', 0, '1047', 0, 0, 0, 0, 'Idol thánh - TruyenHayTV', '❶❶✅ Đọc truyện tranh Idol thánh miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '4', 0, '', 0, 0, '', '', '', 0, 1630331451, 1630331674, 0, 0, 30),
