(392, 370, 'Địch Úc Đa Chi Ca', '', '5,8,11,16,17,18,34', 'dich-uc-da-chi-ca', '', '', 'https://i.imgur.com/HAQ5S1X.jpg', '<p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">Shirna một nàng công chúa khả ái và hoạt bát của Đế quốc phương Tây, đã gặp một con tin từ vương quốc phía Bắc Latio. Khi trái tim họ đến gần nhau, một vị vua trẻ tuổi của Đế chế phương Đông, Nia (có thể là anh tóc vàng :v), đang bí mật theo dõi…</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">Thật không may, tam quốc hòa bình chỉ là hời hợt từ vẻ bề ngoài và chiến tranh mới là vỏ bọc bên trong sự hời hợt ấy. Những người bạn thời thơ ấu cuối cùng sẽ phải đối mặt với sự lựa chọn giữa tình yêu và trách nhiệm: kiếm và máu, khói và nước mắt, sự chân thành và sự phản bội,... Úi trời ơi ngập mùi drama</p>', 0, '105285', 0, 0, 0, 0, 'Địch Úc Đa Chi Ca - TruyenHayTV', '❶❶✅ Đọc truyện tranh Địch Úc Đa Chi Ca miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '70', 0, '', 0, 0, '', '', '', 0, 1630331451, 1630331674, 0, 0, 30),
