(394, 516, 'Nam Thành Chờ Trăng Về', '', '5,8,10,20,34', 'nam-thanh-cho-trang-ve', '', '', 'https://i.imgur.com/Qes0dr1.jpg', '<span style=\"caret-color: rgb(53, 64, 82); color: rgb(53, 64, 82); font-family: Poppins; -webkit-text-size-adjust: 100%;\">Vào đêm trước của lễ đính hôn, người chị sinh đôi biến mất một cách bí ẩn và Thẩm Vu Quy chỉ có thể thay thế chị gái mình leo lên giường của tổng tài Phí Thị. Nhưng người đàn ông lạnh lùng này vậy mà lại trở mặt sau khi ngủ xong. Không được,cuộc sống này phụ thuộc vào mình! Dùng vẻ mặt “bạch liên” song cũng đầy oán hận tự tay xử lý tiểu tam.Hãy xem Thẩm Vu Quy - cao thủ võ thuật, hacker hàng đầu của giới thượng lưu trở về.</span>', 0, '2429', 0, 0, 0, 0, 'Nam Thành Chờ Trăng Về - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nam Thành Chờ Trăng Về miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '3', 0, '', 0, 0, '', '', '', 0, 1630331451, 1630331603, 0, 0, 30),
(395, 50, 'Nhìn vào 1 bức tranh', '', '5,9,15,18', 'nhin-vao-1-buc-tranh', '', '', 'https://i.imgur.com/MbghAcH.jpg', 'Jisoo, người mơ ước trở thành một người vẽ minh họa truyện cổ tích từ khi còn nhỏ, đã bỏ học để đạt được ước mơ của mình và đến nhà bà ngoại, nơi cô gặp Dowon.&nbsp; Dowon, người lo lắng về việc không có ước mơ, quan tâm đến Jisoo, người đang cố gắng rất nhiều để đạt được ước mơ của mình.&nbsp; “Bạn cố gắng bắt càng xa, bạn càng cảm thấy xa hơn.&nbsp; Khi nào thì ngày bạn chạm tới ước mơ của mình sẽ đến? ”', 0, '8754', 0, 0, 0, 0, 'Nhìn vào 1 bức tranh - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nhìn vào 1 bức tranh miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '4', 0, '', 0, 0, '', '', '', 0, 1630331451, 1630331670, 0, 0, 30),
(396, 369, 'Quân Hoả Nữ Hoàng', '', '5,8,11,14,16,18,23', 'quan-hoa-nu-hoang', '', '', 'https://i.imgur.com/ohznK2u.jpg', '<p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">- Thể loại : Nữ cường , xuyên không , hệ thống , harem , cổ đại ....</p><br style=\"color: rgb(53, 64, 82); font-family: Poppins;\"><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">- Giới Thiệu : Tôi thân làm Quân Trưởng, bởi vì một bất ngờ xuyên không tới Khung Linh Đại Lục. Sau khi mở mắt, phát hiện bản thân đã trở thành Quận Chúa phế vật duy nhất không có Linh Lực trên Đại Lục, vô duyên vô cớ còn gặp phải ám sát. Đối này, tôi chỉ muốn nói...các ngươi gây nhầm người rồi ! Lão nương ký kết hệ thống chân trước , chân sau thức tỉnh linh lực đỉnh cấp , mang hỏa tiễn đồng đến trước mặt tên khốn liền đến nơi bọn sát nhân thực sự , quấy nhiễu hắn ta trời phen đất đổ ! Duy nhất chính là đã quá nhiều người đản đông vừa ý Lão Nương rồi , có thể không thể xếp hàng đem hiệu, ân?</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\"><br></p>', 0, '6887', 0, 0, 0, 0, 'Quân Hoả Nữ Hoàng - TruyenHayTV', '❶❶✅ Đọc truyện tranh Quân Hoả Nữ Hoàng miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '18', 0, '', 0, 0, '', '', '', 0, 1630331451, 1630331646, 0, 0, 30),
(397, 283, 'Sự Trở Lại Của Nữ Hiệp Sĩ', '', '5,9,11,34', 'su-tro-lai-cua-nu-hiep-si', '', '', 'https://i.imgur.com/WZajeLy.jpg', '<span id=\"docs-internal-guid-c495a79b-7fff-efab-9932-e4b79bc1799b\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:10pt;\"><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Elena, người đã dành cả cuộc đời của cô ấy để trở thành một kị sỹ máu lạnh với mục đích trả thù cho gia tộc mình, cuối cùng cô kết thúc cuộc đợi mình trước khi có thể làm được điều đó.Khi mở mắt ra cô ấy nhận ra mình đã quay về quá khứ.Vào ban ngày, cô ấy là một quý tiểu thư trang nhã, vào ban đêm cô ấy vung kiếm lên để thay đổi lịch sử và giúp gia đình mình tránh khỏi sự diệt vong. «&nbsp;Tôi muốn kết hôn với ngài, điện hạ&nbsp;». Cô ấy phải làm những gì có thể để cứu gia tộc mình.</span></p><div><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></div></span>', 0, '14962', 0, 0, 0, 0, 'Sự Trở Lại Của Nữ Hiệp Sĩ - TruyenHayTV', '❶❶✅ Đọc truyện tranh Sự Trở Lại Của Nữ Hiệp Sĩ miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '9', 0, '', 0, 0, '', '', '', 0, 1630331452, 1630331637, 0, 0, 30),
