(413, 50, 'Ý nghĩa của em', '', '5,9,14', 'y-nghia-cua-em', '', '', 'https://i.imgur.com/7yPecbj.jpg', 'Cảm thấy vô vọng trong một xã hội lạnh lùng, tôi đến một chiều không gian khác, Đế chế Altius!&nbsp; Đó là kỳ tích đầu tiên sau 32 năm và tôi không thể làm gì để đáp ứng kỳ vọng của công dân Đế chế.&nbsp; Không có gì khác biệt trên thế giới này.&nbsp; Cách đối xử lạnh nhạt không khác gì thế giới trước đây.&nbsp; Sau một loạt những thất vọng ập đến, những gì đến sau đó là sự mệt mỏi và uể oải.&nbsp; Tôi không muốn làm bất cứ điều gì.&nbsp; Tôi không làm bất cứ điều gì nhưng tôi không muốn làm bất cứ điều gì mạnh mẽ hơn.&nbsp; Mặc dù vậy… .. “Bạn đã làm gì cả ngày hôm nay?”&nbsp; Anh ta đến đây để chỉ trích gan ruột của tôi với những nhận xét khó nghe?&nbsp; Một kẻ đánh bom ngôn ngữ với 10000 cấp độ xúc phạm tâm thần, Hoàng đế Mikhail Dnar Altius.&nbsp; Tại sao anh ấy đến phòng tôi mỗi ngày với vẻ mặt tươi tắn?&nbsp; Sự quen thuộc này là gì?&nbsp; Xin lỗi, nhưng mẹ có phải là mẹ của con không?&nbsp; Ha, tôi không thích Hoàng đế.', 0, '1080', 0, 0, 0, 0, 'Ý nghĩa của em - TruyenHayTV', '❶❶✅ Đọc truyện tranh Ý nghĩa của em miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '3', 0, '', 0, 0, '', '', '', 0, 1630331452, 1630331647, 0, 0, 30),
(415, 283, 'Lily Độc Ác', '', '5,9,16,34', 'lily-doc-ac', '', '', 'https://i.imgur.com/nWH4N7D.jpg', '<p class=\"MsoNormal\"><span lang=\"FR\" style=\"font-size:14.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Thánh nữ của Đế chế Thánh Serife, Lily\r\nStella. Nàng là một sự tồn tại thần thánh mà không một ai dám xâm phạm. Nhưng\r\nvào một ngày, nàng không còn nghe thấy giọng nói của Thần linh nữa, và Đế chế\r\nThánh Serife đi đến sự diệt vong. Lily Stella, bị quân địch ném xuống một cái\r\ngiếng, nàng buông lời nguyền rủa Vị thần của Serife người mà nàng đã phục vụ tận\r\ntâm trong cả cuộc đời nàng. «&nbsp;Serife. Nếu ngài còn nghe thấy tiếng khóc của\r\ncon, hãy ban cho con một cơ hội khác. Nhưng nếu con chết như thế này và quay trở\r\nlại với vòng tay của ngài, con…&nbsp;»&nbsp; «&nbsp;Con sẽ xé ngài ra thành nhiều\r\nmảnh và ăn tươi nuốt sống ngài&nbsp;». Khi nàng mở mắt ra, không hiểu chuyện gì\r\nđã xảy ra, nàng đã từng là thiếu nữ Lily Stella 17 tuổi. Giờ nàng đã quay trở lại\r\nthành một đứa trẻ 6 tuổi…Nàng rũ bỏ tất cả sự ngây thơ thánh thiện của một\r\nThánh nữ. Nàng thà trở thành một người như phù thủy và chỉ sống vì bản thân\r\nmình.<o:p></o:p></span></p>', 0, '5341', 0, 0, 0, 0, 'Lily Độc Ác - TruyenHayTV', '❶❶✅ Đọc truyện tranh Lily Độc Ác miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '7', 0, '', 0, 0, '', '', '', 0, 1630331452, 1630331636, 0, 0, 30),
