(417, 370, 'Công Chúa Truyền Tin', '', '5,9,10,11,16,18', 'cong-chua-truyen-tin', '', '', 'https://i.imgur.com/Xvd1TNr.jpg', '<div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\">Gerine - công chúa thứ 8 của vương quốc Raymond đã trốn thoát khỏi đất nước đang loạn lạc trong chiến tranh. Chuyện gì đã xảy ra khi cô ấy mở mắt ra, phát hiện mình không còn là công chúa mà đã biến thành một con chim?</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\">“Cúc cu cúc cu”</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\">Sao lại như vậy? Tại sao lại là tiếng của thú vật!</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\">Còn nữa, tại sao nhất định phải biến thành con chim truyền tin của Valhail - vị tổng chỉ huy máu lạnh.</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\">Vì đất nước này và vì để tìm lại cơ thể, công chúa đã bắt đầu hành trình của mình, nhưng liên tục vướng phải tổng chỉ huy - người cô muốn tránh né. Liệu đó là tín hiệu cảnh báo cho cuộc đời của cô công chúa luôn muốn sự yên bình và ổn định?</div><div dir=\"auto\" style=\"font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px; white-space: pre-wrap;\">Dù là người hay chim, cuộc sống thực sự đều quá khó khăn.</div>', 0, '104875', 0, 0, 0, 0, 'Công Chúa Truyền 