(434, 283, 'Thái Tử Phi Dị Giới', '', '5,8,14,18,21,34', 'thai-tu-phi-di-gioi', '', '', 'https://i.imgur.com/A56uQIQ.jpg', '<span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap; background-color: rgb(228, 230, 235);\">Thiếu nữ Taekwondo lạc vào thế giới kỳ lạ, lại trở thành bảo bối trong tay hai vị hoàng tử?\r\nKim Tử Tình Phi từ nhỏ đã quyết tâm trở thành tuyển thủ Taekwondo ưu tú nhất, nhưng tạo hóa trêu ngươi, cô vừa mới thực hiện được ước mơ đã bất ngờ xuyên đến thế giới đế quốc kỳ lạ. Ở nơi này cô gặp được Hoàng thái tử đẹp trai tính tình hà khắc, ân nhân cứu mạng Đại Công điện hạ, còn có công chúa nhỏ đáng yêu nữa. Vậy sau đó, chỉ là một người bình thường mang danh Tử Tình Phi, thân phận này rốt cuộc có những bí mật gì? Tại sao cô lại xuyên đến nơi này, liệu cô có thể quay trở lại thế giới hiện tại hay không đây?</span>', 0, '433', 0, 0, 0, 0, 'Thái Tử Phi Dị Giới - TruyenHayTV', '❶❶✅ Đọc truyện tranh Thái Tử Phi Dị Giới miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331453, 1630331640, 0, 0, 30),
(435, 314, 'Hoa quế rơi', '', '5,11,14,34', 'hoa-que-roi', '', '', 'https://i.imgur.com/FjQO9eu.jpg', '<p><font face=\"Arial\" style=\"\"><span style=\"font-size: 15px; white-space: pre-wrap; background-color: rgb(255, 255, 255);\">Hoa quể rơi</span></font></p><p><font style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-size: 15px; white-space: pre-wrap; font-family: Arial;\">Tác giả: Nhị Bát Dĩ (</span><span style=\"font-size: 15px; white-space: pre-wrap; font-family: Arial;\">樲八已)</span></font></p><font face=\"Arial\" style=\"\"><span style=\"font-size: 15px; white-space: pre-wrap; background-color: rgb(255, 255, 255);\">Tóm tắt:\r\n[ Bản gốc kế hoạch KK, đang chuẩn bị] Ở hiện đại, biên kịch coi trọng tự do, bình đẳng, tôn trọng lại cố tình xuyên qua Thiên Loan Quốc, nơi cực kì coi trọng lễ nghi, thân phận. Thân là Trắc phi, lại đi thích 1 thị vệ bên cạnh Vương gia. Từ cái ưa thích này lại từ từ biến thành 1 loại tình cảnh không cho phép xảy ra. Vậy, kết cục sẽ xảy ra như thế nào đây….</span></font>', 0, '1790', 0, 0, 0, 0, 'Hoa quế rơi - TruyenHayTV', '❶❶✅ Đọc truyện tranh Hoa quế rơi miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '5', 0, '', 0, 0, '', '', '', 0, 1630331453, 1630331860, 0, 0, 30),
(436, 369, 'Chọn papa trong số những tên bạo chúa', '', '5,9,10,14', 'chon-papa-trong-so-nhung-ten-bao-chua', '', '', 'https://i.imgur.com/cB6D575.jpg', 'Tiến sĩ Jaehee Cheon, cô mất cha mẹ từ khi còn nhỏ và không thể nhớ mặt họ, cô sống mà không có một người bạn nào, nói gì đến người yêu. Sau khi chết, cô tái sinh thành nàng công chúa xui xẻo trong một cuốn tiểu thuyết, người mà chết ở tuổi mười hai!&nbsp;<div>Nếu chúng ta không thể tìm thấy cha ruột của công chúa, cô ấy sẽ chết. Nhưng hình như đã có bốn ứng cử viên rồi ??? Nhưng vấn đề lớn hơn nữa là họ quá độc ác ....&nbsp;</div><div>Liệu Chun Jae-hee có thể tìm thấy người cha thực sự của mình một cách an toàn và có một kết thúc có hậu?</div><div>VIỆT HOÁ BỞI PHIÊU NGUYỆT TEAM</div>', 0, '1286', 0, 0, 0, 0, 'Chọn papa trong số những tên bạo chúa - TruyenHayTV', '❶❶✅ Đọc truyện tranh Chọn papa trong số những tên bạo chúa miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331453, 1630331645, 0, 0, 30),
(437, 369, 'Thuần hoá quý cô', '', '5,9,10,14', 'thuan-hoa-quy-co', '', '', 'https://i.imgur.com/8Yyl4U2.jpg', 'Khi tôi thức dậy và trở thành là con gái của đại công tước trong một cuốn tiểu thuyết - cùng thế giới với Raon, nhân vật yêu thích của tôi. Đây có phải là phép màu mà Chúa ban cho tôi - một người hâm mộ không! Nhưng trên tất cả, tôi sẽ trở thành Istina, là nhân vật phản diện luôn gây rắc rối cho Raon. Raon vô cùng kinh tởm khi nhìn thấy Istina. Tuy nhiên, tôi vẫn kiên trì đi theo anh ta, hy vọng có thể trở nên thân thiết với Raon hơn. \"Này, Raon!\" \"Tránh xa ta ra.\" “Nhưng tôi thậm chí còn chưa nói điều gì mà…” “Ta biết chính xác những gì mà ta không thích.” Lúc đầu, anh ấy hoàn toàn phớt lờ tôi, nhưng bây giờ, anh ấy đã khoan dung với tôi hơn tuy là có một chút, phải không nhỉ? Nhưng tôi sẽ tiếp tục là một người hâm mộ của anh. Hãy cố gắng nào!', 0, '154', 0, 0, 0, 0, 'Thuần hoá quý cô - TruyenHayTV', '❶❶✅ Đọc truyện tranh Thuần hoá quý cô miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331454, 1630331660, 0, 0, 30),
(438, 369, 'Bí mật của công tước thân thiện', '', '5,9,23', 'bi-mat-cua-cong-tuoc-than-thien', '', '', 'https://i.imgur.com/2RHxpm9.jpg', 'Noelle Miceria là con gái nuôi của một gia đình quý tộc nhưng lại bị mọi người trong gia đình đó ngược đãi. <div>Một ngày nọ, Noelle tình cờ nghe được kế hoạch động trời của cha cô. Tối hôm đó, cô cầu xin sự giúp đỡ từ một một người bạn của mình, Zion, người mà đã ghé thăm gia đình cô.</div><div>Khi cô biết được mọi chuyện thì người nhà cô đã bị giết tất cả. Thủ phạm chính là Zion, hóa ra anh ta biết sử dụng ma thuật.</div><div>“Cô nghĩ sao, Noelle?”</div><div>Zion đưa ra lời đề nghị rằng chỉ cần cô làm việc cho anh ta, cô sẽ đổi đời. Kể từ ngày hôm đó, Noelle bắt đầu sống trong dinh thự của Zion và làm việc với chức vụ thư ký hoàng gia.</div><div>Gửi đến các bạn độc giả, công tước, và phù thủy, đều cùng là cách gọi một người, Zion nhưng liệu Noelle có thực sự biết con người của Zion?</div><div>Câu chuyện tình yêu giả tưởng mà có lẽ các bạn chưa đọc qua bao giờ.&nbsp;</div>', 0, '854', 0, 0, 0, 0, 'Bí mật của công tước thân thiện - TruyenHayTV', '❶❶✅ Đọc truyện tranh Bí mật của công tước thân thiện miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '17', 0, '', 0, 0, '', '', '', 0, 1630331454, 1630331860, 0, 0, 30),
