(453, 533, 'Kế Hoạch Chinh Phục Công Tước Lạnh Lùng', '', '5,8,10,11,14,16,18,20,34', 'ke-hoach-chinh-phuc-cong-tuoc-lanh-lung', '', '', 'https://i.imgur.com/TaXHWsj.jpg', '<p dir=\"ltr\" id=\"docs-internal-guid-369246f2-7fff-3840-2065-6a3a9e77f991\" style=\"-webkit-tap-highlight-color: rgba(26, 26, 26, 0.3); -webkit-text-size-adjust: auto; line-height: 1.3800000000000001; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap;\">Chẳng qua chỉ là một điều ước vào ngày 25 tuổi, vậy mà tỉnh dậy lại trở thành Công chúa cầu thân với Huyết tộc. Không những vậy những anh chàng soái ca trước mặt thế mà đều nói mình là vị hôn phu của cô ấy?&nbsp;</span></p><p dir=\"ltr\" style=\"-webkit-tap-highlight-color: rgba(26, 26, 26, 0.3); -webkit-text-size-adjust: auto; line-height: 1.3800000000000001; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap;\">Rối như vậy thì nên chọn ai mới tốt đây?</span></p><p dir=\"ltr\" style=\"-webkit-tap-highlight-color: rgba(26, 26, 26, 0.3); -webkit-text-size-adjust: auto; line-height: 1.3800000000000001; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap;\">Chỉ có trẻ con mới lựa chọn, mà Hồ La Bối tôi/ta đây muốn chọn tất! Hãy cùng đón đọc hành trình của thiếu nữ 25 mùa xuân xanh, xuyên không đến vương quốc của ma cà rồng, trở thành nữ vương Huyết tộc và một dàn “harem” soái ca như thế nào nhé!</span></p>', 0, '3723', 0, 0, 0, 0, 'Kế Hoạch Chinh Phục Công Tước Lạnh Lùng - TruyenHayTV', '❶❶✅ Đọc truyện tranh Kế Hoạch Chinh Phục Công Tước Lạnh Lùng miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '7', 0, '', 0, 0, '', '', '', 0, 1630331454, 1630331844, 0, 0, 30),
(454, 533, 'Tuyệt Sắc Nữ Y: Thái Tử Ngài Phải Theo Em', '', '5,8,10,11,14,17,18,34', 'tuyet-sac-nu-y-thai-tu-ngai-phai-theo-em', '', '', 'https://i.imgur.com/MuXRW8N.png', '<p dir=\"ltr\" id=\"docs-internal-guid-983b37c3-7fff-7349-6273-ad6238b3fd0f\" style=\"-webkit-tap-highlight-color: rgba(26, 26, 26, 0.3); -webkit-text-size-adjust: auto; line-height: 1.295; margin-top: 0pt; margin-bottom: 8pt;\"><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; vertical-align: baseline; white-space: pre-wrap;\">Nữ bác sĩ ở hiện đại bị tai nạn xe ô tô, một người xinh đẹp cũng đã biến mất. Cô xuyên không về thời cổ đại&nbsp; và trở thành tên ăn mày. Sau đó liền bị bắt về kĩ viện, nhưng vô tình lại biết được chủ của kĩ viện mà cô bị bắt về thế nào lại là Thái Tử đương triều. Nhưng mà vị sư phụ cứu cô lại cấm dục. Vị công tử lạnh lùng kiêu ngạo? Vị sư phụ ấm áp, ngọt ngào, ăn cô sạch sẽ! truyện tranh được chuyển thể từ tiểu thuyết “Phi Tử Thái Y Thiên Hạ”</span></p>', 0, '723', 0, 0, 0, 0, 'Tuyệt Sắc Nữ Y: Thái Tử Ngài Phải Theo Em - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tuyệt Sắc Nữ Y: Thái Tử Ngài Phải Theo Em miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '4', 0, '', 0, 0, '', '', '', 0, 1630331454, 1630331844, 0, 0, 30),
