(457, 370, 'Lí Do Tôi Sống Dưới Thân Phận Ác Nữ', '', '5,9,11,14,18', 'li-do-toi-song-duoi-than-phan-ac-nu', '', '', 'https://i.imgur.com/KJJPeogm.jpg', '<p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">Tôi đã nhập hồn vào thân xác nữ chính - ác nữ trong tiểu thuyết. Dù sao thì, tôi sẽ ở đây cho đến khi nữ chính quay về. Đến lúc đó thì đâu cần cô ta phải cải tà quy chính nữa?</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">Nếu làm vậy có thể tìm thấy con đường sống cho chính mình, vậy thì hãy đảo ngược cốt truyện của cuốn tiểu thuyết nào. Tất nhiên, là theo cách riêng của tôi.</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">“Bây giờ cô định ăn uống một cách vô phép như vậy sao?” Lessian nhẹ nhàng nói.</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">\"Cổ nhân đã có câu, lời nói chẳng mất tiền mua, lựa lời mà nói cho vừa lòng nhau. Tôi nghe nói khi ăn cơm mà mặc đồ ngủ là vô phép, nhưng có vẻ như Hầu tước cũng đang đối xử không mấy lịch thiệp với con gái mình thì phải.”</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">Hầu tước nghe xong câu đó, liền nổi giận đùng đùng và hét lên.</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">“ngươi điên rồi sao!\"</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">“Đúng vậy, tôi đang điên đây.”</p><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">Dù sao cũng nhập vào xác của một ác nữ rồi, có điên hay không, cũng đâu phải việc gì to tát.</p>', 0, '75116', 0, 0, 0, 0, 'Lí Do Tôi Sống Dưới Thân Phận Ác Nữ - TruyenHayTV', '❶❶✅ Đọc truyện tranh Lí Do Tôi Sống Dưới Thân Phận Ác Nữ miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '32', 0, '', 0, 0, '', '', '', 0, 1630331454, 1630331855, 0, 0, 30),
(458, 370, 'Đế Vương Này Khắc Vợ, Đắc Bàn', '', '5,8,11,14,18,21,34', 'de-vuong-nay-khac-vo-dac-ban', '', '', 'https://i.imgur.com/CiZzdv2m.jpg', 'Vào thế kỉ 21, một thiên tài giỏi về việc xem phong thủy, trọng sinh vào cơ thể của một người vô dụng ở Thương Huyền Đại Lục. Nguyên chủ đã không giỏi còn xấu, người cha bỏ vợ sủng thiếp, mẹ ruột bị vu cáo tư thông nên bị đuổi ra khỏi nhà, anh em ruột lại gặp phải bà mẹ kế nham hiểm độc ác, vị hôn phu cấu kết với con của mẹ kế hại nguyên chủ chết thảm. Sau khi Tiêu Linh Vân trọng sinh, lợi dụng bí thuật phong thủy để vả vào mặt những người đã từng chế giễu lăng nhục cô, tu vi đạt đến đỉnh phong, phi thăng lên tiên giới.', 0, '114784', 0, 0, 0, 0, 'Đế Vương Này Khắc Vợ, Đắc Bàn - TruyenHayTV', '❶❶✅ Đọc truyện tranh Đế Vương Này Khắc Vợ, Đắc Bàn miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '36', 0, '', 0, 0, '', '', '', 0, 1630331454, 1630331848, 0, 0, 30),
