(469, 370, 'Dàn Trai Đẹp Chốn Hậu Cung - SCT', '', '9,11,18,34', 'dan-trai-dep-chon-hau-cung-sct', '', '', 'https://i.imgur.com/jxp3ciMm.jpg', '<p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">“Tại sao ta lại chỉ được kết hôn với 1 người đàn ông?” Nữ hoàng phản đối.</p><br style=\"color: rgb(53, 64, 82); font-family: Poppins;\"><p class=\"content-player-review\" style=\"margin-bottom: 0px; -webkit-font-smoothing: antialiased; font-family: Poppins; line-height: 1.5; font-stretch: normal; color: rgb(53, 64, 82);\">\"Ở các thế hệ trước, 1 hoàng đế có ít nhất 5 phi tần và trung bình là 15. Giờ ta đã là Hoàng đế, ta cũng nên có ít nhất 5 người chứ. Con trai của Tể tướng? Người thừa kế của một gia đình quyền lực? Nếu ta thấy thích thì mau đưa người đó hậu cung đi. Người mà ta thích nhất sẽ trở thành hoàng hậu của ta”.</p>', 0, '3266', 0, 0, 0, 0, 'Dàn Trai Đẹp Chốn Hậu Cung - SCT - TruyenHayTV', '❶❶✅ Đọc truyện tranh Dàn Trai Đẹp Chốn Hậu Cung - SCT miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '9', 0, '', 0, 0, '', '', '', 0, 1630331455, 1630331673, 0, 0, 30);
