(470, 370, 'Elizabeth', '', '5,9,18', 'elizabeth', '', '', 'https://i.imgur.com/z9qhGStm.jpg', '<div>Chuyện kể về một cô gái nổi tiếng là xinh đẹp nhất trong vùng – Elizabeth, ngày ngày cô bán dâu tây hái được trong khu rừng Cấm và luôn phải sống trong nỗi lo sợ, bất an. Một ngày nọ, một vị công tước đang rất gấp gáp chuyện kết hôn đột nhiên xuất hiện.</div><div>“Ở đây mọi người thường gọi ta là công tước Karl Luke. Ta tên là Martius, ta không có họ.”</div><div>“Ồ, ngài cởi y phục ra làm gì vậy?”</div><div>Chắc hẳn đây là một công tước rất tài giỏi, nhưng có điểm gì đó hơi bất thường.</div><div>Hơn nữa, vào lần đầu tiên gặp mặt, không phải là lời cầu hôn, mà là câu hỏi “cô có thể theo ta về làm thị nữ được không?” sao!</div><div>“Dinh thự của ta đang rất cần thị nữ, Elizabeth à. Đó là dinh thự của một lãnh chúa đã có tuổi, nhưng ở đó lại không có thị nữ nào ở bên cạnh chăm sóc cho ngài ấy.”</div><div>“Ta đến đây chỉ có một mục đích duy nhất, đó là tìm thị nữ cho dinh thự”</div><div>“Chăm sóc vào ban đêm sao! Tuyệt đối không được! Tôi không thể đồng ý!”</div><div>Một câu chuyện giả tưởng lãng mạn nhưng cũng đầy những hiểu lầm giữa một công tước trực nam đơn thuần và một tiểu thư vùng ngoại ô có nội tâm phức tạp!</div>', 0, '7936', 0, 0, 0, 0, 'Elizabeth - TruyenHayTV', '❶❶✅ Đọc truyện tranh Elizabeth miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '27', 0, '', 0, 0, '', '', '', 0, 1630331455, 1630331815, 0, 0, 30),
