(488, 291, 'Phù Thủy Hạng Bét', '', '5,8,15,16,17,18', 'phu-thuy-hang-bet', '', '', 'https://i.imgur.com/XB0UhkBm.jpg', '<p><b style=\"font-weight:normal;\" id=\"docs-internal-guid-a44f0ea5-7fff-9a0e-24ca-147e41be4ea8\"><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bạn có từng bị người khác cười nhạo ước mơ của mình không? Ma pháp là thứ mọi người ở thế giới này đều hướng tới, nhưng Đồng Ân.Hill từ trước tới nay chưa từng tiếp xúc với ma pháp lại thi vào Học viện Ma pháp quyền uy nhất năm châu, cô tràn đầy khát khao, nhưng lại bị nhà trường đánh giá là \"học sinh kém nhất\" trước nay chưa từng có, đối mặt với cười nhạo, chê bai, bài xích, phù thuỷ nhỏ quật cường có thể nghịch tập (lật ngược tình thế) được không?</span></p></b><br class=\"Apple-interchange-newline\"><br></p>', 0, '36140', 0, 0, 0, 0, 'Phù Thủy Hạng Bét - TruyenHayTV', '❶❶✅ Đọc truyện tranh Phù Thủy Hạng Bét miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '35', 0, '', 0, 0, '', '', '', 0, 1630331456, 1630331855, 0, 0, 30),
