(512, 17597, 'Đừng Bận Tâm Đến Cuốn Sách Đó', '', '5,9,34', 'dung-ban-tam-den-cuon-sach-do', '', '', 'https://i.imgur.com/NSLMdpXm.jpg', '<span id=\"docs-internal-guid-1087409b-7fff-73b1-961a-8614e6899c9b\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Sống vì một mục đích duy nhất là trốn thoát. “Ánh sáng của Rusbella” là một cuốn tiểu thuyết bi kịch lãng mạn.Với mong muốn có một cuộc sống mới, Ashley Roseé đã được tái sinh trở thành người con thứ 8 của Hoàng đế Estrian. Cô tưởng rằng mình sinh ra đã được ngậm thìa vàng, nhưng thực chất đó chỉ là một chiếc thìa mạ vàng?&nbsp; Khi nhận ra rằng không có gì ngoài đống đổ nát đang chờ đợi mình, cô tìm thấy một cuốn nhật ký báo trước tương lai… Nó báo trước cái chết của Ashley dưới bàn tay của Thái tử, Castor!&nbsp; [\"Đế chế này có ý nghĩa gì với ngươi?\"&nbsp; Sau khi hỏi điều này, Thái tử cười rất đẹp.&nbsp; Và sau đó anh ta giết tôi.] Thật không may, Ashley tiếp tục sống lại, và tiếp tục bị giết hết lần này đến lần khác.&nbsp; Khi tiếp tục hồi tưởng lại những cái chết của mình, cô dần mất đi nụ cười và thay đổi.&nbsp; … Hãy cố gắng sống sót trước.</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">_____________________________________________________________________________</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> \"Tôi có thể làm gì cho anh trai mình?\"&nbsp; \"Tốt.\"&nbsp; Mái tóc màu xanh tung bay trong gió.&nbsp; Anh cười yếu ớt, trước khi hé đôi môi khô khốc.&nbsp; \"Gọi tên ta .\"&nbsp; “…” Đầu tôi nhanh chóng quay cuồng.&nbsp; “Gọi ta Amor.”&nbsp; Đầu ngón tay anh lướt dọc theo cổ tay trong của tôi.&nbsp; _____________________________________________________________________________</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Lưu ý: Đây là&nbsp; manhwa oneshot quảng cáo cho tiểu thuyết cùng tên.</span></p><div><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></div></span>', 0, '2746', 0, 0, 0, 0, 'Đừng Bận Tâm Đến Cuốn Sách Đó - TruyenHayTV', '❶❶✅ Đọc truyện tranh Đừng Bận Tâm Đến Cuốn Sách Đó miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '9', 0, '', 0, 0, '', '', '', 0, 1630331457, 1630331790, 0, 0, 30),
