(517, 17597, 'Tôi Đã Nhận Lời Cầu Hôn Từ Kẻ Phản Diện', '', '5,9,34', 'toi-da-nhan-loi-cau-hon-tu-ke-phan-dien', '', '', 'https://i.imgur.com/j0V0kZbm.jpg', '<span id=\"docs-internal-guid-73ca599a-7fff-3438-ebad-0c8e61e13258\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Tôi nhìn thấy kẻ phản diện đang giết người. Không những thế, tôi còn bị hắn phát hiện. Cuộc đời tôi hình như sắp đi vào ngõ cụt mất rồi.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Hắn tiến lại gần và ôm chầm lấy tôi. Trong tay hắn là gì nhỉ? Kiếm? Hay súng? Mà có là gì thì cũng đâu quan trọng. Bởi tôi chắc chắn rằng.</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">“Mình sắp tiêu đời rồi.”</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Nhưng hắn lại thốt lên “Hãy kết hôn với ta đi.”</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">“Hả?”</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Là một chiếc nhẫn. Mà viên kim cương còn rất lớn nữa. Chuyện gì vậy trời.</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">“Sao ngài công tước…... lại nói vậy với tôi……?</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;“Thử yêu xem nào.”</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Đó là ánh mắt của người đang yêu sao? Là ánh mắt của một tên sát nhân đang muốn lấy mạng tôi thì đúng hơn!&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Hắn chẳng quan tâm tôi đang thấy oan ức mà chỉ nở nụ cười.</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">“Dù gì thì nó cũng tốt hơn là phải chết đi mà, tiểu thư. Chúng ta kết hôn đi.”</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Cuộc hôn nhân không chút hơi ấm tình yêu (?) của cô và hắn bắt đầu!</span></p><div><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></div></span>', 0, '3777', 0, 0, 0, 0, 'Tôi Đã Nhận Lời Cầu Hôn Từ Kẻ Phản Diện - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tôi Đã Nhận Lời Cầu Hôn Từ Kẻ Phản Diện miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '7', 0, '', 0, 0, '', '', '', 0, 1630331457, 1630331833, 0, 0, 30),
(518, 17597, 'Cách Tạo Ra Một Công Chúa', '', '5,8,11,34', 'cach-tao-ra-mot-cong-chua', '', '', 'https://i.imgur.com/Fbj6lUdm.jpg', '<span id=\"docs-internal-guid-fcd3066d-7fff-431b-fd5a-7e08f9790d56\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:12pt;margin-bottom:12pt;\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Một ngày nọ, Sophia - nàng công chúa kiêu kì của Tây quốc, bỗng trở thành một người hầu thấp kém. Không những bị chà đạp và làm nhục, cô ấy còn phải đối mặt với những chuyện khủng khiếp hơn thế nữa. Nhưng bằng tài năng và trí thông minh của mình, cô ấy đã vượt qua được rất nhiều khó khăn, thử thách. Liệu cô ấy có thể lấy lại được tất cả mọi thứ... và đạt được nhiều hơn thế?</span></p><div><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></div></span>', 0, '8318', 0, 0, 0, 0, 'Cách Tạo Ra Một Công Chúa - TruyenHayTV', '❶❶✅ Đọc truyện tranh Cách Tạo Ra Một Công Chúa miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '23', 0, '', 0, 0, '', '', '', 0, 1630331457, 1630331824, 0, 0, 30),
