(520, 293, 'Giam Cầm Tuyệt Đối', '', '8,12,14,21,31', 'giam-cam-tuyet-doi', '', '', 'https://i.imgur.com/6c28PGNm.jpg', '<p>Tổng giám đốc lạnh lùng mắc “bệnh vô cảm”, bị ép xuyên không vào thế giới truyện tranh: Ác ma và nô lệ, Quỷ hút máu và Thần Phụ...</p><p>HE hay BE? Cốt truyện ngược tâm và kỳ ảo sẽ hoàn toàn đánh thức những ràng buộc của kiếp trước và kiếp này!—“Bất luận là thân phận gì, ngươi đều được sẵn là tù binh của ta, một cách tuyệt đối❤️.”</p>', 0, '6536', 0, 0, 0, 0, 'Giam Cầm Tuyệt Đối - TruyenHayTV', '❶❶✅ Đọc truyện tranh Giam Cầm Tuyệt Đối miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '14', 0, '', 0, 0, '', '', '', 0, 1630331457, 1630331854, 0, 0, 30),
(521, 17864, 'Đơn Ly Hôn', '', '5,8,12,18,21,31', 'don-ly-hon', '', '', 'https://i.imgur.com/fLPTdXlm.png', '<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; background-color: rgb(36, 37, 38);\"><div dir=\"auto\" style=\"font-family: inherit;\">Tinh cầu Hách Lạp năm 4443 sau Công Nguyên, trong mối quan hệ thân mật bị đối xử lạnh nhạt lại từng trải qua thất bại, Trình Cẩn cuối cùng cũng quyết định buông tay. Nhưng mà lúc này người yêu lại bỗng nhiên mất trí nhơ, đồng thời yêu cậu. Trình Cẩn vừa vui mừng, vừa vô cùng đau khổ, bởi vì cậu luôn thấp thỏm chờ đợi, “kỳ hạn” sẽ đến của tình yêu này</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; background-color: rgb(36, 37, 38);\"><div dir=\"auto\" style=\"font-family: inherit;\">Năm 4443 sau Công Nguyên Hành tinh Hera, bị đối xử lạnh nhạt trong mối quan hệ thân mật lại trải qua phá sản, Trình Cẩn cuối cùng quyết định buông tay. Nhưng lúc này người trong lòng lại như định mệnh đột nhiên mất trí nhớ, lại yêu cậu. Trình Cẩn vừa trộm vui mừng, vừa vô cùng đau khổ, bởi vì cậu luôn thấp thỏm chờ đợi, “kỳ hạn” của tình yêu này. </div></div>', 0, '12266', 0, 0, 0, 0, 'Đơn Ly Hôn - TruyenHayTV', '❶❶✅ Đọc truyện tranh Đơn Ly Hôn miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331458, 1630331761, 0, 0, 30),
(522, 293, 'Khu Chung Cư Của Các Ảnh Đế', '', '8,12,18,31', 'khu-chung-cu-cua-cac-anh-de', '', '', 'https://i.imgur.com/wCauJ4Rm.jpg', '<p>Một vụ thảm án xảy ra do cảnh giường chiếu. Thanh niên tốt đẹp - Thẩm Triệt đơn thuần ấm áp như ánh mặt trời, vì một cảnh giường chiếu mà kết duyên với nam vương giảng đường - Tần Tu lạnh lùng hung hãn, vừa kiêu ngạo lại độc miệng, bụng dạ đen tối lại còn tâm thần phân liệt. Kể từ đó đã bắt đầu lịch sử phấn đấu cười ra nước mắt từ học viện điện ảnh đến giới giải trí của thiên vương và ảnh đế tương lai! Câu chuyện này dạy chúng ta rằng: một lúc ham mê sắc đẹp, một đời không thẳng được lưng! Phụ nữ đẹp không thể yêu, đàn ông đẹp không thể tổn thương, tiểu công đẹp cao cao tại thượng tuyệt đối không thể đắc tội!</p>', 0, '8074', 0, 0, 0, 0, 'Khu Chung Cư Của Các Ảnh Đế - TruyenHayTV', '❶❶✅ Đọc truyện tranh Khu Chung Cư Của Các Ảnh Đế miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '58', 0, '', 0, 0, '', '', '', 0, 1630331458, 1630331837, 0, 0, 30),
(524, 293, 'Cách Cua Cục Cưng Thiên Sứ', '', '8,21', 'cach-cua-cuc-cung-thien-su', '', '', 'https://i.imgur.com/gApABGPm.jpg', '<p>Chuyện gì sẽ xảy ra khi thiên thần và ác quỷ chạm mặt nhau? Ân oán nhiều đời giữa ma cà rồng và người sói là gì? Làm sao người cá và tinh linh có thể yêu nhau? Trên đại lục to lớn nơi mọi loài cùng chung sống, tất cả các cung bậc tình cảm đều có thể xảy ra!</p>', 0, '62851', 0, 0, 0, 0, 'Cách Cua Cục Cưng Thiên Sứ - TruyenHayTV', '❶❶✅ Đọc truyện tranh Cách Cua Cục Cưng Thiên Sứ miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '23', 0, '', 0, 0, '', '', '', 0, 1630331458, 1630331854, 0, 0, 30),
(525, 293, 'Không Phải Tôi Muốn Giả Gái', '', '5,8,20', 'khong-phai-toi-muon-gia-gai', '', '', 'https://i.imgur.com/LyyNC8rm.jpg', '<p>Vì tiền lương gấp ba lần mà trai thẳng Lâm Tử Tranh bỏ xuống gánh nặng tư tưởng, mặc đồ nữ đi làm. Không ngờ, tổng tài Cố Phảng trước giờ không thích phụ nữ vậy mà lại yêu Lâm Tử Tranh bản nữ ngay từ cái nhìn đầu tiên?! Không phải nghe đồn là tổng tài không gần nữ sắc à, tính hướng đổi rồi sao? “Tổng tài, tiết tháo của anh đâu?!”</p>', 0, '14525', 0, 0, 0, 0, 'Không Phải Tôi Muốn Giả Gái - TruyenHayTV', '❶❶✅ Đọc truyện tranh Không Phải Tôi Muốn Giả Gái miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '74', 0, '', 0, 0, '', '', '', 0, 1630331458, 1630331857, 0, 0, 30),
(526, 293, 'Chim Hoàng Yến Bị Chính Mình Trói Buộc', '', '5,8,14,18', 'chim-hoang-yen-bi-chinh-minh-troi-buoc', '', '', 'https://i.imgur.com/bkG2pIWm.jpg', '<p>Đây là một câu chuyện về “Tôi của tương lai” tái sinh thành người khác gặp được “Tôi của quá khứ”. Tần Việt Phương sau khi gặp tai nạn xe đã sống lại, nhưng mà sống lại trong cơ thể tên “Phương Dạ Âm”. Phương Dạ Âm lại tình cờ gặp được mình lúc trẻ! Cũng bị Tần Việt Phương ép buộc ở bên cạnh trở thành vật sở hữu của hắn… Phương Dạ Âm muốn tìm ra chân tướng của việc xuyên qua, cũng muốn thoát khỏi tên Tần Việt Phương biến thái này! Nhưng sự việc sẽ diễn ra thuận lợi sao….?</p>', 0, '582792', 0, 0, 0, 0, 'Chim Hoàng Yến Bị Chính Mình Trói Buộc - TruyenHayTV', '❶❶✅ Đọc truyện tranh Chim Hoàng Yến Bị Chính Mình Trói Buộc miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '73', 0, '', 0, 0, '', '', '', 0, 1630331458, 1630331848, 0, 0, 30),
(527, 293, 'Bố Vợ Đại Nhân Là Bà Xã', '', '5,8,18,21', 'bo-vo-dai-nhan-la-ba-xa', '', '', 'https://i.imgur.com/gLFW6jqm.jpg', '<p>Tại sao rõ ràng là khi lấy về là một cô vợ đáng yêu, tới lúc cùng giường chung gối lại là ông bố vợ mặt lạnh?!!. Bác sĩ nha khoa trai thẳng ngốc nghếch với bố vợ tổng tài bá đạo ngạo kiều, sự cố ở chung liên tục tăng lên, nhưng chấn tướng không chỉ đơn giản là chuyện biến thân huyển áo mà còn là quá khứ bí mật không ai biết đến.</p>', 0, '46856', 0, 0, 0, 0, 'Bố Vợ Đại Nhân Là Bà Xã - TruyenHayTV', '❶❶✅ Đọc truyện tranh Bố Vợ Đại Nhân Là Bà Xã miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '138', 0, '', 0, 0, '', '', '', 0, 1630331458, 1630331858, 0, 0, 30),
(528, 293, 'Đề này Vượt Quá Sức Rồi!', '', '5,8,15', 'de-nay-vuot-qua-suc-roi-', '', '', 'https://i.imgur.com/n4srjTym.jpg', '<p>Ngay từ đầu học tra – Hứa Thịnh và học thần – Thiệu Trạm đã đối chọi với nhau gay gắt, ai mà ngờ được rằng sau vài lần hoán đổi thân xác lại có thể nảy sinh tình cảm với người kia! Trong lúc mơ hồ, mông lung cả hai người không ngừng tiếp cận đối phương, trải qua không ít chuyện dở khóc dở cười, cuối cùng cũng đã hiểu được tâm ý của nhau.</p>', 0, '326056', 0, 0, 0, 0, 'Đề này Vượt Quá Sức Rồi! - TruyenHayTV', '❶❶✅ Đọc truyện tranh Đề này Vượt Quá Sức Rồi! miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '41', 0, '', 0, 0, '', '', '', 0, 1630331458, 1630331861, 0, 0, 30),
(529, 293, 'Sư Phụ Ngươi Tên Ngốc Nhiều Tiền', '', '5,8,18', 'su-phu-nguoi-ten-ngoc-nhieu-tien', '', '', 'https://i.imgur.com/9vfhBwMm.jpg', '<p>Lão sư lập chính kính lễ: Đồ nhi, vào sư môn ta, nhận giáo huấn của ta. Nói cho vi sư, điều thứ nhất trong tổ huấn là gì? Trà sữa kem phô mai: Sư phụ, môn này của chúng ta không phải chỉ có con và người sao, tổ sư ở đâu ra. Lão sư lập chính kính lễ: Nghiệt, nghiệt đồ! Bảo con nói thì con cứ nói! Trà sữa kem phô mai:…….. Đánh chết con rùa Việt Kiến Xuân Hòa kia!!!</p>', 0, '109979', 0, 0, 0, 0, 'Sư Phụ Ngươi Tên Ngốc Nhiều Tiền - TruyenHayTV', '❶❶✅ Đọc truyện tranh Sư Phụ Ngươi Tên Ngốc Nhiều Tiền miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '56', 0, '', 0, 0, '', '', '', 0, 1630331458, 1630331855, 0, 0, 30),
(530, 293, 'Tân Nương Của Ma Thần', '', '8,14,17,31,33', 'tan-nuong-cua-ma-than', '', '', 'https://i.imgur.com/amEKr3Km.jpg', '<p>Kì đại tổng tài xuyên không qua dị giới sau khi bị người khác làm hại, vốn dĩ tưởng bản thân là dũng sĩ cứu thế, cho đến khi bị trang hoàng lộng lẫy đưa lên giường tân hôn, mới nhận ra mình đã trở thành cô dâu của ác quỷ! Ác quỷ chỉ nuông chiều suồng sã với một người và tổng tài dũng sĩ vẻ mặt lạnh lùng nhưng trong lòng vô cùng tự tin, rốt cuộc khi nào họ mới sinh con?!</p>', 0, '145089', 0, 0, 0, 0, 'Tân Nương Của Ma Thần - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tân Nương Của Ma Thần miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '57', 0, '', 0, 0, '', '', '', 0, 1630331458, 1630331854, 0, 0, 30);
