(531, 293, 'Cuộc Thi Toàn Cầu.', '', '8,13,17,19', 'cuoc-thi-toan-cau-', '', '', 'https://i.imgur.com/Bu647sum.jpg', '<span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif;\">Đây là một sân chơi sống còn, vượt qua được kỳ thi, mới có thể sống sót. Người gác thi phúc hắc «Tần Cứu» gặp phải thí sinh lạnh lùng «Du Hoặc», tuy cả hai người đều bị mất trí nhớ, buộc phải phối hợp tìm ra kẽ hở của hệ thống không có tính người này rồi cùng nhau hủy diệt nó, nhưng cả hai lại có vẻ rất ăn ý với nhau. Mỗi một lần hệ thống cảnh báo là mỗi một lần khiến cho hệ thống ngày càng suy yếu, ký ức bị mất đi cũng dần trở nên khôi phục lại, thì ra khi trên thế giới này chỉ còn là chiến trường đẫm máu, anh và tôi vẫn là người quen cũ của nhau. Hệ thống là cái thứ gì, hủy diệt đi càng tốt. Thế giới ngoài kia to lớn rực rỡ, chào mừng trở về nhà.</span>', 0, '129342', 0, 0, 0, 0, 'Cuộc Thi Toàn Cầu. - TruyenHayTV', '❶❶✅ Đọc truyện tranh Cuộc Thi Toàn Cầu. miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '40', 0, '', 0, 0, '', '', '', 0, 1630331458, 1630331806, 0, 0, 30),
(532, 293, 'Thuần Phục', '', '5,8,31', 'thuan-phuc', '', '', 'https://i.imgur.com/sqPmXVRm.jpg', '<span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif;\">Hà Lục có một bí mật không thể cho người khác biết, chính vì thế, mà bị mọi người trong công ty gọi là Nam thần cấm dục. Về sau bị Tống Kỳ ép vào tường, đối phương đỏ mắt chất vấn:” anh còn muốn trốn đi đâu?” buông xuống áo giáp, quân lính tan rã....</span>', 0, '99924', 0, 0, 0, 0, 'Thuần Phục - TruyenHayTV', '❶❶✅ Đọc truyện tranh Thuần Phục miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '83', 0, '', 0, 0, '', '', '', 0, 1630331459, 1630331851, 0, 0, 30),
(533, 291, 'Hướng Đi Không Được Yêu Thích', '', '5,8,15,17,18,34', 'huong-di-khong-duoc-yeu-thich', '', '', 'https://i.imgur.com/ZX3vYcsm.jpg', '<b style=\"font-weight:normal;\" id=\"docs-internal-guid-936f465b-7fff-4739-ff03-43f65e6f44ba\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:10pt;\"><span style=\"font-size:11.5pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Trên đầu nữ chính đột nhiên xuất hiện vòng sáng, cũng hôm đó, bố mẹ nữ chính đột nhiên trúng thưởng thăng chức, nữ chính và anh trai có thể chuyển đến trường cấp 2 quý tộc, nhưng hôm đó lúc nữ chính ngủ dựa vào khung truyện mà thấy được tác giả và biên tập đang tranh luận, phát hiện ra bản thân trở thành nữ chính có số mệnh bi kịch, thì ra sau này sẽ được rất nhiều anh đẹp trai thích, nhưng cũng không phải là chuyện tốt lành g<b>ì</b></span></p></b><br class=\"Apple-interchange-newline\">', 0, '2821', 0, 0, 0, 0, 'Hướng Đi Không Được Yêu Thích - TruyenHayTV', '❶❶✅ Đọc truyện tranh Hướng Đi Không Được Yêu Thích miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '12', 0, '', 0, 0, '', '', '', 0, 1630331459, 1630331838, 0, 0, 30),
(534, 293, 'Ngụy Trang Học Tra', '', '8,15', 'nguy-trang-hoc-tra', '', '', 'https://i.imgur.com/OzTARxem.jpg', '<p style=\"margin-bottom: 0px; padding: 0px; border: 0px; font-size: 13px; font-family: Montserrat, sans-serif; color: rgb(51, 51, 51);\">Tạ Du cùng Hạ Triều vốn là đại ca hai lầu Đông và Tây, đáng lẽ theo lệ thường nước giếng không phạm nước sông, nhưng lên đến lớp mười một, hai vị “thiếu niên phản nghịch” thuộc dạng phong vân trong trường không chỉ được xếp vào cùng một lớp mà còn trở thành bạn cùng bàn.</p><p style=\"margin-bottom: 0px; padding: 0px; border: 0px; font-size: 13px; font-family: Montserrat, sans-serif; outline: 0px; color: rgb(51, 51, 51);\">Hai tên này rõ ràng là học bá mà lại giả vờ làm học tra, diễn ngược diễn xuôi, cứ đến kì thi là tranh nhau hạng nhất đếm ngược, ngoài mặt thì ngày nào lên lớp cũng giả vờ chơi game, tỏ vẻ không tranh sự đời, sau lưng lại vụng trộm học tập. Sau đó… hai đầu gấu trường nói chuyện yêu đương.</p>', 0, '22874', 0, 0, 0, 0, 'Ngụy Trang Học Tra - TruyenHayTV', '❶❶✅ Đọc truyện tranh Ngụy Trang Học Tra miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '12', 0, '', 0, 0, '', '', '', 0, 1630331459, 1630331755, 0, 0, 30),
