(537, 293, 'Miêu Và Miêu Bạc Hà', '', '8,12,18,21,31', 'mieu-va-mieu-bac-ha', '', '', 'https://i.imgur.com/9GVy2GFm.jpg', '<p>Thế giới nơi con người và người thú sống chung, con người cho rằng người thú chưa hoàn thành tiến hóa, còn người thú lại cho rằng con người là loài hạ đẳng. Cho dù là khu dân cư hỗn hợp nơi những người khao khát hòa bình chung sống với nhau cũng vẫn sẽ tồn tại những người có mục đích khác</p>', 0, '2656', 0, 0, 0, 0, 'Miêu Và Miêu Bạc Hà - TruyenHayTV', '❶❶✅ Đọc truyện tranh Miêu Và Miêu Bạc Hà miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '14', 0, '', 0, 0, '', '', '', 0, 1630331459, 1630331723, 0, 0, 30),
(538, 293, 'Đêm Sao', '', '8,31', 'dem-sao', '', '', 'https://i.imgur.com/D95z5e4m.jpg', 'Trì Tinh được xưng là “Tinh Tai”, mỗi ngày anh ta đều sẽ gặp những chuyện xui xẻo. Nhưng từ khi anh ta quen biết được người tên là Lăng Diệp, tính cách quái gở kiêu kỳ và đôi chân bị tàn phế, đột nhiên phát hiện tai hoạ của anh ta đã được cải thiện, bên cạnh Lăng Diệp anh ta luôn được biến nguy thành an, nhưng ánh mắt của Lăng Diệp làm cho Trì Tinh luôn cảm thấy quen thuộc như đã từng gặp. Họ không biết rằng, cùng nhau vượt qua một chặng đau khổ đã trói buộc họ lại với nhau…', 0, '8528', 0, 0, 0, 0, 'Đêm Sao - TruyenHayTV', '❶❶✅ Đọc truyện tranh Đêm Sao miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '41', 0, '', 0, 0, '', '', '', 0, 1630331459, 1630331854, 0, 0, 30),
