(543, 293, 'Quốc Sư Đại Nhân, Liêm Sỉ Của Ngài Rơi Mất Rồi', '', '8,11,12,31', 'quoc-su-dai-nhan-liem-si-cua-ngai-roi-mat-roi', '', '', 'https://i.imgur.com/U4eEa2om.jpg', '<span style=\"color: rgb(29, 29, 29); font-family: arial, sans-serif; background-color: rgb(248, 248, 248);\">Uẩn Nhan là một siêu trộm ở thế kỷ 21, vì yêu mà quyết định rửa tay gác kiếm nhưng anh lại bị phản bội một cách thảm thương, sau khi sống lại trong đẫm máu, thì anh phát hiện mình – đứa con trai thứ hai đã trở thành nghĩa nữ A Yên của phủ tướng quân. Chờ chút đã! Tại sao một thằng con trai như anh lại phải mặc đồ của con gái?! Đã mặc đồ con gái thì phải mang theo nữ trang, nhưng tại sao cái tên họ Tô kia lại nhìn chằm chằm vào anh với nét mặt nghiền ngẫm thế? Lại còn thốt ra toàn lời kỳ quái? Tô Thiên Dạ: Nếu như ngươi đã tự động dâng tới cửa, ta cũng không còn lý do nào để cự tuyệt.</span>', 0, '9128', 0, 0, 0, 0, 'Quốc Sư Đại Nhân, Liêm Sỉ Của Ngài Rơi Mất Rồi - TruyenHayTV', '❶❶✅ Đọc truyện tranh Quốc Sư Đại Nhân, Liêm Sỉ Của Ngài Rơi Mất Rồi miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '37', 0, '', 0, 0, '', '', '', 0, 1630331459, 1630331841, 0, 0, 30),
(551, 17597, 'Thi Đại Học Toàn Cầu', '', '5,8,12', 'thi-dai-hoc-toan-cau', '', '', 'https://i.imgur.com/AtkrH19m.jpg', '<span id=\"docs-internal-guid-76c95852-7fff-9c23-dbf4-43e45cec2899\"><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Nguyên tác: Mộc Tô Lý/&nbsp; Diễn đàn văn học Tấn Giang</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Chủ bút: E Trạch</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Kịch bản: Quân Tử Mộc Tú</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Sản xuất: Hữu Mã Văn Hóa</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Xuất bản: Bạch Mộng Thị</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Biên tập: Huỳnh Hoặc</span></p><br><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Nội dung: Đây là một kỳ thi sống còn, vượt qua bài thi thì giữ được mạng sống. Khi giám thị phúc hắc [Tần Cứu] gặp thí sinh lạnh lùng [Du Hoặc]. Tuy cả hai đều bị mất trí nhớ, nhưng lại có thể phối hợp rất ăn ý để tìm ra lỗ hổng của hệ thống mất nhân tính và tìm cách thoát ra ngoài. Một lần cảnh báo là một lần hệ thống trở nên càng suy yếu, làn sương che phủ ký ức dần dần tan đi. Thì ra khi thế giới này biến thành chiến trường đẫm máu, anh và tôi vẫn tối sơ tương ngộ. Hệ thống gì chứ? Giết hết là được. Thế giới rộng lớn và vĩ đại này chào mừng chúng ta trở về.</span></p><div><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></div></span>', 0, '957', 0, 0, 0, 0, 'Thi Đại Học Toàn Cầu - TruyenHayTV', '❶❶✅ Đọc truyện tranh Thi Đại Học Toàn Cầu miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '5', 0, '', 0, 0, '', '', '', 0, 1630331459, 1630331773, 0, 0, 30),
