(576, 16208, 'Bí kíp sinh tồn của hầu gái', '', '5,9,32,34', 'bi-kip-sinh-ton-cua-hau-gai', '', '', 'https://i.imgur.com/hQHe2Fpm.jpg', 'Tôi tỉnh dậy trong khi đang nấu ramen thì tự dưng lại thành hầu gái của Nữ hoàng, người bị Nhà vua đối xử lạnh lùng trong cuốn tiểu thuyết BL. Nơi Vua là người đồng tính, người vợ lẽ cũng là đồng tính, hiệp sĩ cũng là người đồng tính, người hầu cũng là người đồng tính, và thủ thư cũnglà đồng tính. Liệu cô ấy có thể sống sót an toàn sau khi trở thành một hầu gái bình thường, Ash, người không phải là nhân vật chính? Cô hầu gái sẽ sống sót như thế nào đây!', 0, '18866', 0, 0, 0, 0, 'Bí kíp sinh tồn của hầu gái - TruyenHayTV', '❶❶✅ Đọc truyện tranh Bí kíp sinh tồn của hầu gái miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '45', 0, '', 0, 0, '', '', '', 0, 1630331462, 1630331860, 0, 0, 30),
(577, 370, 'Cửa Hàng Búp Bê Của Công Chúa', '', '9,10,18,34', 'cua-hang-bup-be-cua-cong-chua', '', '', 'https://i.imgur.com/CxxCYA3m.jpg', '<span style=\"color: rgb(123, 128, 132); font-family: Montserrat, sans-serif; text-align: justify;\">‘‘Chị chỉ muốn rời khỏi hoàng cung và sống theo ý mình mà thôi’’</span><br style=\"color: rgb(123, 128, 132); font-family: Montserrat, sans-serif; text-align: justify;\"><span style=\"color: rgb(123, 128, 132); font-family: Montserrat, sans-serif; text-align: justify;\">‘’….Rời khỏi cung ư’’</span><br style=\"color: rgb(123, 128, 132); font-family: Montserrat, sans-serif; text-align: justify;\"><span style=\"color: rgb(123, 128, 132); font-family: Montserrat, sans-serif; text-align: justify;\">Deon ngập ngừng hỏi lại. Hình như phản ứng của cậu ấy còn dữ dội hơn so với việc Cassia đứng trước mặt và yêu cầu cậu cho cô ấy một quốc gia.</span><br style=\"color: rgb(123, 128, 132); font-family: Montserrat, sans-serif; text-align: justify;\"><span style=\"color: rgb(123, 128, 132); font-family: Montserrat, sans-serif; text-align: justify;\">Trước lời hứa rằng sẽ chấp thuận lời hứa của mình, Cassia vui mừng vì không ngờ cậu ấy sẽ đồng ý. Cô chớp chớp mắt và nói Deon mau hỏi mình thích gì xem</span><br style=\"color: rgb(123, 128, 132); font-family: Montserrat, sans-serif; text-align: justify;\"><span style=\"color: rgb(123, 128, 132); font-family: Montserrat, sans-serif; text-align: justify;\">‘’Chị thích làm gì nào?’’</span>', 0, '11213', 0, 0, 0, 0, 'Cửa Hàng Búp Bê Của Công Chúa - TruyenHayTV', '❶❶✅ Đọc truyện tranh Cửa Hàng Búp Bê Của Công Chúa miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '25', 0, '', 0, 0, '', '', '', 0, 1630331462, 1630331858, 0, 0, 30),
(578, 17597, 'Bông Hoa Nở Rộ Của Ma Cà Rồng', '', '5,9,34', 'bong-hoa-no-ro-cua-ma-ca-rong', '', '', 'https://i.imgur.com/O2MKkyGm.jpg', '<span id=\"docs-internal-guid-3c18a439-7fff-78b6-483f-d158e9168bc1\"><font face=\"Times New Roman\"><p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 8pt;\"><span id=\"docs-internal-guid-3c18a439-7fff-78b6-483f-d158e9168bc1\"></span></p><p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 8pt;\"><span style=\"font-size: 16pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Một câu chuyện tình lãng mạn về một ma cà rồng tài giỏi kể về người mình yêu và cuộc phiêu lưu của anh để tìm ra “Hoa ma cà rồng” huyền thoại. Ma cà rồng Lourve bắt đầu cuộc phiêu lưu với người hợp đồng là người, Seoyoung, xuất hiện ở thế giới loài người sau 500 năm.</span></p></font></span>', 0, '1372', 0, 0, 0, 0, 'Bông Hoa Nở Rộ Của Ma Cà Rồng - TruyenHayTV', '❶❶✅ Đọc truyện tranh Bông Hoa Nở Rộ Của Ma Cà Rồng miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '7', 0, '', 0, 0, '', '', '', 0, 1630331462, 1630331847, 0, 0, 30),
