(580, 16208, 'Nữ hoàng bóng tối', '', '5,9,14', 'nu-hoang-bong-toi', '', '', 'https://i.imgur.com/NE7Lmfam.jpg', '<div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">“Ngươi có thể trở thành con gái của ta không?”</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">Nhờ lời đề nghị của Đại công tước Franché, Elena trở thành con gái giả mạo của ông ta. Sau khi kết hôn với Thái tử, có con và có được địa vị xã hội, con gái “quá cố” của Công tước, Tiểu thư Veronica, xuất hiện trước mặt cô.</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">Cô ấy chỉ là một con rối.</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">Cuối cùng, con trai của Elena bị bắt khỏi cô ấy và cô ấy bị sát hại...</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">Tuy nhiên... Cuối cùng cô đã trở về quá khứ.</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">\"Tôi sẽ nghiền nát từng người và từng người trong số các ngươi.\"</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">Để không bao giờ sống cuộc sống của một con rối nữa,</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">Cô thề sẽ trả thù kẻ thù của mình.</div>', 0, '51106', 0, 0, 0, 0, 'Nữ hoàng bóng tối - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nữ hoàng bóng tối miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '28', 0, '', 0, 0, '', '', '', 0, 1630331462, 1630331860, 0, 0, 30),
(581, 351, 'Vụng Trộm Không Thể Giấu', '', '5,8,15', 'vung-trom-khong-the-giau', '', '', 'https://i.imgur.com/glHRnZhm.jpg', 'Năm đó, tim Tang Trĩ đã dần dần phác họa nên bóng dáng một người , cô đã thích anh trai của bạn mình là Đoàn Gia Hứa, đôi mắt của anh ấy đẹp như hoa đào, thản nhiên gọi cô là \"đứa bé\", ngay từ lần đầu gặp nhau đã khiến Tang Trĩ không cách nào cưỡng lại được mà lại gần, nhưng chênh lệch 7 tuổi đối với họ là khoảng cách không thể vượt qua được, không biết từ bao giờ, tình yêu thầm kín chôn giấu trong tim đã chầm chậm nảy mầm, dần dần, nó cũng lan tỏa vào trái tim anh ấy... [Độc quyền / Cập nhật vào thứ Sáu hàng tuần, Biên tập viên: Molly]', 0, '20412', 0, 0, 0, 0, 'Vụng Trộm Không Thể Giấu - TruyenHayTV', '❶❶✅ Đọc truyện tranh Vụng Trộm Không Thể Giấu miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '10', 0, '', 0, 0, '', '', '', 0, 1630331462, 1630331856, 0, 0, 30),
(582, 17864, 'Tìm nàng Camellia', '', '5,9,11,34', 'tim-nang-camellia', '', '', 'https://i.imgur.com/Z8XtNwqm.jpg', '<span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap; background-color: rgb(228, 230, 235);\">Cuộc đời của cô ấy không còn gì ngoài sự dối trá. Khi chỉ mới 12 tuổi, cô ấy đã phải rời xa mẹ của mình trong khu ổ chuột và bị buộc phải sống dưới thân phận là con trai của một gia đình quý tộc. Nhưng dưới lớp màn của những bí mật và sự dối trá, cô ấy vẫn không bao giờ quên, vẫn luôn phấn đấu để có thể quay trở về con người thật của mình, để có thể giành lại cuộc sống của chính Camellia.</span>', 0, '1710', 0, 0, 0, 0, 'Tìm nàng Camellia - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tìm nàng Camellia miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '7', 0, '', 0, 0, '', '', '', 0, 1630331462, 1630331781, 0, 0, 30),
(583, 370, 'Ác Nữ Cần Bạo Chúa', '', '5,9,10,34', 'ac-nu-can-bao-chua', '', '', 'https://i.imgur.com/65R4dogm.jpg', '<p style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Tôi bị đầu độc bởi người em họ tôi yêu quý nhất, khi tôi tỉnh dậy thì đã là 1 năm về trước.</p><p style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Tôi quyết định biến bạo chúa thành của riêng mình để trả thù người em và gia đình cô ta vì đã hủy hoại tôi.</p><p style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">“Sao cô lại hôn ta”</p><p style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">“Bởi vì em họ tôi yêu ngài”</p><p style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Mối quan hệ nguy hiểm với bạo chúa chính thức bắt đầu…</p>', 0, '18462', 0, 0, 0, 0, 'Ác Nữ Cần Bạo Chúa - TruyenHayTV', '❶❶✅ Đọc truyện tranh Ác Nữ Cần Bạo Chúa miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '24', 0, '', 0, 0, '', '', '', 0, 1630331463, 1630331858, 0, 0, 30),
(585, 17597, 'Khu Vườn Im Lặng', '', '5,9,34', 'khu-vuon-im-lang', '', '', 'https://i.imgur.com/9mxejL7m.jpg', '<span style=\"color: rgb(53, 64, 82);\"><font face=\"Times New Roman\">Khi chồng và đứa con gái bị tai nạn trên biển và mất đi. Tôi đã nhận ra rằng cuộc sống của mình không còn được như xưa nữa. Người em trai của chồng mà người mẹ chồng ngày ngày gây khó dễ cho tôi. Tận cùng của cái chết, phép màu đã hiện ra và cho tôi trở lại một lần nữa!</font></span>', 0, '2705', 0, 0, 0, 0, 'Khu Vườn Im Lặng - TruyenHayTV', '❶❶✅ Đọc truyện tranh Khu Vườn Im Lặng miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '11', 0, '', 0, 0, '', '', '', 0, 1630331463, 1630331848, 0, 0, 30),
(586, 17597, 'Truyện tranh của Ropan Bing', '', '9,34', 'truyen-tranh-cua-ropan-bing', '', '', 'https://i.imgur.com/MeoqOnTm.jpg', '<span id=\"docs-internal-guid-b3bf3e44-7fff-445a-cb37-a5ec78fcb321\"><p dir=\"ltr\" style=\"line-height:1.295;margin-top:0pt;margin-bottom:8pt;\"><span style=\"font-size: 11pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Young Hee – cô học sinh cấp ba xuyên thành công chúa trong cuốn tiểu thuyết cô từng đọc. Cảm thấy bản thân không thể đảm nhận được vị trí Hoàng Hậu trong tương lai, ngay trang đầu tiên cô đã chạy khỏi tuyến đường nguyên tác. Một ngày yên bình ở nước bên cạnh, cô đã gặp được Choi Soo – cũng là người xuyên vào tiểu thuyết giống cô. Hai con người với mong muốn quay trở lại Hàn Quốc đã cùng nhau lập những kế hoạch để quay về thế giới của mình , nhưng lại vướng phải một vấn đề lớn – không có tiền. Cuối cùng họ quyết định cùng nhau thử buôn bán ẩm thực.</span></p><div><span style=\"font-size: 11pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></div></span>', 0, '0', 0, 0, 0, 0, 'Truyện tranh của Ropan Bing - TruyenHayTV', '❶❶✅ Đọc truyện tranh Truyện tranh của Ropan Bing miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '', 0, '', 0, 0, '', '', '', 0, 1630331463, 1630331463, 0, 0, 30),
