(592, 370, 'Công Chúa Điện Hạ Bị Thần Phạt', '', '5,8,10', 'cong-chua-dien-ha-bi-than-phat', '', '', 'https://i.imgur.com/4efmJjZm.jpg', '<p>Công chúa điện hạ bị thần phạt</p><p>Đức vua của ta, vì sao ngài lại chĩa kiếm về phía ta? Nếu được quay lại, kỵ sĩ của ta liệu có còn bảo vệ ta đến cùng? Cho dù ta là công chúa bị thần hạ lời nguyền. </p>', 0, '2997', 0, 0, 0, 0, 'Công Chúa Điện Hạ Bị Thần Phạt - TruyenHayTV', '❶❶✅ Đọc truyện tranh Công Chúa Điện Hạ Bị Thần Phạt miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '5', 0, '', 0, 0, '', '', '', 0, 1630331463, 1630331828, 0, 0, 30),
(593, 18485, 'Sổ Tay Nuôi Dưỡng Rồng', '', '5,8,10,14,34', 'so-tay-nuoi-duong-rong', '', '', 'https://i.imgur.com/uVPFfklm.jpg', '<div><br></div><div>Nội dung: Rạng sáng, nữ chính đột ngột qua đời tại ga tàu điện ngầm do làm việc quá sức. “Nếu có chuyện luân hồi như vậy, xin hãy cho con ngậm thìa vàng vào sinh. Tôi muốn có quyền lực tối cao, và cả của cải vô số không thể phung phí ~ Những lời cuối cùng vốn được coi là một trò đùa nửa vời này, bằng cách nào đó đã trở thành sự thật?! Linh hồn của nữ chính đã nhập vào một trò chơi và trở thành một công chúa thực sự , đây có phải là huyền thoại</div><div><br></div>', 0, '0', 0, 0, 0, 0, 'Sổ Tay Nuôi Dưỡng Rồng - TruyenHayTV', '❶❶✅ Đọc truyện tranh Sổ Tay Nuôi Dưỡng Rồng miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '', 0, '', 0, 0, '', '', '', 0, 1630331463, 1630331463, 0, 0, 30),
