(598, 734, 'Tát Dã', '', '12,31', 'tat-da', '', '', 'https://i.imgur.com/0HxdBJim.jpg', '<span style=\"font-family: Poppins;\">Tôi muốn, vai trái có cậu, vai phải mỉm cười. Tôi muốn, trong mắt cậu, chạy ngang ngược. Tôi muốn, một ánh mắt, liền đến già. Học sinh xuất sắc Tưởng Thừa bị gia đình nuôi \"lưu đày\" đến nhà cha ruột ở xưởng thép, hoàn cảnh lạ lẫm, người cha thô thiển khiến cậu cảm thấy áp lực buồn bực. Cho đến một ngày nọ, nhờ cơ duyên xảo hợp, Tưởng Thừa gặp \"tiểu bá vương xưởng thép\" Cố Phi, từ đây bắt đầu câu chuyện về \"cứu vớt\" và \"hy vọng\"...</span>', 0, '0', 0, 0, 0, 0, 'Tát Dã - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tát Dã miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '', 0, '', 0, 0, '', '', '', 0, 1630331463, 1630331463, 0, 0, 30),
(599, 16208, 'Nhật ký quan sát Elena Evoy', '', '5,9,23', 'nhat-ky-quan-sat-elena-evoy', '', '', 'https://i.imgur.com/CAkPefdm.jpg', '<div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">Mọi người không nghi ngờ gì rằng Johann sẽ là học sinh đứng đầu Học viện. Suy cho cùng thì anh ta sở hữu một khuôn mặt được Chúa trời ban tặng, một tính cách thân thiện, và tài năng trong cả thể thao và học thuật. Tuy nhiên, vị trí đó đã bị người khác chiếm mất.</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">\"Elena. Xin chúc mừng thành tích của cậu nhé.\"</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">\"Cảm ơn.\"</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">Elena, người thậm chí còn không biết tên anh ta, thì khác.</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">Cô ấy không nói bất cứ điều gì với anh ta, mặc dù hầu hết mọi người đều muốn có cơ hội để nói chuyện với anh ta.</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">\"Cậu còn điều gì muốn nói không?\"</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">Lòng tự trọng của Johann tan vỡ khi anh nhận ra cô không nhớ anh là ai.</div><div dir=\"auto\" style=\"animation-name: none !important; transition-property: none !important;\">Kể từ lúc đó, Johann bắt đầu quan sát Elena.</div>', 0, '1365', 0, 0, 0, 0, 'Nhật ký quan sát Elena Evoy - TruyenHayTV', '❶❶✅ Đọc truyện tranh Nhật ký quan sát Elena Evoy miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '6', 0, '', 0, 0, '', '', '', 0, 1630331464, 1630331797, 0, 0, 30),
(600, 17864, 'opellia không thể rời khỏi gia tộc công tước', '', '5,9', 'opellia-khong-the-roi-khoi-gia-toc-cong-tuoc', '', '', 'https://i.imgur.com/uHHjJ6um.jpg', 'xem là biết~', 0, '6577', 0, 0, 0, 0, 'opellia không thể rời khỏi gia tộc công tước - TruyenHayTV', '❶❶✅ Đọc truyện tranh opellia không thể rời khỏi gia tộc công tước miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '22', 0, '', 0, 0, '', '', '', 0, 1630331464, 1630331845, 0, 0, 30),
(605, 370, 'Muốn Cứu Thế Giới Thì Phải Thật Đáng Yêu', '', '5,8,14', 'muon-cuu-the-gioi-thi-phai-that-dang-yeu', '', '', 'https://i.imgur.com/DkUbh66m.jpg', '<span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Trong bờ vực thẳm ở tận cùng thế giới song song nằm bên ngoài trái đất, có 12 phong ấn tiên ma đã phong ấn một nhóm ác ma còn sót lại từ thời cổ xưa, mỗi phong ấn đều có một tiểu tiên ma đáng yêu canh giữ. Rồi một ngày, phiên vương làm loạn, tiên ma bị thiệt hại nặng nề. Phiên vương lấy danh nữ vương bí mật truyền lệnh gọi 12 tiên ma đến, thực chất là muốn giết sạch bọn họ. Lạc Tiên là tiên ma có pháp lực yếu nhất trong 12 người vì mắc chứng trì hoãn nên đã đến muộn, nhờ thế mà may mắn thoát khỏi kiếp nạn. Vì muốn cứu đồng đội của mình, cậu đã mở phong ấn mượn sức mạnh của ác ma để cứu 11 tiên tử còn lại. Phiên vương liên thủ với ác ma thi triển lời nguyền, khiến bọn họ trở lại làm một đứa trẻ bình thường không còn phép thuật…</span>', 0, '1280', 0, 0, 0, 0, 'Muốn Cứu Thế Giới Thì Phải Thật Đáng Yêu - TruyenHayTV', '❶❶✅ Đọc truyện tranh Muốn Cứu Thế Giới Thì Phải Thật Đáng Yêu miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '7', 0, '', 0, 0, '', '', '', 0, 1630331464, 1630331853, 0, 0, 30);
