(606, 17597, 'Phu Quân Bạo Chúa Của Ta Đã Thay Đổi Rồi', '', '5,9,32,34', 'phu-quan-bao-chua-cua-ta-da-thay-doi-roi', '', '', 'https://i.imgur.com/FTk8qWKm.jpg', '<div>Idris vì gia tộc mà bị ép phải kết hôn với đại công tước bạo chúa. Cô là đứa con hoang của một công tước và chưa bao giờ nhận được tình thương của gia đình, và thế là cô phải đi đến cuộc hôn nhân bất hạnh với đại công tước bạo chúa Khalid. Một ngày kia, Idris bị thích khách đâm thằng vào bụng rồi trút hơi thở cuối cùng với lời nói mơ màng của Khalid “ hẹn gặp lại”. Idris tỉnh lại thì thấy quay về ngày tổ chức hôn lễ, nhưng mà Khalid mà chưa từng mỉm cười dù chỉ một lần bây giờ toàn nói ra những lời ngọt ngào và cười, nói sẽ làm tất cả vì cô.... Đột nhiên phu quân bạo chúa của tôi... đã thay đổi!</div><div><br></div>', 0, '1239', 0, 0, 0, 0, 'Phu Quân Bạo Chúa Của Ta Đã Thay Đổi Rồi - TruyenHayTV', '❶❶✅ Đọc truyện tranh Phu Quân Bạo Chúa Của Ta Đã Thay Đổi Rồi miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '9', 0, '', 0, 0, '', '', '', 0, 1630331464, 1630331844, 0, 0, 30),
(607, 370, 'Cục Cưng Của Tôi Là Máy Cưa Trai', '', '5,8,20,34', 'cuc-cung-cua-toi-la-may-cua-trai', '', '', 'https://i.imgur.com/NGoraJBm.jpg', '<span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">An Cửu Cửu – Hacker hàng đầu trà trộn vào hội bán đấu giá, vốn định lấy trộm một viên đá quý, nhưng không ngờ lại lạc mất con! Đổi lại là một đứa trẻ trông giống hệt con trai mình, nhưng hơi khờ khạo! Khi An Cửu Cửu – hồ ly quyến rũ gặp phải Quý Cẩm Thần – cáo già xảo quyệt, trốn chui trốn lủi vẫn bị anh ta bắt được. Được rồi! Nếu đã không trốn được, vậy thì huấn luyện anh ta thành cún con ngoan ngoãn thôi. Duyên phận trời định cái gì, chúng tôi đã sinh được hai đứa rồi!</span>', 0, '2304', 0, 0, 0, 0, 'Cục Cưng Của Tôi Là Máy Cưa Trai - TruyenHayTV', '❶❶✅ Đọc truyện tranh Cục Cưng Của Tôi Là Máy Cưa Trai miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '2', 0, '', 0, 0, '', '', '', 0, 1630331464, 1630331834, 0, 0, 30),
(608, 370, 'Ly Hôn Đi Chồng', '', '5,9,11', 'ly-hon-di-chong', '', '', 'https://i.imgur.com/GLoqRa9m.jpg', '<span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Nữ chính xuyên không vào một vai phụ sẽ phải chết vì bị cuốn vào tội phản nghịch do chồng mình gây ra. Để được sống sót, cô ấy định ly hôn với chồng mình là Claude.. nhưng chồng cô ấy không chịu buông cô ấy.</span><br style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\"><span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">“…chúng ta ly hôn đi”</span><br style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\"><span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">“ ta hoàn toàn không có ý định buông bỏ nàng”</span><br style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\"><span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Trong cuốn tiểu thuyết, rõ ràng có ghi là người chồng không hề quan tâm đến vợ mình, là một công tước máu lạnh và tàn độc, nhưng vì sao lại từ chối lời đề nghị ly hôn nhỉ?</span><br style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\"><span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">“dù ta có chết cũng không buông nàng ra”</span><br style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\"><span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Trong khi không thích mình… mà sao trong mắt người đó lại cháy lên ngọn lửa của sự vấn vương vậy?</span><br style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\"><span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Mua chiếc nhẫn kim cương đắt nhất đế quốc tặng mình để níu mình lại, trao cho mình cả hoa và đá quý… Tôi không muốn cuộc sống hôn nhân này vì dù là trong mơ tôi cũng không muốn phải chết vì bị cuốn vào tội phản nghịch.</span><br style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\"><span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Tôi muốn sống! nên xin anh hãy ly hôn với tôi đi!</span>', 0, '10035', 0, 0, 0, 0, 'Ly Hôn Đi Chồng - TruyenHayTV', '❶❶✅ Đọc truyện tranh Ly Hôn Đi Chồng miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '21', 0, '', 0, 0, '', '', '', 0, 1630331464, 1630331829, 0, 0, 30),
