(616, 370, 'Tôi Có Năm Ông Bố Đều Là Đại Boss', '', '5,8,20', 'toi-co-nam-ong-bo-deu-la-dai-boss', '', '', 'https://i.imgur.com/SfLpyurm.jpg', '<span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Tiểu hoà thượng Kỉ An Nguyễn vô danh được sư phụ nuôi nấng từ nhỏ. Khi cô lên 5, sư phụ dẫn cô xuống núi để tìm 5 người bố mà cô chưa từng gặp mặt bao giờ. Nhờ vào sự đáng yêu của mình, Nhuyễn Nhuyễn đã thành công làm người bố đầu tiên động lòng khi đi khảo sát môi trường tình cờ gặp phải cô – Mặc Thâm. Mặc Thâm từng rất ghét trẻ con và cũng không muốn có con, giờ đây vì ở cùng Nhuyễn Nhuyễn mà cậu dần dần bị chinh phục, trở thành một người bố yêu con chuẩn mực. Nhưng lúc đó Mặc Thâm…</span>', 0, '27258', 0, 0, 0, 0, 'Tôi Có Năm Ông Bố Đều Là Đại Boss - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tôi Có Năm Ông Bố Đều Là Đại Boss miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '33', 0, '', 0, 0, '', '', '', 0, 1630331464, 1630331854, 0, 0, 30),
(617, 17662, 'Tôi không cố tình quyến rũ nam chính', '', '5,9,10,14,32,34', 'toi-khong-co-tinh-quyen-ru-nam-chinh', '', '', 'https://i.imgur.com/KmYKAfdm.jpg', '<div>Tôi đã xuyên không trở thành một phu nhân nam tước đã góa chồng ( chồng chết ),</div><div>Sau bao nỗ lực, cô ấy đã trở thành cao thủ giới tình trường, nữ vương của giới thượng lưu, một ngày nọ, có một đề nghị hấp dẫn đến với cô ấy.</div><div>&nbsp;“hãy truyền cảm hứng yêu đương cho con trai của ta đi”</div><div>Đây là đề nghị của một công tước luôn lo lắng cho đứa con trai không biết yêu đương như người gổ của mình.</div><div>Dù sao thì đó cũng là nam chính sẽ được kết đôi cùng công chúa, nên tôi đã đi đến đó với giấc mơ sẽ hốt được một mẻ cực lớn, cũng sẵn tiện xem mặt mũi nam chính thế nào.</div><div>Cuối cùng tôi đã trải qua một đêm mà bản thân không lường trước được</div><div>\"Vấn đề của anh là...\"</div><div>Anh ấy, người mà mình nghĩ sẽ không bao giờ gặp lại, đang ở trước mặt mình.</div><div>Đêm hôm ấy ta đã phải lòng nàng.</div><div>\"Ê anh kia, tôi là người đã góa chồng ( chồng chết ), còn anh là chú rể có tương lai số hưởng nhất trần đời đấy.\"</div><div>Cuối cùng tôi đã bị cuốn vào scandal lớn nhất đế quốc</div><div>---------------------------------</div><div>P/s : bộ truyện này rất hay nét vẽ còn đẹp nữa, mn cùng hóng với team a~</div><div><br></div><div>VUI LÒNG KHÔNG REUP DƯỚI MỌI HÌNH THỨC!</div><div>#truyen_tranh #truyen #dep #ngon_tinh #manhwa</div>', 0, '32200', 0, 0, 0, 0, 'Tôi không cố tình quyến rũ nam chính - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tôi không cố tình quyến rũ nam chính miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '22', 0, '', 0, 0, '', '', '', 0, 1630331464, 1630331857, 0, 0, 30),
(618, 17662, 'Ôm chặt áo gile nhỏ của tôi', '', '5,8,34', 'om-chat-ao-gile-nho-cua-toi', '', '', 'https://i.imgur.com/L7TXGLEm.jpg', 'Hào môn Lục gia xảy ra một chuyện cười, thiên kim nuôi mười mấy năm vậy mà lại là giả. Hoắc Diểu vừa đến dứt khoát xách hành lý cùng thiên kim thật trở về nhà, thế nhưng khi nhìn thấy tấm thẻ đen vô hạn mức mà ba đưa cho, lại nhìn mấy người anh của mình, cô trầm mặc. Bốn người anh chẳng lẽ đều là những kẻ ăn bám ba mẹ ư ? Ngay cả anh trai hàng xóm trước đây vô dụng cũng…. Hoắc Diểu ôm chặt lấy những chiếc áo gile của mình, không dám lên tiếng.', 0, '1019', 0, 0, 0, 0, 'Ôm chặt áo gile nhỏ của tôi - TruyenHayTV', '❶❶✅ Đọc truyện tranh Ôm chặt áo gile nhỏ của tôi miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '0', 0, '', 0, 0, '', '', '', 0, 1630331464, 1630331827, 0, 0, 30),
