(620, 17662, 'Ta Dùng Mỹ Nhan Dẹp Yên Thiên Hạ', '', '8,11,12,14', 'ta-dung-my-nhan-dep-yen-thien-ha', '', '', 'https://i.imgur.com/UaLqRdBm.jpg', '<span style=\"font-family: FacebookEmoji, -apple-system, BlinkMacSystemFont, &quot;Apple Color Emoji&quot;, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap; background-color: rgb(245, 245, 245);\">Cố Nguyên Bạch xuyên không thành tên Hoàng Đế ốm yếu bệnh tật trong cuốn tiểu thuyết “Quyền Thần”, tự nhủ sẽ cố gắng phát triển sự nghiệp không lâu thì phát hiện mình chỉ còn sống được vài năm nữa, hắn quyết định tiếp cận thần tử soái ca Nhiếp Chính Vương chó điên Tiết Viễn xây đắp tình huynh đệ. Thế nhưng Tiết Viễn lại là một kẻ quá kiêu ngạo…\r\n\r\nCố Nguyên Bạch chỉ còn cách,…\r\n\r\nThần Tử Chó Điên Công\r\n\r\nX\r\n\r\nỐm Yếu Hoàng Đế Thụ\r\n\r\nCố\r\n\r\n(直 男) Thẳng nam\r\n\r\nNguyên\r\n\r\n(一心搞事业) Một lòng vì sự nghiệp\r\n\r\nBạch\r\n\r\nXuyên qua thành Hoàng Đế mỹ nhân ốm yếu\r\n\r\nThích phiêu lưu mạo hiểm/ thẳng nam\r\n\r\n薛 Tiết\r\n\r\n(疯狗) Chó điên\r\n\r\n远 Viễn\r\n\r\nKẻ không Ham Quyền Lực, chó trung thành\r\n\r\nTướng quân điên thích cười của nguyên tác.\r\n\r\nThế nhưng, Tiết Viễn lại quá kiêu ngạo khiến Cố Nguyên Bạch khó lòng chinh phục, quyết định huấn luyện chú chó hoang này dần dần để phục vụ cho mục đích của mình.\r\n\r\nNhưng hình như. … ngay từ đầu đã thuần phục được hắn rồi.\r\n\r\nDùng Mỹ Nhan Dẹp Yên Thiên Hạ\r\n\r\nChuyển thể từ tiểu thuyết cùng tên \" Ta Dùng Mỹ Nhan Dẹp Yên Thiên Hạ\", Nguyên Tác: Vọng Tam Sơn\r\n\r\nĐón xem cập nhật mới nhất vào mùa hè này</span>', 0, '1558', 0, 0, 0, 0, 'Ta Dùng Mỹ Nhan Dẹp Yên Thiên Hạ - TruyenHayTV', '❶❶✅ Đọc truyện tranh Ta Dùng Mỹ Nhan Dẹp Yên Thiên Hạ miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '1', 0, '', 0, 0, '', '', '', 0, 1630331464, 1630331839, 0, 0, 30),
(621, 291, 'Tôi Kiên Quyết Từ Chối Trở Thành Ma Nữ', '', '5,8,10,14,15,16,17,18', 'toi-kien-quyet-tu-choi-tro-thanh-ma-nu', '', '', 'https://i.imgur.com/UZ5NQBym.jpg', '<p>Xuyên thành đại BOSS phản diện trong trò chơi Otome, thật ra An Đại Nhĩ không hoảng loạn. Chỉ cần cô tu thân dưỡng tính, tránh xa mọi cốt truyện thức tỉnh năng lực ma nữ thì sẽ không trở thành đá kê chân của nguyên chủ. Nhưng thực tế chứng minh…suy nghĩ rất tốt đẹp, nhưng hiện thực càng là ảo mộng. An Đại Nhĩ: Tôi chỉ muốn yên yên ổn ổn, chỉ cần tôi ổn, tôi sẽ không chết. Nhưng hệ thống chết tiệt kia không phải người, cứ muốn ép tôi làm em trai!<br></p>', 0, '11940', 0, 0, 0, 0, 'Tôi Kiên Quyết Từ Chối Trở Thành Ma Nữ - TruyenHayTV', '❶❶✅ Đọc truyện tranh Tôi Kiên Quyết Từ Chối Trở Thành Ma Nữ miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '15', 0, '', 0, 0, '', '', '', 0, 1630331465, 1630331850, 0, 0, 30),
