(635, 17662, 'Vụng trộm không thể giấu - Nhà của Munn', '', '5,8,15,18', 'vung-trom-khong-the-giau-nha-cua-munn', '', '', 'https://i.imgur.com/KWzs0Pvm.jpg', '<div>Tang Trĩ tự biết yêu sớm là không tốt. Chỉ là cô không thể kiềm lòng được trước người con trai kia.</div><div><br></div><div>Vẻ ngoài lãnh đạm, nhìn có chút lười biếng, là một người khi nhìn vào khiến người khác cảm giác rằng anh là một người lông bông. Thế mà lại làm cô bé mới mười ba tuổi rung động.</div><div><br></div><div>Cứ mỗi lần anh ta ghé đến nhà cô để chơi game cùng anh trai, cô lại thỉnh thoảng đến bưng đồ ăn vào</div><div><br></div><div>Anh ta sẽ tựa như vô tình nâng hờ mí mắt, rồi cười đến yêu nghiệt nói: “Nhóc con, em sao vậy? Vừa nhìn thấy anh liền đỏ mặt.”</div>', 0, '586', 0, 0, 0, 0, 'Vụng trộm không thể giấu - Nhà của Munn - TruyenHayTV', '❶❶✅ Đọc truyện tranh Vụng trộm không thể giấu - Nhà của Munn miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '8', 0, '', 0, 0, '', '', '', 0, 1630331465, 1630331849, 0, 0, 30),
(636, 17662, 'Onsaemiro', '', '5,9,10,14,18,21', 'onsaemiro', '', '', 'https://i.imgur.com/v8tPEEKm.jpg', '<span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap;\">Để chuẩn bị cho buổi casting trong bộ phim lịch sử “Tháp Muyoung\" sắp tới, , Haeri đã đến thăm Bảo tàng Quốc gia Buyeo, và tình cơ nhìn thấy chiếc \"Lư hương bằng đồng mạ vàng”, một món đồ chế tác cổ của Baekje. Nhờ cô ấy, Onsaemiro, vị thần đã ngủ quên trong lư hương, thức tỉnh và bắt đàu vòng xoay số phận mới…</span>', 0, '261', 0, 0, 0, 0, 'Onsaemiro - TruyenHayTV', '❶❶✅ Đọc truyện tranh Onsaemiro miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '5', 0, '', 0, 0, '', '', '', 0, 1630331466, 1630331853, 0, 0, 30),
(637, 370, 'Trước Tiên Phải Giấu Em Trai Cái Đã!', '', '5,9,14,34', 'truoc-tien-phai-giau-em-trai-cai-da-', '', '', 'https://i.imgur.com/BEnLR9Cm.jpg', '<p style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Hà cớ gì tôi lại chuyển sinh vào thân xác của chị nam chính trong truyện tranh BL nặng đô 19+ này chứ!</p><p style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Xui xẻo hơn, nạn nhân đầu tiên kẻ điên cuồng nam chính muốn giết hại một cách dã man lại chính là tôi, chị của nam chính sao… Tôi không muốn chết như thế này, phải vạch ra kế hoạch thôi!</p><p style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Trước tiên, phải giấu em trai khỏi tầm mắt của tên điên nam chính mới được!</p>', 0, '4159', 0, 0, 0, 0, 'Trước Tiên Phải Giấu Em Trai Cái Đã! - TruyenHayTV', '❶❶✅ Đọc truyện tranh Trước Tiên Phải Giấu Em Trai Cái Đã! miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '21', 0, '', 0, 0, '', '', '', 0, 1630331466, 1630331850, 0, 0, 30),
(638, 17597, 'Kế Hoạch Chọn Papa Của Công Chúa', '', '9,14,32,34', 'ke-hoach-chon-papa-cua-cong-chua', '', '', 'https://i.imgur.com/J2OXdUqm.jpg', '<span id=\"docs-internal-guid-080cb7de-7fff-c905-24df-4987cffc2923\"><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">JaeHee Cheon, một cô gái bị lạc mất cha mẹ từ khi còn nhỏ và cô không thể nhớ được khuôn mặt của họ, một con người sống mà không có nổi một đứa bạn, huống gì nói đến người yêu, lại tái sinh thành cô công chúa trong một cuốn tiểu thuyết bị chết yểu ở tuổi 12! Và nếu không tìm ra được cha ruột của công chúa, cô ấy sẽ chết. Nhưng lại có tới bốn ứng cử viên??? Và vấn đề nhức nhối nhất ở đây là bọn họ lại quá đáng sợ và chết chóc. Liệu Chun Jae-Hee có thể tìm ra người cha thực sự của mình một cách an toàn và kết thúc có hậu hay không?</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></span>', 0, '3083', 0, 0, 0, 0, 'Kế Hoạch Chọn Papa Của Công Chúa - TruyenHayTV', '❶❶✅ Đọc truyện tranh Kế Hoạch Chọn Papa Của Công Chúa miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '11', 0, '', 0, 0, '', '', '', 0, 1630331466, 1630331855, 0, 0, 30),
(639, 17597, 'Chuyện Tình Của Kẻ Khác', '', '5,9,34', 'chuyen-tinh-cua-ke-khac', '', '', 'https://i.imgur.com/HVYDboVm.jpg', '<span id=\"docs-internal-guid-fa1be984-7fff-64da-50a5-00acbb42006a\"><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Một tình yêu sâu đậm mà tôi muốn trải nghiệm ngay cả khi tôi phải chịu đau đớn, tổn thương và cam chịu. Tôi đã có một cuộc gặp gỡ bất ngờ khi tôi nghĩ rằng mình không còn sự may mắn nào. Liệu lần này sẽ là tình yêu chứ?</span></p><br></span>', 0, '299', 0, 0, 0, 0, 'Chuyện Tình Của Kẻ Khác - TruyenHayTV', '❶❶✅ Đọc truyện tranh Chuyện Tình Của Kẻ Khác miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '4', 0, '', 0, 0, '', '', '', 0, 1630331466, 1630331861, 0, 0, 30),
(640, 370, 'Hỏi Đan Chu', '', '8,11,34', 'hoi-dan-chu', '', '', 'https://i.imgur.com/TfQxAham.jpg', '<span style=\"color: rgb(123, 128, 132); font-family: montserrat, sans-serif; text-align: justify;\">Kiếp trước, Trần Đan Chu – con gái Thái phó nước Ngô nước mất nhà tan, sống lại vào mười năm trước, nàng hóa thân thành “hắc liên hoa” giỏi đóng kịch, giết nam nhân cặn bã, làm gian tế, trêu quần thần, đánh “bạch liên hoa”, nhận giặc làm cha… kiên quyết đi theo con đường phản diện, khiến phe phản diện hết đường để đi! Đại tướng quân triều đình đeo mặt nạ sắt kia hận Đan Chu lòng dạ độc ác, mưu mô xảo quyệt, nhưng đợi đến khi Đan Chu ngọt ngào gọi một tiếng cha nuôi… thì sao lại vẫn lên tiếng đáp lại!</span>', 0, '248', 0, 0, 0, 0, 'Hỏi Đan Chu - TruyenHayTV', '❶❶✅ Đọc truyện tranh Hỏi Đan Chu miễn phí, dịch full Tiếng Việt, cập nhật nhanh nhất và sớm nhất tại TruyenHayTV', '4', 0, '', 0, 0, '', '', '', 0, 1630331466, 1630331855, 0, 0, 30),
