INSERT INTO `phim` (`id`, `user_id`, `tieu_de`, `ten_khac`, `category`, `link`, `link_copy`, `tags`, `minh_hoa`, `content`, `thich`, `luot_xem`, `view_day`, `view_week`, `view_month`, `view_year`, `title`, `description`, `tap_moi`, `full`, `loai_hinh`, `hot`, `moi`, `thoi_luong`, `nam`, `rate`, `rate_number`, `date_post`, `update_post`, `follow`, `crawl`, `ngay`) VALUES
(645, 1, 'Tiên Nghịch', '', '35,36', 'tien-nghich', 'https://hh3dhay.com/tien-nghich-thuyet-minh', 'Tiên Nghịch, phim tiên hiệp', '/uploads/minh_hoa/tien-nghich-1697074670.jpg', 'Phim kể về cuộc hành trình của Vương Lâm, một thiếu niên bình thường trở thành một trong những tu sĩ mạnh nhất trong thế giới tiên hiệp. Là một thiếu niên may mắn, bị cuốn vào thế giới tu tiên của nước Triệu. Ban đầu, hắn thiếu linh căn và không có tri thức về thế giới này. Tuy nhiên, một hiểu lầm tai hại và một khối thiết tinh bí ẩn đã thay đổi cuộc đời của Vương Lâm mãi mãi. Hắn nhận được một \"hạt châu thần bí\", sự hỗ trợ quý báu trong việc trở thành một tu sĩ mạnh mẽ. Con đường tu tiên của Vương Lâm không hề dễ dàng. Hắn phải đối mặt với những thử thách đầy khó khăn và hiểm nguy, chiến đấu với các thế lực tà ác và khám phá những bí ẩn sâu thẳm về thế giới tiên hiệp. Cuộc hành trình này không chỉ là về sức mạnh, mà còn về sự trưởng thành, trí tuệ và lòng dũng cảm trong trái tim của Vương Lâm', 0, '23', 15, 15, 15, 16, 'Tiên Nghịch', 'Phim kể về cuộc hành trình của Vương Lâm, một thiếu niên bình thường trở thành một trong những tu sĩ mạnh nhất trong thế giới tiên hiệp. Là một thiếu niên may mắn, bị cuốn vào thế giới tu tiên của nước Triệu. Ban đầu, hắn thiếu linh căn và không có tri thức về thế giới này. Tuy nhiên, một hiểu lầm tai hại và một khối thiết tinh bí ẩn đã thay đổi cuộc đời của Vương Lâm mãi mãi. Hắn nhận được một \"hạt châu thần bí\", sự hỗ trợ quý báu trong việc trở thành một tu sĩ mạnh mẽ. Con đường tu tiên của Vương Lâm không hề dễ dàng. Hắn phải đối mặt với những thử thách đầy khó khăn và hiểm nguy, chiến đấu với các thế lực tà ác và khám phá những bí ẩn sâu thẳm về thế giới tiên hiệp. Cuộc hành trình này không chỉ là về sức mạnh, mà còn về sự trưởng thành, trí tuệ và lòng dũng cảm trong trái tim của Vương Lâm', 'Tập 1', 0, '3D', 1, 1, '5/24', '2023', '', 0, 1697074670, 1697074704, 0, 1, 25),
