INSERT INTO `post` (`id`, `tieu_de`, `minh_hoa`, `link`, `noidung`, `title`, `description`, `view`, `date_post`) VALUES
(2, 'Điều khoản sử dụng', '/uploads/minh_hoa/dieu-khoan-su-dung-1618659483.jpg', 'dieu-khoan-su-dung', '<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 17px;\"><span style=\"box-sizing: border-box; font-size: 14px;\">Khi sử dụng website này, quý khách phải tuân thủ chính sách bảo mật và các điều khoản của chúng tôi.</span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 17px;\"><span style=\"box-sizing: border-box; font-size: 14px;\">Mục đích của website là mang lại cho quý khách giải trí sau những ngày làm việc căng thẳng vì vậy khi sử dụng website này quý khách hãy thực hiện việc giải trí lành mạnh, không cung cấp thông tin cá nhân cho bất kỳ một ai, chúng tôi không yêu cầu thông tin cá nhân của quý vị.</span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 17px;\"><span style=\"box-sizing: border-box; font-size: 14px;\">Không bình luận nội dung liên quan đến tôn giáo, chính trị, phân biệt chủng tộc, phân biệt vùng miền, phỉ báng, lăng mạ, hận thù, chia rẽ, đe dọa, xúc phạm, có chứa thông tin cá nhân của người khác, vi phạm bản quyền, phạm pháp, khuyến khích hành vi phạm pháp...</span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 17px;\"><span style=\"box-sizing: border-box; font-size: 14px;\">Thực hiện chính sách bảo mật theo quy định của website và của nước sở tại, không xâm phạm đến thông tin các nhân của các thành viên khác, luôn tuân thủ các quy định của pháp luật về thông tin trên mạng.</span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 17px;\"><span style=\"box-sizing: border-box; font-size: 14px;\">Để sử dụng dịch vụ này yêu cầu quý khách phải trên 3 tuổi và phải đồng ý với các điều khoản về chính sách bảo mật thông tin của chúng tôi, nếu quý khách không đồng ý hay vi phạm các điều khoản trên quý khách phải chịu trách nhiệm về hành vi của mình và chúng tôi sẽ từ chối cung cấp dịch vụ cho quý khách. Qúy khách có thể gửi yêu cầu cho chúng tôi.</span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 17px;\"><span style=\"box-sizing: border-box; font-size: 14px;\">Mọi thắc mắc quý khách có thể gửi yêu cầu cho chúng tôi ở mục Liên Hệ, chúng tôi sẽ tiếp nhận các thông tin mà quý khách gửi mà phản hồi cho quý khách trong 3 ngày làm việc.</span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 17px;\"><span style=\"box-sizing: border-box; font-size: 14px;\">Chính sách thay đổi thông tin</span></p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 17px;\"><span style=\"box-sizing: border-box; font-size: 14px;\">Quý khách thường xuyên theo dõi sự thay đổi chính sách bảo mật thông tin, chúng tôi sẽ thay đổi chính sách bảo mật thông tin bất cứ lúc nào.</span></p>', 'Điều khoản sử dụng dịch vụ', 'Điều khoản sử dụng dịch vụ đọc truyện tranh trên website.', 4, '1618659483');
